INSERT INTO `soal_tryout` (`id`, `question_type`, `tps_type`, `penalaran_type`, `penalaran_induktif_detail`, `penalaran_deduktif_detail`, `penalaran_kuantitatif_detail`, `pemahaman_pemahaman_type`, `pemahaman_type`, `kuantitatif_type`, `tl_type`, `tl_indonesia_type`, `tl_matematika_type`, `tl_inggris_type`, `question`, `option_a`, `option_b`, `option_c`, `option_d`, `option_e`, `correct_answer`, `answer_explanation`, `created_at`, `updated_at`, `materi_id`) VALUES
(2, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Analisis data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Di sebuah desa, terdapat 100 orang yang terdiri dari 50 orang laki-laki dan 50 orang perempuan. Diketahui bahwa 30 orang menyukai warna biru, 20 orang menyukai warna merah, dan 10 orang menyukai kedua warna tersebut. Berapa banyak orang yang tidak menyukai satupun warna biru dan merah?', '20', '30', '40', '50', '60', 'C', 'Jumlah orang yang menyukai warna biru atau merah adalah 30 + 20 - 10 = 40.\r\n\r\nJumlah orang yang tidak menyukai satupun warna biru dan merah adalah 100 - 40 = 60.', '2024-06-11 23:45:50', '2024-06-11 23:45:50', 0),
(3, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Operasi hitung bilangan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika sebuah mobil melaju dengan kecepatan 80 km/jam selama 2 jam, maka berapa jarak yang ditempuh mobil tersebut?', '160 KM', '240 KM', '320 KM', '400 KM', '480 KM', 'C', 'Jarak yang ditempuh mobil tersebut dapat dihitung dengan rumus:\r\n\r\nJarak = Kecepatan x Waktu\r\n\r\nJarak = 80 km/jam x 2 jam\r\n\r\nJarak = 160 km', '2024-06-11 23:48:36', '2024-06-23 00:07:38', 11),
(4, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Operasi hitung bilangan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pada sebuah peta dengan skala 1 : 250.000, jarak antara dua kota diukur 4 cm. Berapa jarak sebenarnya antara kedua kota tersebut?', '1 KM', '2 KM', '3 KM', '4 KM', '5 KM', 'D', 'Skala peta menunjukkan bahwa setiap 1 cm pada peta mewakili jarak sebenarnya 250.000 cm.\r\n\r\nOleh karena itu, jarak sebenarnya antara kedua kota tersebut adalah 4 cm x 250.000 cm/cm = 1.000.000 cm.\r\n\r\nKonversikan cm ke km: 1.000.000 cm = 10.000 m = 10 km = 4 km (karena skala peta 1 : 250.000)', '2024-06-11 23:49:54', '2024-06-23 00:07:38', 11),
(5, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi Tersirat dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Fungsi utama dari Badan Pemeriksa Keuangan (BPK) adalah?', 'Melakukan audit keuangan negara', 'Menyusun Anggaran Pendapatan dan Belanja Negara ( APBN )', 'Menetapkan Pajak', 'Mencetak uang', 'Menjaga kelestarian lingkungan', 'A', 'BPK bertugas untuk melakukan audit keuangan negara untuk memastikan bahwa pengelolaan keuangan negara dilakukan secara transparan dan akuntabel.', '2024-06-11 23:52:12', '2024-06-11 23:52:12', 0),
(6, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Arti Sebuah Kata', NULL, NULL, NULL, NULL, NULL, NULL, 'Tentukan kata yang paling tidak berhubungan dengan kata-kata lainnya', 'Buku', 'Majalah', 'Surat kabar', 'Jurnal', 'Film', 'E', 'Buku, majalah, surat kabar, dan jurnal semuanya adalah media cetak, sementara film adalah media visual.', '2024-06-11 23:58:23', '2024-06-11 23:58:23', 0),
(7, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Arti Sebuah Kata', NULL, NULL, NULL, NULL, NULL, NULL, 'Kata \"pendidikan\" berhubungan dengan kata \"sekolah\" seperti halnya kata \"perdagangan\" berhubungan dengan:', 'Pasar', 'Toko', 'Uang', 'Barang', 'Pelanggan', 'A', 'Pendidikan dilakukan di sekolah, sedangkan perdagangan dilakukan di pasar.', '2024-06-11 23:59:32', '2024-06-11 23:59:32', 0),
(8, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ide Pokok dan Gagasan Utama', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dan jawab pertanyaannya:\r\n\r\n\"Internet telah mengubah cara kita berkomunikasi dan mendapatkan informasi. Seiring dengan meningkatnya pengguna internet, akses terhadap pengetahuan menjadi lebih mudah dan cepat. Namun, tidak semua orang dapat menikmati kemudahan ini, terutama mereka yang berada di daerah terpencil.\"\r\n\r\nPertanyaan: Menurut paragraf di atas, siapa yang kurang dapat menikmati kemudahan internet?', 'Semua orang', 'Orang di kota', 'Orang di daerah terpencil', 'Semua penggunaan internet', 'Anak-anak', 'C', 'Paragraf tersebut menyebutkan bahwa orang yang berada di daerah terpencil kurang dapat menikmati kemudahan internet.', '2024-06-12 00:00:57', '2024-06-12 00:00:57', 0),
(9, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ide Pokok dan Gagasan Utama', NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut dan tentukan makna dari kata yang dicetak tebal:\r\n\r\n\"Reformasi pendidikan bertujuan untuk meningkatkan 𝐀𝐤𝐬𝐞𝐛𝐢𝐥𝐢𝐭𝐚𝐬 dan kualitas pendidikan di seluruh negeri.\"\r\n\r\nAksesibilitas berarti:', 'Kemudahan untuk dijangkau', 'Kesuliyan untuk dijangkau', 'Keterjangkauan biaya', 'Keseluruhan program', 'Kualitas pelayanan', 'A', 'Aksesibilitas berarti kemudahan untuk dijangkau atau diakses', '2024-06-12 00:04:00', '2024-06-12 00:04:00', 0),
(10, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Silogisme', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika semua A adalah B, dan semua B adalah C, maka:', 'Semua A adalah C', 'Semua C adalah A', 'Sebagian A adalah C', 'Sebagian C adalah A', 'Tidak ada hubungan antara A dan C', 'A', 'Jika semua A adalah B, dan semua B adalah C, maka semua A adalah C.', '2024-06-12 00:06:02', '2024-06-23 00:07:38', 6),
(11, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Generalisasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika diketahui bahwa \"Semua mahasiswa di Universitas X wajib mengikuti mata kuliah Z,\" manakah pernyataan yang pasti benar?', 'Sebagian mahasiswa di Universitas X tidak mengikuti mata kuliah Z', 'Tidak ada mahasiswa di Universitas X yang tidak mengikuti mata kuliah Z', 'Beberapa mahasiswa di Universitas X mungkin tidak mengikuti mata kuliah Z', 'Semua mahasiswa di Universitas X tidak wajib mengikuti mata kuliah Z', 'Semua mahasiswa di Universitas X wajib mengikuti mata kuliah Y', 'B', 'Jika semua mahasiswa wajib mengikuti mata kuliah Z, maka tidak ada mahasiswa yang tidak mengikuti mata kuliah tersebut.', '2024-06-12 00:08:52', '2024-06-23 00:07:38', 1),
(12, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Operasi Aritmatika Dasar', NULL, NULL, NULL, NULL, 'Jika x=5 dan 𝑦 = 3 maka nilai dari  2x+3y adalah:', '19', '20', '21', '22', '23', 'C', 'Penjelasan: Substitusi nilai 𝑥 dan 𝑦 ke dalam persamaan: 2(5)+3(3)=10+9=19.', '2024-06-12 00:11:08', '2024-06-12 00:11:08', 0),
(13, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Operasi Aritmatika Dasar', NULL, NULL, NULL, NULL, 'Berapa nial (2³ x 3²) - 5?', '19', '23', '67', '31', '35', 'C', 'Hitung 2³ dan 3² terlebih dahulu : 2³ = 8 dan 3² = 9. maka ( 8 x 9 ) - 5 = 72 -5 = 67', '2024-06-12 00:16:10', '2024-06-12 00:18:27', 0),
(14, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Logika matematika', NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, NULL, NULL, 'jika x = 3 dan y = 4, maka nilai dari x² + y² adalah :', '9', '12', '16', '25', '37', 'D', 'Hitung x² dan y² : 3² = 9 dan 4² = 16. Maka 9 + 16 = 25', '2024-06-12 00:21:14', '2024-06-12 00:21:14', 0),
(15, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Logika matematika', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika pola bilangan adalah 2, 4, 8, 16, ..., maka bilangan berikutnya adalah:', '18', '20', '24', '30', '32', 'E', 'Pola bilangan tersebut adalah bilangan yang selalu dikalikan 2. Maka, bilangan berikutnya adalah  16×2=32.', '2024-06-12 00:22:13', '2024-06-23 00:07:38', 10),
(16, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', 'Penalaran Induktif', NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Mana dari pernyataan berikut yang paling mendukung pernyataan \"Internet telah mengubah cara orang berkomunikasi\":', 'Banyak orang masih menggunakan surat pos untuk berkomunikasi', 'Jumlah pengguna internet terus meningkat setiap tahun.', 'Telepon masih menjadi alat komunikasi utama di pedesaan.', 'Internet hanya digunakan oleh orang-orang di perkotaan.', 'Banyak orang tidak memiliki akses ke internet.', 'B', 'Peningkatan jumlah pengguna internet menunjukkan bahwa internet semakin banyak digunakan untuk berkomunikasi.', '2024-06-12 00:23:58', '2024-06-12 00:23:58', 0),
(17, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', 'Penalaran Induktif', NULL, NULL, NULL, NULL, 'Simpulan dan Inferensi', NULL, NULL, NULL, NULL, NULL, 'Jika semua X adalah Y, dan sebagian Y adalah Z, maka:', 'Semua X adalah Z', 'Semua Z adalah X', 'Sebagian X adalah Z', 'Sebagian Z adalah X', 'Tidak ada hubungan antara X dan Z', 'E', 'Tidak ada informasi yang cukup untuk menyimpulkan hubungan antara X dan Z berdasarkan pernyataan yang diberikan.', '2024-06-12 00:25:48', '2024-06-12 00:25:48', 0),
(18, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi Tersirat dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Siapa yang dikenal sebagai Bapak Proklamator Indonesia?', 'Soeharto', 'Soekarno', 'Hatta', 'Sutan sjahrir', 'Moh. Yamin', 'B', 'Soekarno dikenal sebagai Bapak Proklamator Indonesia, bersama dengan Hatta yang memproklamasikan kemerdekaan', '2024-06-12 00:26:54', '2024-06-12 00:26:54', 0),
(19, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, 'Bacalah paragraf berikut dan jawab pertanyaannya:\r\n\r\n\"Di era digital saat ini, informasi dapat diakses dengan cepat melalui internet. Namun, kemudahan ini juga disertai dengan tantangan, seperti banyaknya informasi yang tidak valid atau hoaks. Oleh karena itu, penting bagi setiap individu untuk memiliki keterampilan literasi digital, agar dapat menyaring dan memverifikasi informasi sebelum menerimanya sebagai kebenaran.\"\r\n\r\nApa yang menjadi tantangan utama di era digital menurut paragraf di atas?', 'Kecepatan akses informasi', 'Banyaknya informasi yang valid', 'Banyaknya informasi yang tidak valid atau hoaks', 'Kemudahan akses internet', 'Keterampilan teknis', 'C', 'Paragraf tersebut menyebutkan bahwa banyaknya informasi yang tidak valid atau hoaks adalah tantangan utama di era digital.', '2024-06-12 00:31:15', '2024-06-12 00:31:15', 0),
(21, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Penafsiran Teks', NULL, NULL, 'Bacalah paragraf berikut dan jawab pertanyaannya:\r\n\r\n\"Perubahan iklim global telah menyebabkan peningkatan suhu rata-rata di seluruh dunia. Fenomena ini berdampak pada naiknya permukaan air laut, pencairan es di kutub, dan perubahan pola cuaca yang ekstrem. Para ilmuwan menyarankan berbagai langkah mitigasi, termasuk pengurangan emisi gas rumah kaca dan peningkatan penggunaan energi terbarukan.\"\r\n\r\nBerdasarkan paragraf di atas, apa saja dampak dari perubahan iklim global?', 'Penurunan suhu rata-rata, peningkatan es di kutub, dan cuaca stabil', 'Peningkatan suhu rata-rata, naiknya permukaan air laut, dan pencairan es di kutub', 'Peningkatan suhu rata-rata, stabilnya permukaan air laut, dan peningkatan es di kutub', 'Peningkatan suhu rata-rata, naiknya permukaan air laut, dan cuaca stabil', 'Penurunan suhu rata-rata, pencairan es di kutub, dan cuaca ekstrem', 'B', 'Paragraf tersebut menyebutkan dampak perubahan iklim global yang meliputi peningkatan suhu rata-rata, naiknya permukaan air laut, dan pencairan es di kutub.', '2024-06-12 00:37:26', '2024-06-12 00:37:26', 0),
(22, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, 'Bacalah paragraf berikut dan jawab pertanyaannya:\r\n\r\n\"Teknologi hijau adalah solusi inovatif yang dirancang untuk mengurangi dampak negatif terhadap lingkungan. Teknologi ini meliputi penggunaan energi terbarukan, daur ulang bahan, dan desain produk yang ramah lingkungan. Implementasi teknologi hijau tidak hanya bermanfaat bagi lingkungan, tetapi juga dapat meningkatkan efisiensi dan mengurangi biaya operasional.\"\r\n\r\nApa manfaat dari implementasi teknologi hijau selain manfaat lingkungan', 'Mengurangi polusi udara', 'Meningkatkan biaya operasional', 'Mengurangi biaya operasional dan meningkatkan efesiensi', 'Menurunkan efesiensi', 'meningkatkan polusi air', 'C', 'Paragraf tersebut menyebutkan bahwa teknologi hijau dapat meningkatkan efisiensi dan mengurangi biaya operasional selain memberikan manfaat lingkungan.', '2024-06-12 00:39:03', '2024-06-12 00:39:03', 0),
(23, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, 'Bacalah paragraf berikut dan jawab pertanyaannya:\r\n\r\n\"Penggunaan plastik sekali pakai telah menimbulkan masalah lingkungan yang serius. Sampah plastik yang tidak terurai menyebabkan pencemaran tanah dan laut. Oleh karena itu, pemerintah harus mengeluarkan kebijakan yang melarang penggunaan plastik sekali pakai dan mendorong penggunaan bahan alternatif yang lebih ramah lingkungan.\"\r\n\r\nApa alasan utama yang digunakan untuk mendukung kebijakan pelarangan plastik sekali pakai?', 'Plastik sekali pakai mudah terurai', 'Plastik sekali pakai menyebabkan pencemaran tanah dan lau', 'Plastik sekali pakai lebih murah', 'Plastik sekali pakai dapat didaur ulang', 'Plastik sekali pakai meningkatkan polusi udara', 'B', 'Paragraf tersebut menyebutkan bahwa sampah plastik sekali pakai yang tidak terurai menyebabkan pencemaran tanah dan laut, sebagai alasan utama untuk mendukung kebijakan pelarangan.', '2024-06-12 00:40:31', '2024-06-12 00:40:31', 0),
(24, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', 'Penalaran Deduktif', NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', 'Simpulan dan Inferensi', NULL, 'Penalaran Matematika', NULL, NULL, NULL, 'Bacalah paragraf berikut dan jawab pertanyaannya:\r\n\r\n\"Pemanasan global adalah fenomena peningkatan suhu rata-rata permukaan bumi akibat peningkatan emisi gas rumah kaca seperti karbon dioksida dan metana. Fenomena ini berdampak pada ekosistem, menyebabkan pencairan es di kutub, naiknya permukaan air laut, dan perubahan iklim ekstrem yang mengancam kehidupan manusia dan makhluk hidup lainnya.\"\r\n\r\nKesimpulan apa yang dapat ditarik dari paragraf di atas?', 'Pemanasan global hanya berdampak pada ekosistem laut', 'Pemanasan global tidak berhubungan dengan emisi gas rumah kaca', 'Pemanasan global menyebabkan perubahan iklim ekstrem yang mengancam kehidupan', 'Pemanasan global meningkatkan suhu rata-rata permukaan bumi tanpa dampak', 'Pemanasan global hanya menyebabkan pencairan es di kutub', 'C', 'P\r\nParagraf tersebut menyebutkan bahwa pemanasan global berdampak pada ekosistem, menyebabkan perubahan iklim ekstrem yang mengancam kehidupan.', '2024-06-12 00:43:05', '2024-06-12 00:43:05', 0),
(25, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Analisis Teks', '\"The benefits of a healthy diet are numerous. Eating a variety of fruits and vegetables can improve overall health, boost the immune system, and reduce the risk of chronic diseases. It is important to incorporate a balanced diet into daily life to maintain physical and mental well-being.\"\r\n\r\nWhat is one benefit of a healthy diet mentioned in the paragraph?', 'Decreased immune function', 'Increased risk of chronic diseases', 'Improved overall health', 'Reduced physical well-being', 'Unbalanced diet', 'C', 'The paragraph mentions that a healthy diet can improve overall health.', '2024-06-12 05:02:02', '2024-06-12 05:02:02', 0),
(26, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Pemahaman Teks', 'Read the following paragraph and answer the question:\r\n\r\n\"The rapid advancement of technology has significantly changed the way we communicate. Social media platforms, instant messaging, and video calls have replaced traditional methods like letters and face-to-face meetings. However, this shift also brings challenges, such as maintaining privacy and dealing with the spread of misinformation.\"\r\n\r\nWhat is one of the challenges mentioned in the paragraph related to the shift in communication methods?', 'Increased face-to-face meetings', 'Maintaining privacy', 'Using traditional methods', 'Writing letters', 'Sending parcels', 'B', 'The paragraph mentions maintaining privacy as one of the challenges related to the shift in communication methods.', '2024-06-12 05:04:27', '2024-06-12 05:04:27', 0),
(27, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Pemahaman Teks', 'Read the following paragraph and answer the question:\r\n\r\n\"Climate change is a global issue that requires immediate action. Rising temperatures, melting ice caps, and extreme weather patterns are just a few of the impacts. Governments and organizations worldwide are working together to reduce carbon emissions and promote sustainable practices.\"\r\n\r\nAccording to the paragraph, what are some impacts of climate change?', 'Decreasing temperatures and stable weather', 'Rising temperatures and extreme weather patterns', 'Increasing ice caps and stable weather', 'Rising sea levels and decreasing temperatures', 'Stable weather and reducing carbon emissions', 'B', 'The paragraph mentions rising temperatures, melting ice caps, and extreme weather patterns as impacts of climate change.', '2024-06-12 05:14:50', '2024-06-12 05:14:50', 0),
(28, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Analisis Teks', 'Read the following paragraph and answer the question:\r\n\r\n\"Renewable energy sources, such as solar and wind power, are essential for a sustainable future. Unlike fossil fuels, these sources do not deplete natural resources and produce little to no greenhouse gases. Investing in renewable energy can help mitigate climate change and promote environmental conservation.\"\r\n\r\nAccording to the paragraph, why are renewable energy sources important for the future?', 'They deplete natural resources', 'They produce a lot of greenhouse gases', 'They help mitigate climate change', 'They are similar to fossil fuels', 'They promote energy consumption', 'C', 'The paragraph mentions that renewable energy sources help mitigate climate change.', '2024-06-12 05:16:39', '2024-06-12 05:16:39', 0),
(29, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Analisis Teks', 'Read the following paragraph and answer the question:\r\n\r\n\"Technology in education has revolutionized the way students learn. Interactive software, online resources, and virtual classrooms provide students with access to a wealth of information and learning tools. These advancements have made education more accessible and engaging for learners of all ages.\"\r\n\r\nWhat is one way technology has impacted education according to the paragraph?', 'Limited access to information', 'Decreased engagement in learning', 'Made education more accessible', 'Reduced the use of learning tools', 'Limited interaction in classrooms', 'C', 'The paragraph mentions that technology has made education more accessible.', '2024-06-12 05:17:52', '2024-06-12 05:17:52', 0),
(30, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Analisis Teks', 'Read the following paragraph and answer the question:\r\n\r\n\"Recycling is a critical component of environmental conservation. By converting waste materials into new products, recycling helps reduce the amount of waste sent to landfills and conserves natural resources. Additionally, it decreases pollution and saves energy compared to producing new materials from raw resources.\"\r\n\r\nWhat is one benefit of recycling mentioned in the paragraph?', 'Increases waste sent to landfills', 'Conserves natural resources', 'Increases pollution', 'Wastes energy', 'Destroys new products', 'B', 'The paragraph mentions that recycling conserves natural resources.', '2024-06-12 05:19:13', '2024-06-12 05:19:13', 0),
(31, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Pemahaman Teks', 'Read the following paragraph and answer the question:\r\n\r\n\"Urbanization has led to significant changes in lifestyle and living conditions. While cities offer better job opportunities and access to services, they also present challenges like overcrowding, pollution, and high living costs. Sustainable urban planning is essential to balance the benefits and drawbacks of urbanization.\"\r\n\r\nWhat challenge of urbanization is mentioned in the paragraph?', 'Increased rural living', 'Lower living costs', 'Overcrowding and pollution', 'Limited job opportunities', 'Reduced access to services', 'C', 'The paragraph mentions overcrowding and pollution as challenges of urbanization.', '2024-06-12 05:21:06', '2024-06-12 05:21:06', 0),
(32, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Pemahaman Teks', 'Read the following paragraph and answer the question:\r\n\r\n\"Renewable energy investments have surged in recent years as countries strive to reduce their carbon footprints. Solar, wind, and hydroelectric power are leading the way, offering clean and sustainable alternatives to fossil fuels. These investments are crucial for combating climate change and ensuring a greener future.\"\r\n\r\nWhat is the primary reason for the surge in renewable energy investments according to the paragraph?', 'Increasing fossil fuel prices', 'Reducing carbon footprints', 'Enhancing traditional energy sources', 'Promoting fossil fuel use', 'Decreasing energy consumption', 'B', 'The paragraph mentions that renewable energy investments are increasing as countries strive to reduce their carbon footprints.', '2024-06-12 05:23:18', '2024-06-12 05:23:18', 0),
(33, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, '“(1) Di era digital saat ini, teknologi telah menjadi bagian integral dari kehidupan sehari-hari. (2) Salah satu bidang yang sangat terdampak oleh kemajuan teknologi adalah komunikasi. (3) Teknologi memungkinkan kita untuk berkomunikasi dengan orang lain di seluruh dunia dalam hitungan detik.\r\n\r\n(4) Komunikasi digital juga memungkinkan kolaborasi yang lebih efisien dan efektif. (5) Namun, perkembangan teknologi ini juga menimbulkan beberapa tantangan, seperti masalah privasi dan keamanan data. (6) Untuk mengatasi tantangan tersebut, diperlukan regulasi dan pendidikan yang tepat tentang penggunaan teknologi yang aman. (7) Tanpa adanya pemahaman dan pengetahuan yang memadai, pengguna dapat menjadi korban dari kejahatan siber. (8) Oleh karena itu, semua pihak, termasuk pemerintah dan lembaga pendidikan, harus berperan aktif dalam memberikan edukasi dan regulasi yang tepat untuk menjaga keamanan dan privasi di era digital.”\r\n\r\nKata pada kalimat (3) mengacu pada …..', 'Teknologi yang menjadi bagian integral dari kehidupan sehari-hari', 'Kemajuan teknologi dalam bidang komunikasi', 'Dampak teknologi pada komunikasi', 'komunikasi dengan orang lain di seluruh dunia', 'Hitungan detik dalam berkomunikasi', 'B', 'Kalimat (3) berbunyi: \"Teknologi memungkinkan kita untuk berkomunikasi dengan orang lain di seluruh dunia dalam hitungan detik.\" Kata \"ini\" pada kalimat (3) mengacu pada kemajuan teknologi dalam bidang komunikasi, yang disebutkan pada kalimat (2).', '2024-06-12 05:39:04', '2024-06-12 05:39:04', 0),
(34, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Kaidah Bahasa', NULL, NULL, '(1) Di era digital saat ini, teknologi telah menjadi bagian integral dari kehidupan sehari-hari. (2) Salah satu bidang yang sangat terdampak oleh kemajuan teknologi adalah komunikasi. (3) Teknologi memungkinkan kita untuk berkomunikasi dengan orang lain di seluruh dunia dalam hitungan detik.\r\n\r\n(4) Komunikasi digital juga memungkinkan kolaborasi yang lebih efisien dan efektif. (5) Namun, perkembangan teknologi ini juga menimbulkan beberapa tantangan, seperti masalah privasi dan keamanan data. (6) Untuk mengatasi tantangan tersebut, diperlukan regulasi dan pendidikan yang tepat tentang penggunaan teknologi yang aman. (7) Tanpa adanya pemahaman dan pengetahuan yang memadai, pengguna dapat menjadi korban dari kejahatan siber. (8) Oleh karena itu, semua pihak, termasuk pemerintah dan lembaga pendidikan, harus berperan aktif dalam memberikan edukasi dan regulasi yang tepat untuk menjaga keamanan dan privasi di era digital.”\r\n\r\nApakah penggunaan kata regulasi pada kalimat (6) tepat?', 'Tepat karena regulasi bermakna ‘aturan’', 'Tepat karena regulasi bermakna ‘akibat’.', 'Tidak tepat karena regulasi bermakna ‘keteraturan’', 'Tidak tepat karena bermakna ‘kolaborasi’', 'Tepat karena regulasi bermakna ‘peran’', 'A', 'Kata \"regulasi\" bermakna aturan atau peraturan yang dibuat untuk mengatur sesuatu. Dalam kalimat (6), kata regulasi digunakan dalam konteks perlunya aturan untuk mengatasi masalah privasi dan keamanan data.', '2024-06-12 05:40:48', '2024-06-12 05:40:48', 0),
(35, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, '(1) Di era digital saat ini, teknologi telah menjadi bagian integral dari kehidupan sehari-hari. (2) Salah satu bidang yang sangat terdampak oleh kemajuan teknologi adalah komunikasi. (3) Teknologi memungkinkan kita untuk berkomunikasi dengan orang lain di seluruh dunia dalam hitungan detik.\r\n\r\n(4) Komunikasi digital juga memungkinkan kolaborasi yang lebih efisien dan efektif. (5) Namun, perkembangan teknologi ini juga menimbulkan beberapa tantangan, seperti masalah privasi dan keamanan data. (6) Untuk mengatasi tantangan tersebut, diperlukan regulasi dan pendidikan yang tepat tentang penggunaan teknologi yang aman. (7) Tanpa adanya pemahaman dan pengetahuan yang memadai, pengguna dapat menjadi korban dari kejahatan siber. (8) Oleh karena itu, semua pihak, termasuk pemerintah dan lembaga pendidikan, harus berperan aktif dalam memberikan edukasi dan regulasi yang tepat untuk menjaga keamanan dan privasi di era digital.”\r\n\r\nBerdasarkan paragraf di atas, tantangan utama dalam komunikasi digital adalah ….', 'Kolaborasi yang lebih efisien dan efektif', 'Masalah privasi dan keamanan data', 'Kemampuan berkomunikasi dengan cepat', 'Kurangnya pemahaman tentang teknologi', 'Penggunaan teknologi dalam kehidupan sehari-hari', 'B', 'Tantangan utama yang disebutkan dalam paragraf adalah masalah privasi dan keamanan data yang timbul akibat perkembangan teknologi komunikasi digital.', '2024-06-12 05:42:22', '2024-06-12 05:42:22', 0),
(36, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Penafsiran Teks', NULL, NULL, '(1) Di era digital saat ini, teknologi telah menjadi bagian integral dari kehidupan sehari-hari. (2) Salah satu bidang yang sangat terdampak oleh kemajuan teknologi adalah komunikasi. (3) Teknologi memungkinkan kita untuk berkomunikasi dengan orang lain di seluruh dunia dalam hitungan detik.\r\n\r\n(4) Komunikasi digital juga memungkinkan kolaborasi yang lebih efisien dan efektif. (5) Namun, perkembangan teknologi ini juga menimbulkan beberapa tantangan, seperti masalah privasi dan keamanan data. (6) Untuk mengatasi tantangan tersebut, diperlukan regulasi dan pendidikan yang tepat tentang penggunaan teknologi yang aman. (7) Tanpa adanya pemahaman dan pengetahuan yang memadai, pengguna dapat menjadi korban dari kejahatan siber. (8) Oleh karena itu, semua pihak, termasuk pemerintah dan lembaga pendidikan, harus berperan aktif dalam memberikan edukasi dan regulasi yang tepat untuk menjaga keamanan dan privasi di era digital.”\r\n\r\nApa yang dimaksud dengan “pemahaman dan pengetahuan yang memadai” pada kalimat (7)?', 'Mengerti cara menggunakan teknologi dengan benar', 'Memahami dampak negatif teknologi', 'Mengetahui cara berkomunikasi dengan orang lain', 'Mengetahui cara mengatasi masalah privasi', 'Memahami cara kerja regulasi teknologi', 'A', 'Pemahaman dan pengetahuan yang memadai mengacu pada kemampuan pengguna untuk menggunakan teknologi dengan benar dan aman agar tidak menjadi korban kejahatan siber.', '2024-06-12 05:44:02', '2024-06-12 05:44:02', 0),
(37, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Penafsiran Teks', NULL, NULL, '(1) Di era digital saat ini, teknologi telah menjadi bagian integral dari kehidupan sehari-hari. (2) Salah satu bidang yang sangat terdampak oleh kemajuan teknologi adalah komunikasi. (3) Teknologi memungkinkan kita untuk berkomunikasi dengan orang lain di seluruh dunia dalam hitungan detik.\r\n\r\n(4) Komunikasi digital juga memungkinkan kolaborasi yang lebih efisien dan efektif. (5) Namun, perkembangan teknologi ini juga menimbulkan beberapa tantangan, seperti masalah privasi dan keamanan data. (6) Untuk mengatasi tantangan tersebut, diperlukan regulasi dan pendidikan yang tepat tentang penggunaan teknologi yang aman. (7) Tanpa adanya pemahaman dan pengetahuan yang memadai, pengguna dapat menjadi korban dari kejahatan siber. (8) Oleh karena itu, semua pihak, termasuk pemerintah dan lembaga pendidikan, harus berperan aktif dalam memberikan edukasi dan regulasi yang tepat untuk menjaga keamanan dan privasi di era digital.”\r\n\r\nMengapa pemerintah dan lembaga pendidikan harus berperan aktif menurut kalimat (8)?', 'Karena mereka memiliki kekuatan untuk membuat aturan', 'Karena mereka dapat memberikan sanksi kepada pelanggar', 'Karena mereka bertanggung jawab atas keamanan teknologi', 'Karena mereka harus menjaga keamanan dan privasi', 'Karena mereka memiliki sumber daya untuk edukasi', 'D', 'Pemerintah dan lembaga pendidikan harus berperan aktif untuk menjaga keamanan dan privasi di era digital melalui edukasi dan regulasi yang tepat.', '2024-06-12 05:45:55', '2024-06-12 05:49:03', 0),
(38, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Kaidah Bahasa', NULL, NULL, '(1) Di era digital saat ini, teknologi telah menjadi bagian integral dari kehidupan sehari-hari. (2) Salah satu bidang yang sangat terdampak oleh kemajuan teknologi adalah komunikasi. (3) Teknologi memungkinkan kita untuk berkomunikasi dengan orang lain di seluruh dunia dalam hitungan detik.\r\n\r\n(4) Komunikasi digital juga memungkinkan kolaborasi yang lebih efisien dan efektif. (5) Namun, perkembangan teknologi ini juga menimbulkan beberapa tantangan, seperti masalah privasi dan keamanan data. (6) Untuk mengatasi tantangan tersebut, diperlukan regulasi dan pendidikan yang tepat tentang penggunaan teknologi yang aman. (7) Tanpa adanya pemahaman dan pengetahuan yang memadai, pengguna dapat menjadi korban dari kejahatan siber. (8) Oleh karena itu, semua pihak, termasuk pemerintah dan lembaga pendidikan, harus berperan aktif dalam memberikan edukasi dan regulasi yang tepat untuk menjaga keamanan dan privasi di era digital.”\r\n\r\nKalimat (5) dan (7) bermakna tentang ….', 'Menjelaskan manfaat teknologi digital', 'Menyatakan solusi atas tantangan teknologi', 'Menggambarkan dampak positif teknologi', 'Mengidentifikasi masalah dan risiko tentang teknologi', 'Menjelaskan peran pemerintah dan lembaga pendidikan', 'D', 'Kalimat (5) berbicara tentang masalah privasi dan keamanan data yang timbul dari perkembangan teknologi, dan kalimat (7) berbicara tentang risiko kejahatan siber jika pengguna tidak memiliki pemahaman dan pengetahuan yang memadai.', '2024-06-12 05:48:01', '2024-06-12 05:48:01', 0),
(39, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Kaidah Bahasa', NULL, NULL, '(1) Di era digital saat ini, teknologi telah menjadi bagian integral dari kehidupan sehari-hari. (2) Salah satu bidang yang sangat terdampak oleh kemajuan teknologi adalah komunikasi. (3) Teknologi memungkinkan kita untuk berkomunikasi dengan orang lain di seluruh dunia dalam hitungan detik.\r\n\r\n(4) Komunikasi digital juga memungkinkan kolaborasi yang lebih efisien dan efektif. (5) Namun, perkembangan teknologi ini juga menimbulkan beberapa tantangan, seperti masalah privasi dan keamanan data. (6) Untuk mengatasi tantangan tersebut, diperlukan regulasi dan pendidikan yang tepat tentang penggunaan teknologi yang aman. (7) Tanpa adanya pemahaman dan pengetahuan yang memadai, pengguna dapat menjadi korban dari kejahatan siber. (8) Oleh karena itu, semua pihak, termasuk pemerintah dan lembaga pendidikan, harus berperan aktif dalam memberikan edukasi dan regulasi yang tepat untuk menjaga keamanan dan privasi di era digital.”\r\n\r\nKata “integral” pada kalimat (1) berarti ….', 'Tidak penting', 'Bagian yang tidak terpisahkan', 'Kompleks', 'Sementara', 'Penting tetapi terpisah', 'B', 'Kata \"integral\" berarti sesuatu yang sangat penting dan tidak dapat dipisahkan dari keseluruhan, dalam konteks ini adalah teknologi yang menjadi bagian tidak terpisahkan dari kehidupan sehari-hari.', '2024-06-12 05:50:57', '2024-06-12 05:50:57', 0),
(40, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Generalisasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pengamatan: Semua siswa yang lulus ujian ini mendapatkan nilai di atas 75.\r\nKesimpulan: Siswa yang mendapatkan nilai di bawah 75 tidak lulus ujian ini.', 'Kesimpulan tersebut benar', 'Kesimpulan tersebut salah', 'Kesimpulan tersebut tidak dapat ditentukan benar atau salah', 'Siswa yang mendapatkan nilai 75 tidak lulus', 'Siswa yang mendapatkan nilai 75 lulus', 'A', 'Jika semua siswa yang lulus ujian mendapatkan nilai di atas 75, maka siswa yang mendapatkan nilai di bawah 75 tidak mungkin lulus ujian tersebut.', '2024-06-12 06:20:57', '2024-06-23 00:07:38', 1),
(41, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Generalisasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pengamatan: Semua bunga di taman ini berwarna merah atau kuning.\r\nKesimpulan: Tidak ada bunga berwarna biru di taman ini.', 'Kesimpulan tersebut benar', 'Kesimpulan tersebut salah', 'Kesimpulan tersebut tidak dapat ditentukan benar atau salah', 'Ada bunga yang berwarna biru di taman ini', 'Bunga di taman ini hanya berwarna kuning', 'A', 'Jika semua bunga di taman berwarna merah atau kuning, maka tidak ada bunga yang berwarna biru di taman tersebut.', '2024-06-12 06:22:35', '2024-06-23 00:07:38', 1),
(42, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Generalisasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pengamatan: Semua hewan di kebun binatang ini adalah mamalia atau reptil.\r\nKesimpulan: Tidak ada burung di kebun binatang ini.', 'Kesimpulan tersebut benar', 'Kesimpulan tersebut salah', 'Kesimpulan tersebut tidak dapat ditentukan benar atau salah', 'Ada burung di kebun binatang ini', 'Semua burung adalah mamalia atau reptil', 'A', 'Kesimpulan tersebut benar', '2024-06-12 06:23:53', '2024-06-23 00:07:38', 1),
(43, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Kunci : Pintu =', 'Lemari : Rak', 'Meja : kursi', 'Buku : Kertas', 'Jendela : Tirai', 'Kursi : Meja', 'A', 'Kunci adalah sesuatu yang digunakan untuk membuka pintu, sama seperti rak adalah bagian dari lemari yang digunakan untuk menaruh barang-barang.', '2024-06-12 06:26:13', '2024-06-23 00:07:38', 2),
(44, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Matahari : Terang =', 'Bulan : Malam', 'Api : Panas', 'Bintang : Langit', 'Awan : Hujan', 'Laut : Air', 'B', 'Matahari menyebabkan terang, sama seperti api menyebabkan panas. Kedua pasangan memiliki hubungan kausal.', '2024-06-12 06:27:46', '2024-06-23 00:07:38', 3),
(45, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penulis : Buku', 'Seniman : Lukisan', 'Penyanyi : Musik', 'Dokter : Pasien', 'Guru : Sekolah', 'Pemain : Lapangan', 'A', 'Penulis menciptakan buku, sama seperti seniman menciptakan lukisan. Kedua pasangan memiliki hubungan penciptaan', '2024-06-12 06:29:09', '2024-06-23 00:07:38', 2),
(46, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hujan : Banjir', 'Angin : Topan', 'Panas : Kebakaran', 'Gempa : Tsunami', 'Api : Kebakaran', 'Salju : Salju longsor', 'D', 'Hujan yang berlebihan dapat menyebabkan banjir, sama seperti api dapat menyebabkan kebakaran. Kedua pasangan menunjukkan hubungan kausal di mana satu hal menyebabkan hal lain.', '2024-06-12 06:31:47', '2024-06-23 00:07:38', 3),
(47, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Merokok : Kanker Paru-paru =', 'Minum : Haus', 'Olahraga : Sehat', 'Makanan : Kenyang', 'Obesitas : Diabetes', 'Menonton TV : Bosan', 'D', 'Merokok dapat menyebabkan kanker paru-paru, sama seperti obesitas dapat menyebabkan diabetes. Kedua pasangan menunjukkan hubungan kausal di mana satu kondisi dapat menyebabkan kondisi medis lain.', '2024-06-12 06:33:01', '2024-06-23 00:07:38', 3),
(48, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Belajar Keras : Nilai Tinggi =', 'Tidur : Mimpi', 'Makan : Kenyang', 'Kerja keras : Kesuksesan', 'Berolahraga : Kecapekan', 'Membaca : Menulis', 'C', 'Belajar keras dapat menghasilkan nilai tinggi, sama seperti kerja keras dapat menghasilkan kesuksesan. Kedua pasangan menunjukkan hubungan kausal di mana usaha keras menyebabkan hasil yang positif.', '2024-06-12 06:34:12', '2024-06-23 00:07:38', 3),
(49, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika tidak ada hujan, maka tidak ada banjir. Tidak ada banjir. Maka,', 'Ada hujan', 'Tidak ada hujan', 'Ada banjir', 'Banjir tidak teperngaruh hujan', 'Banjir dan hujan tidak berhubungan', 'B', 'Jika tidak ada hujan, maka tidak ada banjir. Dengan tidak adanya banjir, kita dapat menyimpulkan bahwa tidak ada hujan.', '2024-06-12 06:35:46', '2024-06-12 06:35:46', 0),
(50, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Menyangkal anteseden', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika lampu tidak menyala, maka tidak ada listrik. Listrik ada. Maka,', 'Lampu tidak menyala', 'Lampu menyala', 'Lampu rusak', 'Listrik mati', 'Lampu tidak berfungsi', 'B', 'Jika lampu tidak menyala, maka tidak ada listrik. Karena listrik ada, maka dapat disimpulkan bahwa lampu menyala.', '2024-06-12 06:38:09', '2024-06-23 00:07:38', 4),
(51, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Mengafirmasi konsekuensi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika ada hujan, maka jalan menjadi basah. Jalan menjadi basah. Maka,', 'Ada hujan', 'Tidak ada hujan', 'Ada angin', 'Jalan Kering', 'Tidak Ada Angin', 'A', 'Jika ada hujan, maka jalan menjadi basah. Karena jalan menjadi basah, dapat disimpulkan bahwa ada hujan.', '2024-06-12 06:39:39', '2024-06-23 00:07:38', 5),
(52, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Mengafirmasi konsekuensi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika saya belajar keras, maka saya akan lulus ujian. Saya lulus ujian. Maka,', 'Ujian mudah', 'Ujian ditunda', 'Saya belajar keras', 'Saya tidak belajar keras', 'Saya mengulang ujian', 'C', 'Jika saya belajar keras, maka saya akan lulus ujian. Karena saya lulus ujian, dapat disimpulkan bahwa saya belajar keras.', '2024-06-12 06:40:57', '2024-06-23 00:07:38', 5),
(53, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Silogisme', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Semua mahasiswa adalah pembelajar.\r\nAni adalah seorang mahasiswa.', 'Ani adalah seorang pembelajar', 'Ani adalah seorang dosen', 'Ani adalah seorang sarjana', 'Ani adalah seorang mahasiswa aktif', 'Ani adalah seorang pemikir kritis.', 'A', 'Soal ini merupakan contoh silogisme kategorik dengan bentuk modus ponens. Modus ponens adalah argumen yang menyimpulkan proposisi kedua (konsekuensi) berdasarkan kebenaran proposisi pertama (antecedent) dan aturan implikasi.\r\n\r\nDalam soal ini, proposisi pertama adalah \"Semua mahasiswa adalah pembelajar\" (antecedent) dan proposisi kedua adalah \"Ani adalah seorang pembelajar\" (konsekuensi). Aturan implikasi yang digunakan adalah \"Jika semua P adalah Q, dan x adalah P, maka x adalah Q.\"\r\n\r\nBerdasarkan aturan implikasi dan kebenaran proposisi pertama, maka dapat disimpulkan bahwa proposisi kedua juga benar. Oleh karena itu, jawaban yang benar adalah A. Ani adalah seorang pembelajar.', '2024-06-12 06:48:12', '2024-06-23 00:07:38', 6),
(54, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus ponens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika hujan, maka jalanan basah.\r\nHujan turun.', 'Langit mendung', 'Cuaca dingin', 'Jalanan licin', 'Jalanan basah', 'Hujan', 'D', 'soal ini merupakan contoh modus ponens. Modus ponens adalah argumen yang menyimpulkan proposisi kedua (konsekuensi) berdasarkan kebenaran proposisi pertama (antecedent) dan aturan implikasi.\r\n\r\nDalam soal ini, proposisi pertama adalah \"Jika hujan, maka jalanan basah\" (antecedent) dan proposisi kedua adalah \"Hujan turun\" (konsekuensi). Aturan implikasi yang digunakan adalah \"Jika semua P adalah Q, dan x adalah P, maka x adalah Q.\"\r\n\r\nBerdasarkan aturan implikasi dan kebenaran proposisi pertama, maka dapat disimpulkan bahwa proposisi kedua juga benar. Oleh karena itu, jawaban yang benar adalah D. Jalanan basah.', '2024-06-12 06:49:24', '2024-06-23 00:07:38', 7),
(55, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus tollens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika hujan, maka jalanan basah.\r\nJalanan tidak basah.', 'Hujan tidak turun', 'Cuaca cerah', 'Jalanan kering', 'Langit biru', 'Angin bertiup kencang', 'A', 'Modus tollens adalah argumen yang menyimpulkan negasi proposisi pertama (negasi antecedent) berdasarkan negasi proposisi kedua (negasi konsekuensi) dan aturan implikasi.\r\n\r\nDalam soal ini, proposisi pertama adalah \"Jika hujan, maka jalanan basah\" (antecedent) dan proposisi kedua adalah \"Jalanan tidak basah\" (negasi konsekuensi). Aturan implikasi yang digunakan adalah \"Jika semua P adalah Q, dan x bukan Q, maka x bukan P.\"\r\n\r\nBerdasarkan aturan implikasi dan negasi proposisi kedua, maka dapat disimpulkan bahwa negasi proposisi pertama juga benar. Oleh karena itu, jawaban yang benar adalah A. Hujan tidak turun.', '2024-06-12 06:50:43', '2024-06-23 00:07:38', 8),
(56, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Argumen berantai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Semua guru adalah pendidik.\r\nSemua pendidik adalah pembimbing.\r\nSemua pembimbing adalah motivator', 'Semua guru adalah motivator', 'Semua motivator adalah guru.', 'Semua pendidik adalah guru', 'Semua guru adalah pembimbing', 'Tidak ada', 'A', 'Soal ini merupakan contoh argumen berantai. Argumen berantai adalah argumen yang terdiri dari beberapa silogisme yang terhubung satu sama lain, di mana kesimpulan dari silogisme sebelumnya menjadi premis pada silogisme berikutnya.\r\n\r\nDalam soal ini, terdapat tiga silogisme:\r\n\r\nSilogisme pertama: Semua guru adalah pendidik.\r\nSilogisme kedua: Semua pendidik adalah pembimbing.\r\nSilogisme ketiga: Semua pembimbing adalah motivator.\r\nKesimpulan dari silogisme pertama (\"Semua guru adalah pendidik\") menjadi premis pada silogisme kedua. Kesimpulan dari silogisme kedua (\"Semua pendidik adalah pembimbing\") menjadi premis pada silogisme ketiga.\r\n\r\nBerdasarkan kesimpulan dari ketiga silogisme tersebut, maka dapat disimpulkan bahwa \"Semua guru adalah motivator.\"', '2024-06-12 06:54:57', '2024-06-23 00:07:38', 9),
(57, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Logika matematika', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ika x + 2 = 5, maka nilai x adalah', '3', '4', '5', '6', '7', 'A', 'Soal ini merupakan contoh soal logika matematika yang menggunakan operasi penjumlahan dan persamaan. Untuk menyelesaikan soal ini, kita perlu menyelesaikan persamaan yang diberikan:\r\n\r\nx + 2 = 5\r\n\r\nLangkah 1: Isolasi variabel x dengan mengurangkan 2 dari kedua sisi persamaan:\r\n\r\nx + 2 - 2 = 5 - 2\r\n\r\nx = 3\r\n\r\nLangkah 2: Periksa jawaban dengan mengganti x = 3 ke dalam persamaan awal:\r\n\r\n3 + 2 = 5?\r\n\r\nBenar, 3 + 2 = 5.\r\n\r\nOleh karena itu, nilai x yang benar adalah A. 3.', '2024-06-12 06:56:15', '2024-06-23 00:07:38', 10),
(58, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Operasi hitung bilangan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Di sebuah toko, harga sebotol jus jeruk adalah Rp 5.000. Jika Ani membeli 3 botol jus jeruk, berapa total yang harus dibayarkan Ani?', 'Rp 10.000', 'Rp 12.000', 'Rp 14.000', 'Rp 15.000', 'Rp 16.000', 'D', 'Total yang harus dibayarkan Ani dapat dihitung dengan mengalikan harga satu botol jus jeruk dengan jumlah botol yang dibeli:\r\n\r\nTotal = Harga per botol x Jumlah botol\r\n\r\nTotal = Rp 5.000/botol x 3 botol\r\n\r\nTotal = Rp 15.000', '2024-06-12 07:00:06', '2024-06-23 00:07:38', 11),
(59, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Baris dan deret angka/huruf', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Dalam sebuah deret aritmatika, suku pertama adalah 3 dan selisih antar suku adalah 2. Berapakah suku ke-10 dalam deret tersebut?', '17', '18', '19', '20', '21', 'E', 'Untuk mencari suku ke-10 dalam deret aritmatika, kita dapat menggunakan rumus suku ke-n:\r\n\r\nSn = a + d(n - 1)\r\n\r\nDimana:\r\n\r\nSn = suku ke-n\r\na = suku pertama\r\nd = selisih antar suku\r\nn = nomor suku\r\nDalam soal ini, a = 3, d = 2, dan n = 10. Substitusikan nilai-nilai tersebut ke dalam rumus:\r\n\r\nS10 = 3 + 2(10 - 1)\r\n\r\nS10 = 3 + 2 x 9\r\n\r\nS10 = 3 + 18\r\n\r\nS10 = 21', '2024-06-12 07:01:18', '2024-06-12 07:01:18', 0),
(60, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Bentuk aljabar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika x + 2 = 5, maka nilai x adalah?', '1', '2', '3', '4', '5', 'C', 'Soal ini merupakan contoh soal bentuk aljabar yang menggunakan operasi penjumlahan dan persamaan. Untuk menyelesaikan soal ini, kita perlu menyelesaikan persamaan yang diberikan:\r\n\r\nx + 2 = 5\r\n\r\nLangkah 1: Isolasi variabel x dengan mengurangkan 2 dari kedua sisi persamaan:\r\n\r\nx + 2 - 2 = 5 - 2\r\n\r\nx = 3\r\n\r\nLangkah 2: Periksa jawaban dengan mengganti x = 3 ke dalam persamaan awal:\r\n\r\n3 + 2 = 5?\r\n\r\nBenar, 3 + 2 = 5.\r\n\r\nOleh karena itu, nilai x yang benar adalah C. 3.', '2024-06-12 07:02:22', '2024-06-12 07:02:22', 0),
(61, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Analisis data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hari	 Jumlah Penjualan\r\nSenin	50\r\nSelasa	60\r\nRabu	70\r\nKamis	80\r\nJumat	90\r\nSabtu	100\r\nMinggu	110\r\n\r\nBerapakah rata-rata penjualan buku per hari di toko tersebut selama seminggu?', '65', '70', '75', '80', '85', 'C', 'Rata-rata penjualan buku per hari dapat dihitung dengan menjumlahkan total penjualan selama seminggu dan kemudian membaginya dengan jumlah hari.\r\n\r\nTotal penjualan = 50 + 60 + 70 + 80 + 90 + 100 + 110 = 560\r\n\r\nRata-rata penjualan = Total penjualan / Jumlah hari\r\n\r\nRata-rata penjualan = 560 / 7\r\n\r\nRata-rata penjualan = 75', '2024-06-12 07:03:39', '2024-06-12 07:03:39', 0),
(62, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Mengarti ide gagasan Utama dari teks\r\nmemahami informasi yang bersifat detail atau rincian teks  3\r\nmemahamiinformasi terkait dari sebuah teks\r\nMemahami arti dari sebuah kata \r\n\r\nGagasan utama paragraf tersebut adalah?', 'Polusi udara adalah masalah serius di Indonesia', 'Polusi udara disebabkan oleh berbagai faktor', 'Polusi udara dapat berdampak buruk bagi kesehatan manusia', 'enting untuk mengambil langkah-langkah untuk mengurangi polusi udara', 'Semua jawaban di atas benar.', 'E', 'Paragraf tersebut membahas tentang polusi udara, mulai dari definisi, penyebab, dampak, hingga solusi. Setiap kalimat dalam paragraf tersebut berkontribusi pada pemahaman tentang polusi udara secara menyeluruh. Oleh karena itu, semua jawaban di atas benar.', '2024-06-12 07:06:30', '2024-06-12 07:06:30', 0);
INSERT INTO `soal_tryout` (`id`, `question_type`, `tps_type`, `penalaran_type`, `penalaran_induktif_detail`, `penalaran_deduktif_detail`, `penalaran_kuantitatif_detail`, `pemahaman_pemahaman_type`, `pemahaman_type`, `kuantitatif_type`, `tl_type`, `tl_indonesia_type`, `tl_matematika_type`, `tl_inggris_type`, `question`, `option_a`, `option_b`, `option_c`, `option_d`, `option_e`, `correct_answer`, `answer_explanation`, `created_at`, `updated_at`, `materi_id`) VALUES
(63, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan cermat:\r\n\r\n\"Pada tahun 2023, Indonesia menargetkan untuk mencapai tingkat elektrifikasi nasional sebesar 98%. Hal ini dilakukan untuk meningkatkan akses masyarakat terhadap energi listrik dan mendorong pertumbuhan ekonomi. Untuk mencapai target tersebut, pemerintah akan membangun pembangkit listrik baru, memperluas jaringan listrik, dan memberikan subsidi bagi masyarakat yang kurang mampu.\"\r\n\r\nBerapa target tingkat elektrifikasi nasional yang ingin dicapai Indonesia pada tahun 2023?', '80 %', '85 %', '90 %', '95 %', '98 %', 'E', 'Paragraf tersebut secara jelas menyebutkan bahwa target tingkat elektrifikasi nasional yang ingin dicapai Indonesia pada tahun 2023 adalah 98%. Oleh karena itu, jawaban yang benar adalah E. 98%.', '2024-06-12 07:07:32', '2024-06-12 07:07:32', 0),
(64, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi Tersirat dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan cermat:\r\n\r\n\"Hutan lindung memiliki peran penting dalam menjaga keseimbangan ekosistem. Hutan lindung berfungsi untuk melindungi sumber air, mencegah erosi tanah, dan menjaga keanekaragaman hayati. Oleh karena itu, penting untuk menjaga kelestarian hutan lindung.\"\r\n\r\nApa yang bukan merupakan fungsi hutan lindung?', 'Melindungi sumber air', 'Mencegah banjir', 'Mencegah erosi tanah', 'Menjaga keanekaragaman hayati', 'Mengurangi pencemaran udara', 'B', 'Paragraf tersebut menyebutkan bahwa hutan lindung berfungsi untuk melindungi sumber air, mencegah erosi tanah, dan menjaga keanekaragaman hayati. Fungsi-fungsi ini berkaitan erat dengan kelestarian alam. Namun, paragraf tersebut tidak menyebutkan secara eksplisit bahwa hutan lindung berfungsi untuk mencegah banjir. Oleh karena itu, jawaban yang benar adalah B. Mencegah banjir.', '2024-06-12 07:08:44', '2024-06-12 07:08:44', 0),
(65, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Arti Sebuah Kata', NULL, NULL, NULL, NULL, NULL, NULL, 'Kalimat berikut menggunakan kata \"konsekuensi\". Apa arti kata \"konsekuensi\"?\r\n\r\n\"Jika kamu tidak mengerjakan PR, kamu akan menerima konsekuensi.\"', 'Hadiah', 'Hukuman', 'Kesempatan', 'Tanggung jawab', 'Penjelasan', 'B', 'Kata \"konsekuensi\" dalam kalimat tersebut memiliki arti \"hukuman\" atau \"hasil negatif dari suatu tindakan\". Oleh karena itu, jawaban yang benar adalah B. Hukuman.', '2024-06-12 07:09:34', '2024-06-12 07:09:34', 0),
(66, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ide Pokok dan Gagasan Utama', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan cermat:\r\n\r\n\"Pendidikan merupakan salah satu faktor kunci dalam meningkatkan kualitas hidup manusia. Pendidikan memungkinkan individu untuk memperoleh pengetahuan, keterampilan, dan nilai-nilai yang diperlukan untuk mencapai kesuksesan dalam hidup. Selain itu, pendidikan juga dapat meningkatkan partisipasi masyarakat dalam pembangunan bangsa. Oleh karena itu, penting untuk meningkatkan akses dan kualitas pendidikan bagi seluruh rakyat Indonesia.\"\r\nIde pokok paragraf tersebut adalah?', 'Pendidikan adalah kunci untuk meningkatkan kualitas hidup manusia', 'Pendidikan memungkinkan individu untuk memperoleh pengetahuan, keterampilan, dan nilai-nilai.', 'Pendidikan dapat meningkatkan partisipasi masyarakat dalam pembangunan bangsa', 'Penting untuk meningkatkan akses dan kualitas pendidikan bagi seluruh rakyat Indonesia', 'Semua jawaban di atas benar.', 'E', 'Paragraf tersebut membahas tentang pentingnya pendidikan dalam meningkatkan kualitas hidup manusia, partisipasi masyarakat dalam pembangunan bangsa, dan akses pendidikan yang berkualitas bagi seluruh rakyat Indonesia. Oleh karena itu, semua jawaban di atas merupakan ide pokok paragraf tersebut.', '2024-06-12 07:12:40', '2024-06-12 07:12:40', 0),
(67, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Kepaduan Wacana dan Kalimat Efektif', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan cermat:\r\n\r\n\"Pendidikan adalah salah satu faktor kunci dalam meningkatkan kualitas hidup manusia. Pendidikan memungkinkan individu untuk memperoleh pengetahuan, keterampilan, dan nilai-nilai yang diperlukan untuk mencapai kesuksesan dalam hidup. Selain itu, pendidikan juga dapat meningkatkan partisipasi masyarakat dalam pembangunan bangsa. Oleh karena itu, penting untuk meningkatkan akses dan kualitas pendidikan bagi seluruh rakyat Indonesia.\"\r\nKalimat manakah yang tidak padu dengan kalimat lainnya dalam paragraf tersebut?', 'Pendidikan merupakan salah satu faktor kunci dalam meningkatkan kualitas hidup manusia.', 'Pendidikan memungkinkan individu untuk memperoleh pengetahuan, keterampilan, dan nilai-nilai yang diperlukan untuk mencapai kesuksesan dalam hidup', 'Selain itu, pendidikan juga dapat meningkatkan partisipasi masyarakat dalam pembangunan bangsa', 'Oleh karena itu, penting untuk meningkatkan akses dan kualitas pendidikan bagi seluruh rakyat Indonesia', 'Tidak ada kalimat yang tidak padu.', 'C', 'Kalimat \"Selain itu, pendidikan juga dapat meningkatkan partisipasi masyarakat dalam pembangunan bangsa\" menggunakan kata penghubung \"selain itu\" yang tidak tepat. Kata penghubung yang lebih tepat untuk menghubungkan kalimat tersebut dengan kalimat sebelumnya adalah \"dan\" atau \"sehingga\". Oleh karena itu, jawaban yang benar adalah C. Selain itu, pendidikan juga dapat meningkatkan partisipasi masyarakat dalam pembangunan bangsa.', '2024-06-12 07:14:00', '2024-06-12 07:14:00', 0),
(68, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Simpulan dan Inferensi', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan cermat:\r\n\r\n\"Hujan deras mengguyur kota selama berjam-jam. Akibatnya, beberapa jalan tergenang air dan terjadi kemacetan di mana-mana. Banyak warga masyarakat yang terjebak di dalam mobil dan tidak bisa keluar rumah.\"\r\nApa kesimpulan yang dapat ditarik dari paragraf tersebut?', 'Hujan deras menyebabkan banjir di beberapa daerah di kota', 'Kemacetan terjadi di mana-mana akibat hujan deras.', 'Banyak warga masyarakat yang terjebak di dalam mobil dan tidak bisa keluar rumah', 'Semua jawaban di atas benar.', 'Tidak ada kesimpulan yang dapat ditarik.', 'D', 'Paragraf tersebut memberikan informasi tentang hujan deras yang mengguyur kota selama berjam-jam dan dampaknya, yaitu beberapa jalan tergenang air, kemacetan di mana-mana, dan banyak warga masyarakat yang terjebak di dalam mobil dan tidak bisa keluar rumah. Oleh karena itu, semua jawaban di atas merupakan kesimpulan yang dapat ditarik dari paragraf tersebut.', '2024-06-12 07:16:46', '2024-06-12 07:16:46', 0),
(69, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Makna Kata dan Bentuk Kata', NULL, NULL, NULL, NULL, NULL, 'Kalimat berikut menggunakan kata \"inovasi\". Apa arti kata \"inovasi\"?\r\n\r\n\"Perusahaan tersebut terus melakukan inovasi untuk meningkatkan produknya.\"', 'Tradisi', 'Keterampilan', 'Perubahan', 'Kekayaan', 'Keindahan', 'C', 'Kata \"inovasi\" dalam kalimat tersebut memiliki arti \"perubahan atau penemuan baru yang dibuat untuk meningkatkan sesuatu\". Oleh karena itu, jawaban yang benar adalah C. Perubahan.', '2024-06-12 07:17:35', '2024-06-12 07:17:35', 0),
(70, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ejaan dan Konjungsi', NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut dengan cermat:\r\n\r\n\"Meskipun cuaca panas, dia tetap pergi ke sekolah.\"\r\n\r\nKalimat tersebut menggunakan kata penghubung yang tepat.\r\nManakah kata penghubung yang tidak tepat untuk menggantikan kata \"Meskipun\" pada kalimat di atas?', 'Dan', 'Tetapi', 'Namun', 'Walaupun', 'Sebab', 'A', 'Kata penghubung \"Dan\" digunakan untuk menghubungkan dua kalimat atau frasa yang memiliki makna yang sama atau berlawanan. Dalam kalimat di atas, kata \"Meskipun\" digunakan untuk menghubungkan dua kalimat yang memiliki makna berlawanan. Oleh karena itu, kata penghubung \"Dan\" tidak tepat untuk menggantikan kata \"Meskipun\".', '2024-06-12 07:18:57', '2024-06-12 07:18:57', 0),
(71, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', 'Penalaran Kuantitatif', NULL, NULL, NULL, NULL, NULL, 'Operasi Aritmatika Dasar', NULL, NULL, NULL, NULL, 'Budi membeli 2 kg apel dengan harga Rp 10.000 per kg dan 3 kg jeruk dengan harga Rp 8.000 per kg. Berapa total biaya yang harus dibayarkan Budi?', 'Rp 34.000', 'Rp 36.000', 'Rp 38.000', 'Rp 40.000', 'Rp 42.000', 'C', 'Total biaya untuk apel = 2 kg x Rp 10.000/kg = Rp 20.000\r\nTotal biaya untuk jeruk = 3 kg x Rp 8.000/kg = Rp 24.000\r\nTotal biaya = Rp 20.000 + Rp 24.000 = Rp 38.000', '2024-06-12 07:21:47', '2024-06-12 07:21:47', 0),
(72, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Persentase', NULL, NULL, NULL, NULL, 'Dalam sebuah kelas yang terdiri dari 30 siswa, terdapat 12 siswa yang gemar bermain basket. Berapa persentase siswa di kelas tersebut yang gemar bermain basket?', '20 %', '30 %', '40 %', '50 %', '60 %', 'C', 'Persentase siswa yang gemar bermain basket = (Jumlah siswa yang gemar bermain basket / Jumlah seluruh siswa) x 100%\r\n= (12 siswa / 30 siswa) x 100%\r\n= 40%', '2024-06-12 07:22:37', '2024-06-12 07:22:37', 0),
(73, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Rasio dan Proporsi', NULL, NULL, NULL, NULL, 'Di sebuah toko, terdapat 3 apel untuk setiap 2 pisang. Jika toko tersebut memiliki 18 apel, berapa jumlah pisang yang ada di toko?', '12', '15', '18', '21', '24', 'B', 'Rasio apel terhadap pisang = 3 : 2\r\nJika terdapat 18 apel, maka jumlah pisang yang setara dengan 18 apel adalah (18 apel x 2 pisang) / 3 apel = 12 pisang\r\nNamun, soal tersebut menanyakan jumlah total pisang di toko, bukan hanya pisang yang setara dengan 18 apel. Oleh karena itu, kita perlu mencari kelipatan dari 12 pisang yang paling mendekati dengan jumlah apel di toko, yaitu 18 apel.\r\nKelipatan 12 yang paling dekat dengan 18 adalah 15.\r\nJadi, jumlah pisang di toko adalah 15 pisang.', '2024-06-12 07:23:11', '2024-06-12 07:23:11', 0),
(74, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Persamaan dan Ungkapan Aljabar', NULL, NULL, NULL, NULL, 'Jika x + 5 = 10, maka nilai x adalah?', '3', '5', '7', '9', '11', 'A', 'Untuk mencari nilai x, kita perlu menyelesaikan persamaan x + 5 = 10.\r\nLangkah-langkahnya:\r\n\r\nPindahkan konstanta 5 ke sisi kanan persamaan: x = 10 - 5\r\nSederhanakan: x = 5', '2024-06-12 07:23:55', '2024-06-12 07:23:55', 0),
(75, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Geometri Dasar', NULL, NULL, NULL, NULL, 'Sebuah persegi panjang memiliki panjang 10 cm dan lebar 6 cm. Berapa luas persegi panjang tersebut?', '30 cm^2', '40 cm^2', '50 cm^2', '60 cm^2', '70 cm^2', 'B', 'Luas persegi panjang dihitung dengan rumus: Luas = Panjang x Lebar\r\nPada persegi panjang dengan panjang 10 cm dan lebar 6 cm, kita memiliki:\r\nLuas = 10 cm x 6 cm = 60 cm^2', '2024-06-12 07:25:50', '2024-06-12 07:25:50', 0),
(76, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Statistik dan Probabilitas', NULL, NULL, NULL, NULL, 'Dalam sebuah kelas yang terdiri dari 40 siswa, terdapat 20 siswa yang gemar matematika, 15 siswa yang gemar sains, dan 8 siswa yang gemar keduanya. Berapa banyak siswa di kelas tersebut yang tidak gemar matematika maupun sains?', '7', '8', '9', '10', '11', 'C', 'Langkah 1: Hitung total siswa yang gemar matematika atau sains.\r\nTotal siswa yang gemar matematika atau sains = Siswa yang gemar matematika + Siswa yang gemar sains - Siswa yang gemar keduanya\r\n= 20 siswa + 15 siswa - 8 siswa\r\n= 27 siswa\r\n\r\nLangkah 2: Hitung total siswa yang tidak gemar matematika maupun sains.\r\nTotal siswa yang tidak gemar matematika maupun sains = Total siswa di kelas - Siswa yang gemar matematika atau sains\r\n= 40 siswa - 27 siswa\r\n= 13 siswa', '2024-06-12 07:26:29', '2024-06-12 07:26:29', 0),
(77, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Kaidah Bahasa', NULL, NULL, 'Bacalah puisi berikut:\r\n\r\nHujan Bulan Juni\r\n\r\nHujan turun di bulan Juni\r\nMenadi-nadi di atas daun\r\nMenimpa bumi yang haus\r\nYang telah lama kering merindukan\r\n\r\nHujan turun di bulan Juni\r\nMenyirami bunga yang layu\r\n\r\nPuisi tersebut merupakan karya dari?', 'Chairil Anwar', 'Sapardi Djoko Damono', 'WS. Rendra', 'Sutardji Calzoum Bachri', 'Goenawan Mohamad', 'A', 'Puisi \"Hujan Bulan Juni\" merupakan salah satu karya terkenal dari Chairil Anwar, seorang penyair ternama Indonesia.', '2024-06-12 07:34:08', '2024-06-12 07:34:08', 0),
(78, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Kaidah Bahasa', NULL, NULL, 'Kalimat berikut memiliki kesalahan penggunaan kata:\r\n\r\n\"Dia berbicara dengan suara yang 𝐥𝐚𝐧𝐭𝐚𝐧𝐠 dan 𝐣𝐞𝐥𝐚𝐬.\"\r\n\r\nKata yang dicetak tebal dalam kalimat tersebut memiliki hubungan makna yang sama. Manakah kata yang tidak tepat untuk ditambahkan pada kalimat tersebut agar memiliki hubungan makna yang sama dengan kata-kata yang dicetak tebal?', 'Perlahan', 'Tegas', 'Cepat', 'Jelas', 'Fasih', 'C', 'Kata \"Cepat\" memiliki makna yang berlawanan dengan kata-kata yang dicetak tebal, yaitu \"lantang\" dan \"jelas\". Oleh karena itu, kata \"Cepat\" tidak tepat untuk ditambahkan pada kalimat tersebut agar memiliki hubungan makna yang sama dengan kata-kata yang dicetak tebal.', '2024-06-12 07:38:27', '2024-06-12 07:38:27', 0),
(79, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Sastra', NULL, NULL, 'Bacalah penggalan puisi berikut:\r\n\r\n\"Langit biru bagaikan lautan\r\nAwan putih berarak-arak pelan\r\nBurung-burung terbang bebas di angkasa\r\nPemandangan yang indah dan menawan\"\r\n\r\nMajas apa yang digunakan dalam penggalan puisi tersebut?', 'Metafora', 'Personifikasi', 'Simile', 'Hiperbola', 'Eufemisme', 'C', 'Majas simile adalah majas yang membandingkan dua hal dengan menggunakan kata \"seperti\" atau \"seumpama\". Dalam penggalan puisi tersebut, kata \"bagaikan\" digunakan untuk membandingkan langit biru dengan lautan. Oleh karena itu, majas yang digunakan dalam penggalan puisi tersebut adalah C. Simile.', '2024-06-12 07:39:42', '2024-06-12 07:39:42', 0),
(80, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Penafsiran Teks', NULL, NULL, 'Bacalah penggalan cerpen berikut:\r\n\r\n\"Dia duduk termenung di tepi pantai, menatap ombak yang berdebur memecah karang. Wajahnya tampak murung dan sedih. Pikirannya melayang jauh, mengenang masa lalunya yang indah bersama sang kekasih. Kini, kekasihnya telah tiada, dan dia merasa hampa dan kesepian.\"\r\n\r\nApa yang menjadi tema penggalan cerpen tersebut?', 'Cinta', 'Kehilangan', 'Kehidupan', 'Kesedihan', 'Alam', 'B', 'Penggalan cerpen tersebut menceritakan tentang seorang yang duduk di tepi pantai dan termenung sedih karena kehilangan sang kekasih. Oleh karena itu, tema penggalan cerpen tersebut adalah B. Kehilangan.', '2024-06-12 07:40:55', '2024-06-12 07:40:55', 0),
(81, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Kaidah Bahasa', NULL, NULL, 'Kalimat berikut memiliki kesalahan penggunaan kata:\r\n\r\n\"Saudara-saudara sekalian, 𝐌𝐚𝐫𝐢𝐥𝐚𝐡 𝐤𝐢𝐭𝐚 𝐛𝐞𝐫𝐬𝐚𝐦𝐚-𝐬𝐚𝐦𝐚 untuk 𝐦𝐞𝐧𝐢𝐧𝐠𝐤𝐚𝐭𝐤𝐚𝐧 kesadaran kita akan pentingnya menjaga kebersihan lingkungan.\"\r\n\r\nKata yang dicetak tebal dalam kalimat tersebut memiliki hubungan makna yang sama. Manakah kata yang tidak tepat untuk ditambahkan pada kalimat tersebut agar memiliki hubungan makna yang sama dengan kata-kata yang dicetak tebal?', 'Bersatu-padu', 'Bergotong-royong', 'Berlomba-lomba', 'Bersama-sama', 'Bersinergi', 'C', 'Kata \"Berlomba-lomba\" memiliki makna yang berbeda dengan kata-kata yang dicetak tebal, yaitu \"marilah kita bersama-sama\", \"meningkatkan\", dan \"menjaga\". Kata \"Berlomba-lomba\" memiliki makna bersaing untuk mencapai suatu tujuan, sedangkan kata-kata yang dicetak tebal memiliki makna bekerja sama, meningkatkan, dan menjaga. Oleh karena itu, kata \"Berlomba-lomba\" tidak tepat untuk ditambahkan pada kalimat tersebut agar memiliki hubungan makna yang sama dengan kata-kata yang dicetak tebal.', '2024-06-12 07:44:55', '2024-06-12 07:44:55', 0),
(82, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Sastra', NULL, NULL, 'Bunga yang indah mekar di taman\r\nWarnanya yang cerah memanjakan mata\r\nKumbang-kumbang berterbangan di sekitarnya\r\nPemandangan yang menenangkan jiwa\"\r\nMajas apa yang digunakan dalam penggalan puisi tersebut?', 'Metafora', 'Personifikasi', 'Simile', 'Hiperbola', 'Eufemisme', 'A', 'Majas metafora adalah majas yang membandingkan dua hal secara langsung tanpa menggunakan kata \"seperti\" atau \"seumpama\". Dalam penggalan puisi tersebut, kata \"Bunga\" digunakan untuk membandingkan sesuatu dengan bunga. Oleh karena itu, majas yang digunakan dalam penggalan puisi tersebut adalah A. Metafora.', '2024-06-12 07:45:53', '2024-06-12 07:45:53', 0),
(83, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Penafsiran Teks', NULL, NULL, 'Bacalah penggalan cerpen berikut:\r\n\r\n\"Dia berjalan dengan langkah gontai menuju rumah. Wajahnya tampak pucat dan matanya sembab. Dia baru saja menerima kabar duka bahwa sang nenek tercinta telah meninggal dunia. Di dalam hatinya, dia merasa sangat sedih dan kehilangan. Dia teringat masa-masa indah bersama sang nenek yang selalu penuh kasih sayang.\"\r\n\r\nApa yang menjadi latar belakang cerita penggalan cerpen tersebut?', 'Sang tokoh utama baru saja menerima kabar duka', 'Sang tokoh utama sedang berjalan menuju rumah.', 'Sang tokoh utama memiliki nenek yang tercinta.', 'Sang nenek tercinta telah meninggal dunia', 'Sang tokoh utama merasa sedih dan kehilangan.', 'D', 'Penggalan cerpen tersebut menceritakan tentang seorang yang baru saja menerima kabar duka bahwa sang nenek tercinta telah meninggal dunia. Oleh karena itu, latar belakang cerita penggalan cerpen tersebut adalah D. Sang nenek tercinta telah meninggal dunia.', '2024-06-12 07:47:12', '2024-06-12 07:47:12', 0),
(84, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Pemahaman Teks', 'Read the following passage carefully:\r\n\r\n\"Air pollution is a major environmental problem that affects all aspects of our lives. It is caused by the release of harmful substances into the atmosphere, such as smoke from factories and vehicles, dust from construction sites, and fumes from power plants. Air pollution can have a number of negative consequences, including respiratory problems, heart disease, and cancer. It can also damage ecosystems and reduce visibility. In order to address this issue, we need to take steps to reduce emissions from both stationary and mobile sources. We can also promote the use of renewable energy sources and encourage the use of public transportation.\"\r\n\r\nWhat is the main cause of air pollution?', 'The release of harmful substances into the atmosphere', 'Smoke from factories and vehicles', 'Dust from construction sites', 'Fumes from power plants', 'All of the above', 'E', 'The passage states that air pollution is caused by the release of harmful substances into the atmosphere, including smoke from factories and vehicles, dust from construction sites, and fumes from power plants. Therefore, the correct answer is E. All of the above.', '2024-06-12 07:49:01', '2024-06-12 07:49:01', 0),
(85, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Tata Bahasa dan Kosa Kata', 'The following sentence has an incorrect word usage:\r\n\r\n\"𝐃𝐞𝐬𝐩𝐢𝐭𝐞 the weather being hot, she still went to school.\"\r\n\r\nThe words in bold in the sentence have a similar meaning. Which word is not appropriate to add to the sentence to have a similar meaning to the words in bold?', 'Although', 'Nevertheless', 'However', 'In spite of', 'Even though', 'C', 'The words \"despite,\" \"although,\" \"nevertheless,\" \"in spite of,\" and \"even though\" all express a contrast between two ideas. The word \"however\" is used to introduce a contrasting idea, but it does not have the same strong contrast as the other words in the list. Therefore, the word \"however\" is not appropriate to add to the sentence to have a similar meaning to the words in bold.', '2024-06-12 07:50:56', '2024-06-12 07:50:56', 0),
(86, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Sastra', 'Read the following poem stanza carefully:\r\n\r\n\"The sky is a canvas of blue\r\nPainted with clouds of white\r\nThe sun shines down so bright\r\nA beautiful sight\"\r\n\r\nWhat figure of speech is used in the poem stanza?', 'Metaphor', 'Personification', 'Simile', 'Hyperbole', 'Euphemism', 'A', 'A metaphor is a figure of speech that compares two things directly without using the words \"like\" or \"as.\" In the poem stanza, the sky is compared to a canvas. Therefore, the figure of speech used in the poem stanza is A. Metaphor.', '2024-06-12 07:52:18', '2024-06-12 07:52:18', 0),
(87, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Analisis Teks', 'Read the following short story excerpt carefully:\r\n\r\n\"She sat on the park bench, watching the children play. A wave of sadness washed over her as she thought about her own childhood. She used to spend countless hours playing in the park with her friends, but now those days were long gone. She felt a pang of loneliness as she realized how much she missed those carefree days.\"\r\n\r\nWhat is the main theme of the short story excerpt?', 'Friendship', 'Childhood memories', 'Loneliness', 'The passage of time', 'The importance of play', 'C', 'The short story excerpt tells about a woman who is feeling lonely as she remembers her childhood. She used to spend a lot of time playing in the park with her friends, but now those days are gone. She feels a pang of loneliness as she realizes how much she misses those carefree days. Therefore, the main theme of the short story excerpt is C. Loneliness.', '2024-06-12 07:53:27', '2024-06-12 07:53:27', 0),
(88, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Pemahaman Teks', '\"Air pollution is a major environmental problem that affects all aspects of our lives. It is caused by the release of harmful substances into the atmosphere, such as smoke from factories and vehicles, dust from construction sites, and fumes from power plants. Air pollution can have a number of negative health effects, including respiratory problems, heart disease, and cancer. It can also damage ecosystems and reduce visibility.\"\r\n\r\nWhat is the main cause of air pollution?', 'Smoke from factories and vehicles', 'Dust from construction sites', 'Fumes from power plants', 'All of the above', 'None of the above', 'D', 'The paragraph states that air pollution is caused by the release of harmful substances into the atmosphere, including smoke from factories and vehicles, dust from construction sites, and fumes from power plants. Therefore, the answer is D. All of the above.', '2024-06-12 07:56:15', '2024-06-12 07:56:15', 0),
(89, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Tata Bahasa dan Kosa Kata', 'Choose the correct word to complete the following sentence:\r\n\r\n\"The _____ was very interesting and informative.\"', 'Lecture', 'Lecturer', 'Lectern', 'Lecture hall', 'Lectrue', 'A', 'The word \"lecture\" is a noun that refers to a formal talk given by an expert on a particular subject. The other options are not appropriate for the context of the sentence.', '2024-06-12 07:57:18', '2024-06-12 07:57:18', 0),
(90, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Sastra', 'Read the following poem:\r\n\r\n\"The Road Not Taken\"\r\n\r\nTwo roads diverged in a yellow wood,\r\nAnd sorry I could not travel both\r\nAnd be one traveler, long I stood\r\nAnd looked down one as far as I could\r\nTo where it bent in the undergrowth;\r\n\r\nThen took the other, as just as fair,\r\nAnd having perhaps the better claim,\r\nBecause it was grassy and wanted wear;\r\nThough as for that, the passing there\r\nHad worn them really about the same,\r\n\r\nAnd both that morning equally lay\r\nIn leaves no step had trodden black.\r\nOh, I kept the first for another day!\r\nYet knowing how way leads on to way,\r\nI doubted if I should ever come back.\r\n\r\nI shall be telling this with a sigh\r\nSomewhere ages and ages hence:\r\nTwo roads diverged in a wood, and I—\r\nI took the one less traveled by,\r\nAnd that has made all the difference.\r\n\r\nWhat is the theme of the poem?', 'The importance of making choices', 'The beauty of nature', 'The passage of time', 'The power of regret', 'The inevitability of change', 'A', 'The poem is about a speaker who comes to a fork in the road and must choose which path to take. The speaker chooses the less traveled path, and this decision makes all the difference in their life. The poem suggests that the choices we make in life are important and can have a significant impact on our future.', '2024-06-12 07:58:23', '2024-06-12 07:58:23', 0),
(91, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Analisis Teks', 'Read the following article:\r\nThe Importance of Preserving Our Planet\r\n\r\nOur planet Earth is a unique and precious place. It is the only known planet in the universe that supports life, and it is home to an incredible diversity of plants, animals, and ecosystems. However, our planet is facing a number of serious threats, including climate change, pollution, and deforestation. These threats are putting our planet\'s health at risk and could have devastating consequences for future generations.\r\n\r\nClimate change is one of the most pressing environmental issues facing our planet. It is caused by the buildup of greenhouse gases in the atmosphere, which trap heat and cause the planet to warm. The effects of climate change are already being felt around the world, in the form of more extreme weather events, rising sea levels, and melting glaciers. If we do not take action to address climate change, it could have catastrophic consequences, such as mass extinctions and widespread food shortages.\r\n\r\nPollution is another major threat to our planet. Pollution can be caused by a variety of sources, including industrial activities, vehicle emissions, and agricultural runoff. Pollution can contaminate our air, water, and soil, and it can have a number of negative health effects on humans and wildlife. For example, air pollution can cause respiratory problems, and water pollution can lead to waterborne diseases.\r\n\r\nDeforestation is the clearing of forests for other purposes, such as agriculture, logging, and mining. Forests play an important role in regulating the climate, preventing soil erosion, and providing habitat for biodiversity. Deforestation is having a devastating impact on our planet\'s ecosystems, and it is contributing to climate change.\r\n\r\nIt is clear that we need to take action to protect our planet. We can all do our part by making changes in our own lives, such as reducing our energy consumption, recycling, and using public transportation. We can also support organizations that are working to protect the environment. It is time to act now to ensure a healthy and sustainable future for our planet.\r\n\r\nWhat is the main argument of the article?', 'Climate change, pollution, and deforestation are the only threats to our planet.', 'Our planet is facing a number of serious threats that could have devastating consequences.', 'We need to take action to protect our planet by making changes in our own lives and supporting organizations that are working to protect the environment.', 'The future of our planet is uncertain.', 'We need to do more research to understand the threats to our planet.', 'C', 'The article discusses the many threats facing our planet, including climate change, pollution, and deforestation. It argues that these threats are serious and could have devastating consequences if we do not take action. The article then suggests a number of actions that we can take to protect our planet, such as reducing our energy consumption, recycling, and using public transportation. It also encourages us to support organizations that are working to protect the environment. Therefore, the answer is C. We need to take action to protect our planet by making changes in our own lives and supporting organizations that are working to protect the environment.', '2024-06-12 08:01:05', '2024-06-12 08:01:05', 0),
(92, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Operasi Aritmatika Dasar', NULL, 'Budi membeli 2 kg apel dengan harga Rp10.000,00 per kg. Berapa total biaya yang harus dibayarkan Budi?', 'Rp5.000,00', 'Rp10.000,00', 'Rp15.000,00', 'Rp20.000,00', 'Rp25.000,00', 'D', 'otal biaya yang harus dibayarkan Budi dihitung dengan mengalikan harga per kg dengan jumlah kg apel yang dibeli:\r\n\r\nTotal biaya = Harga per kg * Jumlah kg apel\r\n\r\nTotal biaya = Rp10.000,00/kg * 2 kg\r\n\r\nTotal biaya = Rp20.000,00', '2024-06-12 08:05:25', '2024-06-12 08:05:25', 0),
(93, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Persentase', NULL, 'Dalam sebuah kelas yang terdiri dari 30 siswa, terdapat 12 siswa yang gemar bermain tenis. Persentase siswa yang gemar bermain tenis adalah...', '20 %', '30 %', '40 %', '50 %', '60 %', 'C', 'Persentase siswa yang gemar bermain tenis dihitung dengan rumus:\r\n\r\nPersentase = (Jumlah siswa yang gemar bermain basket / Jumlah total siswa) * 100%\r\n\r\nPersentase = (12 siswa / 30 siswa) * 100%\r\n\r\nPersentase = 40%', '2024-06-12 08:07:05', '2024-06-12 08:07:05', 0),
(94, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Rasio dan Proporsi', NULL, 'Di sebuah toko, terdapat 3 apel merah dan 2 apel hijau. Rasio apel merah terhadap apel hijau adalah...', '1:2', '2:1', '3:2', '2:3', '3:5', 'C', 'Rasio menunjukkan hubungan perbandingan antara dua bilangan. Dalam kasus ini, rasio apel merah terhadap apel hijau adalah 3:2. Artinya, setiap 3 apel merah terdapat 2 apel hijau.', '2024-06-12 08:07:48', '2024-06-12 08:07:48', 0),
(95, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Persamaan dan Ungkapan Aljabar', NULL, 'Jika x adalah nilai suatu variabel, nilai dari 2x + 5 ketika x = 3 adalah...', '11', '14', '17', '20', '23', 'C', 'Untuk menghitung nilai dari 2x + 5 ketika x = 3, kita perlu mengganti nilai x dengan 3 pada persamaan:\r\n\r\n2x + 5 = 2(3) + 5\r\n\r\n2x + 5 = 6 + 5\r\n\r\n2x + 5 = 11', '2024-06-12 08:08:28', '2024-06-12 08:08:28', 0),
(96, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Geometri Dasar', NULL, 'Sebuah segitiga memiliki panjang alas 10 cm dan tinggi 8 cm. Luas segitiga tersebut adalah...', '20 cm²', '30 cm²', '40 cm²', '50 cm²', '60 cm²', 'B', 'Luas segitiga dihitung dengan rumus:\r\n\r\nLuas = 1/2 * Alas * Tinggi\r\n\r\nLuas = 1/2 * 10 cm * 8 cm\r\n\r\nLuas = 40 cm²', '2024-06-12 08:10:10', '2024-06-12 08:10:10', 0),
(97, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Statistik dan Probabilitas', NULL, 'Dalam sebuah dadu, peluang munculnya mata dadu dengan angka 5 adalah...', '1/3', '1/4', '1/5', '1/6', '1/7', 'D', 'Peluang adalah kemungkinan terjadinya suatu peristiwa. Dalam kasus ini, peluang munculnya mata dadu dengan angka 5 adalah 1/6 karena terdapat 1 mata dadu dengan angka 5 dari total 6 mata dadu yang ada.', '2024-06-12 08:11:13', '2024-06-12 08:11:13', 0),
(98, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Pemecahan Masalah Matematis', NULL, 'Ani memiliki uang Rp50.000,00. Dia ingin membeli 2 kg jeruk dengan harga Rp10.000,00 per kg dan 1 kg apel dengan harga Rp15.000,00 per kg. Berapa sisa uang Ani setelah membeli jeruk dan apel?', 'Rp10.000,00', 'Rp15.000,00', 'Rp20.000,00', 'Rp25.000,00', 'Rp30.000,00', 'A', '1. Hitung total biaya jeruk: 2 kg jeruk * Rp10.000,00/kg = Rp20.000,00\r\n2. Hitung total biaya apel: 1 kg apel * Rp15.000,00/kg = 3. Rp15.000,00\r\n3. Hitung total biaya jeruk dan apel: Rp20.000,00 + Rp15.000,00 = Rp35.000,00\r\n4. Hitung sisa uang Ani: Rp50.000,00 - Rp35.000,00 = Rp15.000,00', '2024-06-12 08:14:11', '2024-06-12 08:14:11', 0),
(99, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Pemecahan Masalah Matematis', NULL, 'Sebuah kolam renang berbentuk persegi panjang dengan panjang 20 meter dan lebar 15 meter. Jika kolam tersebut ingin diisi air hingga ketinggian 1 meter, berapa liter air yang dibutuhkan?', '300 m³', '3000 liter', '30.000 liter', '300.000 liter', '3.000.000 liter', 'D', '1. Hitung volume kolam renang: Luas (panjang x lebar) x tinggi = 20 m x 15 m x 1 m = 300 m³\r\n2. Konversi volume dari m³ ke liter: 1 m³ = 1000 liter\r\n3. Hitung volume air yang dibutuhkan: 300 m³ x 1000 liter/m³ = 300.000 liter', '2024-06-12 08:17:20', '2024-06-12 08:17:20', 0),
(100, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Pemecahan Masalah Matematis', NULL, 'Sebuah mobil melaju dengan kecepatan 60 km/jam selama 2 jam. Berapa jarak yang ditempuh mobil tersebut?', '120 km', '240 Km', '360 km', '480 km', '600 km', 'B', 'Langkah-langkah untuk menyelesaikan masalah ini:\r\n\r\n1. Hitung jarak yang ditempuh dalam 1 jam: Kecepatan x Waktu = 60 km/jam x 1 jam = 60 km\r\n2. Hitung total jarak yang ditempuh dalam 2 jam: Jarak per jam x Jumlah jam = 60 km/jam x 2 jam = 120 km', '2024-06-12 08:18:26', '2024-06-12 08:18:26', 0),
(101, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Generalisasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Tentukan angka berikutnya dalam deret berikut: 3, 6, 12, 24, ...', '30', '36', '48', '60', '65', 'C', 'Setiap angka adalah hasil kali dua dari angka sebelumnya. Jadi, angka berikutnya adalah 24 * 2 = 48.', '2024-06-15 00:43:01', '2024-06-23 00:07:38', 1),
(102, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Generalisasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Tentukan angka berikutnya dalam deret berikut: 5, 10, 20, 40, ...', '50', '60', '80', '100', '110', 'C', 'Setiap angka dalam deret ini adalah hasil kali dua dari angka sebelumnya. Jadi, angka berikutnya adalah 40 * 2 = 80.', '2024-06-15 00:44:29', '2024-06-23 00:07:38', 1),
(103, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Generalisasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Tentukan angka berikutnya dalam deret berikut: 2, 6, 12, 20, ...', '24', '28', '30', '32', '34', 'C', 'Deret ini menunjukkan peningkatan yang bertambah secara berurutan:\r\n\r\nDari 2 ke 6: +4\r\nDari 6 ke 12: +6\r\nDari 12 ke 20: +8\r\n\r\nSetiap kenaikan bertambah dengan 2. Jadi, kenaikan berikutnya adalah 20 + 10 = 30.', '2024-06-15 00:47:34', '2024-06-19 08:36:04', 1),
(104, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Generalisasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika \"Kucing\r\n\" maka \"Anjing:...\"', 'Bulu', 'Menggonggong', 'Rumah', 'Lari', 'Meong', 'B', 'Kucing mengeluarkan suara \"meong\", jadi kita mencari suara yang dihasilkan oleh anjing. Anjing mengeluarkan suara \"menggonggong\".', '2024-06-15 00:48:40', '2024-06-23 00:07:38', 1),
(105, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Dokter : Pasien = Guru : ...', 'Sekolah', 'Pelajar', 'Kelas', 'Buku', 'pelajaran', 'B', 'Hubungan antara Dokter dan Pasien adalah hubungan profesi dan orang yang dilayani. Hubungan serupa adalah Guru dengan Pelajar.', '2024-06-15 00:51:50', '2024-06-23 00:07:38', 2),
(106, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pisau : Memotong = Pena : ...', 'Menulis', 'Membaca', 'Menggambar', 'Menyusun', 'Mewarnai', 'A', 'Hubungan antara Pisau dan Memotong adalah alat dengan fungsinya. Hubungan serupa adalah Pena dengan Menulis.', '2024-06-15 00:53:42', '2024-06-23 00:07:38', 2),
(107, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Buku : Perpustakaan = Obat : ...', 'Toko', 'Dokter', 'Apotek', 'Rumah Sakit', 'Klinik', 'C', 'Hubungan antara Buku dan Perpustakaan adalah objek dengan tempat penyimpanannya. Hubungan serupa adalah Obat dengan Apotek.', '2024-06-15 00:55:00', '2024-06-23 00:07:38', 2),
(108, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ayah : Keluarga = Presiden : ...', 'Negara', 'Kota', 'Kabupaten', 'Desa', 'Kontinen', 'A', 'Hubungan antara Ayah dan Keluarga adalah pemimpin dalam lingkup kecil. Hubungan serupa adalah Presiden sebagai pemimpin Negara.', '2024-06-15 00:55:56', '2024-06-23 00:07:38', 2),
(109, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Makan : Mengunyah = Menulis : ...', 'Membaca', 'Menghapus', 'Menggambar', 'Mengetik', 'Menulis', 'D', 'Hubungan antara Makan dan Mengunyah adalah aktivitas dan proses yang terkait. Hubungan serupa adalah Menulis dengan Mengetik.', '2024-06-15 00:56:42', '2024-06-23 00:07:38', 2),
(110, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sapu : Membersihkan = Kacamata : ...', 'Melihat', 'Membaca', 'Menulis', 'Mengamati', 'Menjelajah', 'A', 'Hubungan antara Sapu dan Membersihkan adalah alat dan fungsinya. Hubungan serupa adalah Kacamata dengan Melihat.', '2024-06-15 00:57:24', '2024-06-23 00:07:38', 2),
(111, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Kayu : Meja = Kain : ...', 'Jahit', 'Baju', 'Toko', 'Penjahit', 'Mesin', 'B', 'Hubungan antara Kayu dan Meja adalah bahan dasar dan produk yang dihasilkan. Hubungan serupa adalah Kain dengan Baju.', '2024-06-15 00:58:04', '2024-06-23 00:07:38', 2),
(112, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Analogi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Gitar : Senar = Drum : ...', 'Palu', 'Kayu', 'Simbal', 'Tongkat', 'Membran', 'E', 'Hubungan antara Gitar dan Senar adalah alat musik dan bagian yang digunakan untuk menghasilkan suara. Hubungan serupa adalah Drum dengan Membran.', '2024-06-15 00:59:25', '2024-06-23 00:07:38', 2),
(113, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika hujan turun, maka jalanan akan basah. Hujan adalah ...', 'Akibat', 'Penyebab', 'Keadaan', 'Proses', 'Hasil', 'B', 'Hujan adalah penyebab yang mengakibatkan jalanan basah.', '2024-06-15 02:45:50', '2024-06-23 00:07:38', 3),
(114, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika lampu padam, maka ruangan menjadi gelap. Lampu padam adalah ...', 'Akibat', 'Penyebab', 'Sumber', 'Keadaan', 'Hasil', 'B', 'Lampu padam adalah penyebab yang mengakibatkan ruangan menjadi gelap.', '2024-06-15 02:46:36', '2024-06-23 00:07:38', 3),
(115, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika belajar dengan tekun, maka nilai ujian akan meningkat. Belajar dengan tekun adalah ...', 'Akibat', 'Penyebab', 'Keadaan', 'Proses', 'Hasil', 'B', 'Belajar dengan tekun adalah penyebab yang mengakibatkan nilai ujian meningkat.', '2024-06-15 02:47:24', '2024-06-23 00:07:38', 3),
(116, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika belajar dengan tekun, maka nilai ujian akan meningkat. Belajar dengan tekun adalah ...', 'Akibat', 'Penyebab', 'Keadaan', 'Proses', 'Hasil', 'B', 'Belajar dengan tekun adalah penyebab yang mengakibatkan nilai ujian meningkat.', '2024-06-15 02:47:29', '2024-06-23 00:07:38', 3),
(117, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika makan terlalu banyak, maka berat badan akan naik. Berat badan naik adalah ...', 'Penyebab', 'Akibat', 'Proses', 'Keadaan', 'Sumber', 'B', 'Berat badan naik adalah akibat dari makan terlalu banyak.', '2024-06-15 02:48:25', '2024-06-23 00:07:38', 3),
(118, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Hubungan kausal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika komputer terkena virus, maka komputer akan lambat. Komputer lambat adalah ...', 'Penyebab', 'Akibat', 'Proses', 'Keadaan', 'Sumber', 'B', 'Komputer lambat adalah akibat dari komputer terkena virus.', '2024-06-15 02:49:06', '2024-06-23 00:07:38', 3),
(119, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Menyangkal anteseden', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika ada api, maka ada asap. Ternyata tidak ada asap. Maka dapat disimpulkan:', 'Tidak ada api', 'Ada api', 'Asap tidak terlihat', 'Api padam dengan cepat', 'Terlalu banyak angin', 'A', 'Jika pernyataan \"jika ada api, maka ada asap\" benar dan tidak ada asap, maka kita dapat menyimpulkan bahwa tidak ada api.', '2024-06-15 02:51:29', '2024-06-23 00:07:38', 4),
(120, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Menyangkal anteseden', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika lampu menyala, maka ruangan terang. Ternyata ruangan tidak terang. Maka dapat disimpulkan:', 'Lampu sangat redup', 'Lampu tidak menyala', 'Lampu rusak', 'Lampu tertutup sesuatu', 'Lampu menghadap ke arah lain', 'B', 'Jika pernyataan \"jika lampu menyala, maka ruangan terang\" benar dan ruangan tidak terang, maka kita dapat menyimpulkan bahwa lampu tidak menyala.', '2024-06-15 02:52:24', '2024-06-23 00:07:38', 4),
(121, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Menyangkal anteseden', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika minum kopi, maka akan terjaga sepanjang malam. Ternyata seseorang tidak terjaga sepanjang malam. Maka dapat disimpulkan:', 'Tidak minum kopi', 'Minum kopi tetapi tetap tidur', 'Minum kopi tetapi sedikit', 'Terlalu lelah', 'Kopi tidak berpengaruh', 'A', 'Jika pernyataan \"jika minum kopi, maka akan terjaga sepanjang malam\" benar dan seseorang tidak terjaga sepanjang malam, maka kita dapat menyimpulkan bahwa tidak minum kopi.', '2024-06-15 02:53:45', '2024-06-23 00:07:38', 4),
(122, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Menyangkal anteseden', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika hari hujan, maka jalanan basah. Ternyata jalanan tidak basah. Maka dapat disimpulkan:', 'Hujan tertahan', 'Jalanan berpasir', 'Jalanan berbatu', 'Hujan reda', 'Hari tidak hujan', 'E', 'Jika pernyataan \"jika hari hujan, maka jalanan basah\" benar dan jalanan tidak basah, maka kita dapat menyimpulkan bahwa hari tidak hujan.', '2024-06-15 02:54:57', '2024-06-23 00:07:38', 4),
(123, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Menyangkal anteseden', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pernyataan: Jika menghadiri kursus pelatihan, maka akan meningkatkan keterampilan profesional. Jika keterampilan profesional tidak meningkat, maka dapat disimpulkan bahwa ...', 'Materi kursus terlalu sulit', 'Kurangnya dukungan dari rekan kerja', 'Kursus terlalu singkat', 'Tidak menghadiri kursus pelatihan', 'Fokus pada kursus yang salah', 'D', 'Jika keterampilan profesional tidak meningkat dan pernyataan \"jika menghadiri kursus pelatihan, maka akan meningkatkan keterampilan profesional\" benar, maka dapat disimpulkan bahwa tidak menghadiri kursus pelatihan.', '2024-06-15 03:04:01', '2024-06-23 00:07:38', 4),
(124, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Mengafirmasi konsekuensi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pernyataan: Jika seorang siswa rajin belajar, maka nilai ujiannya akan baik. Ali rajin belajar setiap hari. Konsekuensi yang dapat diafirmasi adalah ...', 'Ali tidak akan hadir pada hari ujian.', 'Guru mungkin akan memberi soal sulit untuk Ali.', 'Ali pasti akan mendapatkan nilai tinggi.', 'Ali mungkin akan sakit pada hari ujian.', 'Ali tidak mungkin akan mendapatkan nilai tinggi.', 'C', 'Jika seorang siswa rajin belajar, maka nilai ujiannya akan baik. Karena Ali rajin belajar setiap hari, konsekuensinya adalah nilai ujian Ali pasti akan baik.', '2024-06-15 07:33:16', '2024-06-23 00:07:38', 5),
(125, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Mengafirmasi konsekuensi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pernyataan: Jika seseorang tidak makan dengan teratur, maka kesehatannya akan menurun. Lisa tidak makan dengan teratur. Konsekuensi yang dapat diafirmasi adalah ...', 'Kesehatan Lisa tidak akan berubah.', 'Lisa mungkin akan menjadi lebih sehat.', 'Lisa mungkin tidak akan merasakan perubahan kesehatan.', 'Kesehatan Lisa pasti akan menurun.', 'Lisa akan menjadi lebih gemuk.', 'D', 'Jika seseorang tidak makan dengan teratur, maka kesehatannya akan menurun. Karena Lisa tidak makan dengan teratur, konsekuensinya adalah kesehatan Lisa pasti akan menurun.', '2024-06-15 07:34:12', '2024-06-23 00:07:38', 5),
(126, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Induktif', 'Mengafirmasi konsekuensi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pernyataan: Jika cuaca cerah, maka lapangan akan ramai oleh anak-anak bermain. Hari ini cuaca cerah. Konsekuensi yang dapat diafirmasi adalah ...', 'Tidak ada anak yang bermain di lapangan.', 'Lapangan akan penuh dengan orang dewasa.', 'Lapangan pasti akan ramai oleh anak-anak bermain.', 'Anak-anak mungkin akan pergi ke bioskop.', 'Lapangan akan kosong karena cuaca cerah.', 'C', 'Jika cuaca cerah, maka lapangan akan ramai oleh anak-anak bermain. Karena hari ini cuaca cerah, konsekuensinya adalah lapangan pasti akan ramai oleh anak-anak bermain.', '2024-06-15 07:35:02', '2024-06-23 00:07:38', 5),
(127, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Silogisme', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis Mayor: Semua dokter adalah orang terdidik.\r\nPremis Minor: Semua orang terdidik adalah pembaca buku.\r\nKesimpulan yang benar adalah ...', 'Semua dokter adalah pembaca buku.', 'Semua pembaca buku adalah dokter.', 'Beberapa dokter bukan pembaca buku.', 'Semua orang terdidik adalah dokter.', 'Beberapa dokter adalah orang terdidik.', 'A', '1. Premis Mayor: Semua dokter (A) adalah orang terdidik (B).\r\n2. Premis Minor: Semua orang terdidik (B) adalah pembaca buku (C).\r\n3. Kesimpulan: Dari kedua premis ini, kita bisa menggabungkannya menjadi \"Semua dokter (A) adalah pembaca buku (C)\" karena jika semua dokter adalah orang terdidik dan semua orang terdidik adalah pembaca buku, maka semua dokter juga adalah pembaca buku.', '2024-06-15 07:42:18', '2024-06-23 00:07:38', 6),
(128, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Silogisme', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis Mayor: Semua siswa rajin belajar.\r\nPremis Minor: Dina adalah siswa.\r\nKesimpulan yang benar adalah ...', 'Dina pasti tidak rajin belajar.', 'Dina mungkin rajin belajar.', 'Dina pasti rajin belajar.', 'Dina adalah guru.', 'Dina mungkin seorang pelajar yang tidak rajin.', 'C', '1. Premis Mayor: Semua siswa (A) rajin belajar (B).\r\n2. Premis Minor: Dina (C) adalah siswa (A).\r\n3. Kesimpulan: Dari premis-premis ini, kita dapat menyimpulkan bahwa \"Dina (C) pasti rajin belajar (B)\" karena Dina adalah siswa, dan semua siswa rajin belajar.', '2024-06-15 07:43:20', '2024-06-23 00:07:38', 6);
INSERT INTO `soal_tryout` (`id`, `question_type`, `tps_type`, `penalaran_type`, `penalaran_induktif_detail`, `penalaran_deduktif_detail`, `penalaran_kuantitatif_detail`, `pemahaman_pemahaman_type`, `pemahaman_type`, `kuantitatif_type`, `tl_type`, `tl_indonesia_type`, `tl_matematika_type`, `tl_inggris_type`, `question`, `option_a`, `option_b`, `option_c`, `option_d`, `option_e`, `correct_answer`, `answer_explanation`, `created_at`, `updated_at`, `materi_id`) VALUES
(129, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Silogisme', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis Mayor: Semua binatang yang bernafas adalah makhluk hidup.\r\nPremis Minor: Semua ikan adalah binatang yang bernafas.\r\nKesimpulan yang benar adalah ...', 'Semua makhluk hidup adalah ikan.', 'Semua ikan adalah makhluk hidup.', 'Beberapa makhluk hidup adalah ikan.', 'Beberapa ikan adalah makhluk hidup.', 'Tidak ada ikan yang merupakan makhluk hidup.', 'B', '1. Premis Mayor: Semua binatang yang bernafas (A) adalah makhluk hidup (B).\r\n2. Premis Minor: Semua ikan (C) adalah binatang yang bernafas (A).\r\n3. Kesimpulan: Dari premis-premis ini, kita dapat menyimpulkan bahwa \"Semua ikan (C) adalah makhluk hidup (B)\" karena semua ikan adalah binatang yang bernafas dan semua binatang yang bernafas adalah makhluk hidup.', '2024-06-15 07:44:57', '2024-06-23 00:07:38', 6),
(130, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Silogisme', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis Mayor: Semua pekerja keras adalah orang sukses.\r\nPremis Minor: Budi adalah pekerja keras.\r\nKesimpulan yang benar adalah ...', 'Budi tidak sukses.', 'Budi pasti sukses.', 'Budi mungkin sukses.', 'Budi tidak bekerja keras.', 'Budi adalah orang yang rajin belajar.', 'B', '1. Premis Mayor: Semua pekerja keras (A) adalah orang sukses (B).\r\n2. Premis Minor: Budi (C) adalah pekerja keras (A).\r\n3. Kesimpulan: Dari premis-premis ini, kita dapat menyimpulkan bahwa \"Budi (C) pasti sukses (B)\" karena Budi adalah pekerja keras, dan semua pekerja keras adalah orang sukses.', '2024-06-15 07:45:59', '2024-06-23 00:07:38', 6),
(131, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Silogisme', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis Mayor: Semua manusia memiliki otak.\r\nPremis Minor: Semua guru adalah manusia.\r\nKesimpulan yang benar adalah ...', 'Beberapa guru tidak memiliki otak.', 'Tidak ada manusia yang memiliki otak.', 'Beberapa manusia tidak memiliki otak.', 'Semua guru memiliki otak.', 'Semua manusia adalah guru.', 'D', '1. Premis Mayor: Semua manusia (A) memiliki otak (B).\r\n2. Premis Minor: Semua guru (C) adalah manusia (A).\r\n3. Kesimpulan: Dari premis-premis ini, kita dapat menyimpulkan bahwa \"Semua guru (C) memiliki otak (B)\" karena semua guru adalah manusia dan semua manusia memiliki otak.', '2024-06-15 07:47:32', '2024-06-23 00:07:38', 6),
(132, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus ponens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang adalah dokter, maka dia adalah orang terdidik.\r\nPremis 2: Budi adalah dokter.\r\nKesimpulan yang benar adalah ...', 'Budi adalah orang terdidik.', 'Budi mungkin orang terdidik.', 'Budi bukan orang terdidik.', 'Budi tidak bekerja sebagai dokter.', 'Budi tidak berpendidikan.', 'A', 'Premis 1 (P → Q): Jika seseorang adalah dokter (P), maka dia adalah orang terdidik (Q).\r\nPremis 2 (P): Budi adalah dokter (P).\r\nKesimpulan (Q): Oleh karena itu, Budi adalah orang terdidik (Q).\r\nModus ponens menyatakan bahwa jika premis 1 dan premis 2 benar, maka kesimpulan harus benar.', '2024-06-15 07:53:07', '2024-06-23 00:07:38', 7),
(133, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus ponens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika cuaca cerah, maka kita akan pergi ke pantai.\r\nPremis 2: Cuaca cerah.\r\nKesimpulan yang benar adalah ...', 'Kita tidak akan pergi ke pantai.', 'Kita akan pergi ke pantai.', 'Cuaca mungkin akan berubah.', 'Kita akan pergi ke gunung.', 'Kita akan tinggal di rumah.', 'B', 'Premis 1 (P → Q): Jika cuaca cerah (P), maka kita akan pergi ke pantai (Q).\r\nPremis 2 (P): Cuaca cerah (P).\r\nKesimpulan (Q): Oleh karena itu, kita akan pergi ke pantai (Q).\r\nDengan modus ponens, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 07:56:14', '2024-06-23 00:07:38', 7),
(134, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus ponens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang berolahraga secara teratur, maka dia akan sehat.\r\nPremis 2: Andi berolahraga secara teratur.\r\nKesimpulan yang benar adalah ...', 'Andi jarang berolahraga.', 'Andi mungkin sehat.', 'Andi akan sehat.', 'Andi jarang berolahraga.', 'Andi tidak sehat.', 'C', 'Premis 1 (P → Q): Jika seseorang berolahraga secara teratur (P), maka dia akan sehat (Q).\r\nPremis 2 (P): Andi berolahraga secara teratur (P).\r\nKesimpulan (Q): Oleh karena itu, Andi akan sehat (Q).', '2024-06-15 07:57:45', '2024-06-23 00:07:38', 7),
(135, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus ponens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang membaca banyak buku, maka dia akan memiliki wawasan luas.\r\nPremis 2: Rina membaca banyak buku.\r\nKesimpulan yang benar adalah ...', 'Rina mungkin memiliki wawasan luas.', 'Rina tidak memiliki wawasan luas.', 'Rina tidak suka membaca.', 'Rina memiliki wawasan luas.', 'Rina jarang membaca buku.', 'D', 'Premis 1 (P → Q): Jika seseorang membaca banyak buku (P), maka dia akan memiliki wawasan luas (Q).\r\nPremis 2 (P): Rina membaca banyak buku (P).\r\nKesimpulan (Q): Oleh karena itu, Rina memiliki wawasan luas (Q).\r\nDengan modus ponens, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 07:58:40', '2024-06-23 00:07:38', 7),
(136, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus ponens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika lampu merah menyala, maka kendaraan harus berhenti.\r\nPremis 2: Lampu merah menyala.\r\nKesimpulan yang benar adalah ...', 'Kendaraan tidak harus berhenti.', 'Kendaraan harus belok kiri.', 'Kendaraan harus mempercepat.', 'Kendaraan boleh jalan terus.', 'Kendaraan harus berhenti.', 'E', 'Premis 1 (P → Q): Jika lampu merah menyala (P), maka kendaraan harus berhenti (Q).\r\nPremis 2 (P): Lampu merah menyala (P).\r\nKesimpulan (Q): Oleh karena itu, kendaraan harus berhenti (Q).\r\nDengan modus ponens, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 07:59:44', '2024-06-23 00:07:38', 7),
(137, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus tollens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang adalah dokter, maka dia adalah orang terdidik.\r\nPremis 2: Budi bukan orang terdidik.\r\nKesimpulan yang benar adalah ...', 'Budi bukan dokter.', 'Budi adalah dokter.', 'Budi mungkin dokter.', 'Budi tidak bekerja sebagai dokter.', 'Budi tidak berpendidikan.', 'A', 'Premis 1 (P → Q): Jika seseorang adalah dokter (P), maka dia adalah orang terdidik (Q).\r\nPremis 2 (¬Q): Budi bukan orang terdidik (¬Q).\r\nKesimpulan (¬P): Oleh karena itu, Budi bukan dokter (¬P).\r\nDengan modus tollens, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 08:03:04', '2024-06-23 00:07:38', 8),
(138, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus tollens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika cuaca cerah, maka kita akan pergi ke pantai.\r\nPremis 2: Kita tidak pergi ke pantai.\r\nKesimpulan yang benar adalah ...', 'Cuaca cerah.', 'Cuaca tidak cerah.', 'Cuaca mungkin cerah.', 'Kita akan pergi ke gunung.', 'Kita akan tinggal di rumah.', 'B', 'Premis 1 (P → Q): Jika cuaca cerah (P), maka kita akan pergi ke pantai (Q).\r\nPremis 2 (¬Q): Kita tidak pergi ke pantai (¬Q).\r\nKesimpulan (¬P): Oleh karena itu, cuaca tidak cerah (¬P).\r\nDengan modus tollens, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 08:03:58', '2024-06-23 00:07:38', 8),
(139, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus tollens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang berolahraga secara teratur, maka dia akan sehat.\r\nPremis 2: Andi tidak sehat.\r\nKesimpulan yang benar adalah ...', 'Andi berolahraga secara teratur.', 'Andi mungkin berolahraga secara teratur.', 'Andi tidak berolahraga secara teratur.', 'Andi jarang berolahraga.', 'Andi sakit.', 'C', 'Premis 1 (P → Q): Jika seseorang berolahraga secara teratur (P), maka dia akan sehat (Q).\r\nPremis 2 (¬Q): Andi tidak sehat (¬Q).\r\nKesimpulan (¬P): Oleh karena itu, Andi tidak berolahraga secara teratur (¬P).\r\nDengan modus tollens, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 08:04:48', '2024-06-23 00:07:38', 8),
(140, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus tollens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang membaca banyak buku, maka dia akan memiliki wawasan luas.\r\nPremis 2: Rina tidak memiliki wawasan luas.\r\nKesimpulan yang benar adalah ...', 'Rina jarang membaca buku.', 'Rina tidak suka membaca.', 'Rina mungkin membaca banyak buku.', 'Rina tidak membaca banyak buku.', 'Rina membaca banyak buku.', 'D', 'Premis 1 (P → Q): Jika seseorang membaca banyak buku (P), maka dia akan memiliki wawasan luas (Q).\r\nPremis 2 (¬Q): Rina tidak memiliki wawasan luas (¬Q).\r\nKesimpulan (¬P): Oleh karena itu, Rina tidak membaca banyak buku (¬P).\r\nDengan modus tollens, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 08:05:48', '2024-06-23 00:07:38', 8),
(141, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Modus tollens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika lampu merah menyala, maka kendaraan harus berhenti.\r\nPremis 2: Kendaraan tidak berhenti.\r\nKesimpulan yang benar adalah ...', 'Kendaraan tidak harus berhenti.', 'Kendaraan harus belok kiri.', 'Kendaraan harus mempercepat.', 'Lampu merah menyala.', 'Lampu merah tidak menyala.', 'E', 'Premis 1 (P → Q): Jika lampu merah menyala (P), maka kendaraan harus berhenti (Q).\r\nPremis 2 (¬Q): Kendaraan tidak berhenti (¬Q).\r\nKesimpulan (¬P): Oleh karena itu, lampu merah tidak menyala (¬P).\r\nDengan modus tollens, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 08:06:34', '2024-06-23 00:07:38', 8),
(142, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Argumen berantai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang rajin belajar, maka dia akan mendapatkan nilai tinggi.\r\nPremis 2: Jika seseorang mendapatkan nilai tinggi, maka dia akan diterima di universitas terbaik.\r\nKesimpulan yang benar adalah ...', 'Jika seseorang rajin belajar, maka dia akan diterima di universitas terbaik.', 'Jika seseorang tidak rajin belajar, maka dia tidak akan diterima di universitas terbaik.', 'Jika seseorang diterima di universitas terbaik, maka dia rajin belajar.', 'Jika seseorang mendapatkan nilai tinggi, maka dia rajin belajar.', 'Jika seseorang diterima di universitas terbaik, maka dia tidak rajin belajar.', 'A', 'Premis 1 (P → Q): Jika seseorang rajin belajar (P), maka dia akan mendapatkan nilai tinggi (Q).\r\nPremis 2 (Q → R): Jika seseorang mendapatkan nilai tinggi (Q), maka dia akan diterima di universitas terbaik (R).\r\nKesimpulan (P → R): Oleh karena itu, jika seseorang rajin belajar (P), maka dia akan diterima di universitas terbaik (R).', '2024-06-15 08:11:43', '2024-06-23 00:07:38', 9),
(143, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Argumen berantai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika cuaca cerah, maka kita akan pergi piknik.\r\nPremis 2: Jika kita pergi piknik, maka kita akan membawa bekal.\r\nKesimpulan yang benar adalah ...', 'Jika cuaca tidak cerah, maka kita tidak akan membawa bekal.', 'Jika cuaca cerah, maka kita akan membawa bekal.', 'Jika kita membawa bekal, maka cuaca cerah.', 'Jika kita tidak pergi piknik, maka cuaca tidak cerah.', 'Jika kita membawa bekal, maka kita tidak pergi piknik.', 'B', 'Premis 1 (P → Q): Jika cuaca cerah (P), maka kita akan pergi piknik (Q).\r\nPremis 2 (Q → R): Jika kita pergi piknik (Q), maka kita akan membawa bekal (R).\r\nKesimpulan (P → R): Oleh karena itu, jika cuaca cerah (P), maka kita akan membawa bekal (R).', '2024-06-15 08:12:35', '2024-06-23 00:07:38', 9),
(144, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Argumen berantai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang memakan makanan sehat, maka dia akan memiliki tubuh yang bugar.\r\nPremis 2: Jika seseorang memiliki tubuh yang bugar, maka dia akan lebih produktif.\r\nKesimpulan yang benar adalah ...', 'Jika seseorang lebih produktif, maka dia memiliki tubuh yang bugar.', 'Jika seseorang memiliki tubuh yang bugar, maka dia memakan makanan sehat.', 'Jika seseorang memakan makanan sehat, maka dia akan lebih produktif.', 'Jika seseorang tidak memakan makanan sehat, maka dia tidak akan lebih produktif.', 'Jika seseorang tidak memakan makanan sehat, maka dia tidak memiliki tubuh yang bugar.', 'C', 'Premis 1 (P → Q): Jika seseorang memakan makanan sehat (P), maka dia akan memiliki tubuh yang bugar (Q).\r\nPremis 2 (Q → R): Jika seseorang memiliki tubuh yang bugar (Q), maka dia akan lebih produktif (R).\r\nKesimpulan (P → R): Oleh karena itu, jika seseorang memakan makanan sehat (P), maka dia akan lebih produktif (R).', '2024-06-15 08:13:24', '2024-06-23 00:07:38', 9),
(145, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Argumen berantai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Premis 1: Jika seseorang mengikuti pelatihan, maka dia akan menguasai keterampilan baru.\r\nPremis 2: Jika seseorang menguasai keterampilan baru, maka dia akan lebih mudah mendapatkan pekerjaan.\r\nKesimpulan yang benar adalah ...', 'Jika seseorang tidak mengikuti pelatihan, maka dia tidak akan lebih mudah mendapatkan pekerjaan.', 'Jika seseorang tidak menguasai keterampilan baru, maka dia tidak mengikuti pelatihan.', 'Jika seseorang mengikuti pelatihan, maka dia tidak menguasai keterampilan baru.', 'Jika seseorang mendapatkan pekerjaan, maka dia mengikuti pelatihan.', 'Jika seseorang mengikuti pelatihan, maka dia akan lebih mudah mendapatkan pekerjaan.', 'E', 'Premis 1 (P → Q): Jika seseorang mengikuti pelatihan (P), maka dia akan menguasai keterampilan baru (Q).\r\nPremis 2 (Q → R): Jika seseorang menguasai keterampilan baru (Q), maka dia akan lebih mudah mendapatkan pekerjaan (R).\r\nKesimpulan (P → R): Oleh karena itu, jika seseorang mengikuti pelatihan (P), maka dia akan lebih mudah mendapatkan pekerjaan (R).', '2024-06-15 08:14:10', '2024-06-23 00:07:38', 9),
(146, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Logika matematika', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diberikan dua pernyataan:\r\nPernyataan 1 (P): Semua siswa lulus ujian.\r\nPernyataan 2 (Q): Budi adalah seorang siswa.\r\nKesimpulan: Jika Budi adalah seorang siswa, maka Budi lulus ujian.\r\nPernyataan mana yang benar?', '𝑄 → 𝑃', '𝑃 ∧ 𝑄', '𝑃 → 𝑄', '𝑄 ∧ ¬𝑃', '¬𝑄 ∨ 𝑃', 'A', 'Premis 1 (P): Semua siswa lulus ujian.\r\nPremis 2 (Q): Budi adalah seorang siswa.\r\nKesimpulan (Q → P): Jika Budi adalah seorang siswa, maka Budi lulus ujian.\r\nDengan implikasi, jika premis 1 dan premis 2 benar, kesimpulan harus benar.', '2024-06-15 08:26:46', '2024-06-23 00:07:38', 10),
(147, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Deduktif', NULL, 'Logika matematika', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika hari ini hujan, maka saya akan membawa payung.\r\nJika saya membawa payung, maka saya tidak akan basah.\r\nKesimpulan yang benar adalah ...', 'Jika saya tidak basah, maka hari ini hujan.', 'Jika hari ini tidak hujan, maka saya tidak akan basah.', 'Jika saya basah, maka hari ini tidak hujan.', 'Jika hari ini hujan, maka saya tidak akan basah.', 'Jika hari ini tidak hujan, maka saya tidak membawa payung.', 'D', 'Premis 1 (P → Q): Jika hari ini hujan (P), maka saya akan membawa payung (Q).\r\nPremis 2 (Q → R): Jika saya membawa payung (Q), maka saya tidak akan basah (R).\r\nKesimpulan (P → R): Oleh karena itu, jika hari ini hujan (P), maka saya tidak akan basah (R).', '2024-06-15 08:28:47', '2024-06-23 00:07:38', 10),
(148, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Operasi hitung bilangan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hitung nilai dari √16 + 3/2 × ( 5 − 2 ).', '10,5', '9,5', '8,5', '7,5', '6,5', 'C', '1. Hitung akar dari 16:\r\n√16 = 4\r\n2. Hitung dalam kurung:\r\n5−2=3\r\n3. Kalikan dengan 3/2 :\r\n3/2 × 3 = 9/2 =4.5\r\n4. Tambahkan hasilnya:\r\n4+4.5=8.5', '2024-06-15 08:43:23', '2024-06-23 00:07:38', 11),
(149, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Operasi hitung bilangan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika 𝑎/2 = 3 dan 𝑏/3 = 4, maka hitunglah nilai dari 𝑎 + 𝑏', '18', '20', '22', '24', '26', 'A', '1. Tentukan nilai 𝑎 dan 𝑏\r\n𝑎 = 2 × 3 = 6\r\n𝑏 = 3 × 4 = 12\r\n2. Tambahkan nilai 𝑎 dan 𝑏\r\n𝑎 + 𝑏 = 6 + 12 = 18', '2024-06-15 08:48:04', '2024-06-23 00:07:38', 11),
(153, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Baris dan deret angka/huruf', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diberikan deret angka sebagai berikut: 3, 9, 27, 81, ...\r\nAngka berikutnya dalam deret tersebut adalah:', '729', '324', '405', '243', '2430', 'D', 'Deret ini mengikuti pola ×3. 3 × 3 = 9, 9 × 3 = 27, 27 × 3 = 81, jadi 81 × 3 = 243.', '2024-06-27 06:34:13', '2024-06-27 06:34:13', NULL),
(154, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Baris dan deret angka/huruf', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diberikan deret angka sebagai berikut: 13, 16, 21, 28, 37, ...\r\nAngka berikutnya dalam deret tersebut adalah:', '48', '49', '50', '51', '52', 'A', 'Deret ini mengikuti pola bertambah dengan bilangan ganjil yang berturut-turut. Tambah 3, tambah 5, tambah 7, tambah 9, tambah 11. 13 + 3 = 16, 16 + 5 = 21, 21 + 7 = 28, 28 + 9 = 37, 37 + 11 = 48.', '2024-06-27 06:36:42', '2024-06-27 06:36:42', NULL),
(155, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Baris dan deret angka/huruf', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diberikan deret huruf sebagai berikut: A, C, F, J, O, ...\r\nHuruf berikutnya dalam deret tersebut adalah:', 'X', 'Y', 'W', 'U', 'V', 'D', 'Deret ini mengikuti pola +1, +2, +3, +4, +5 huruf. A+1=B, B+2=D, D+3=G, G+4=K, K+5=P, P+6=U.', '2024-06-27 06:37:34', '2024-06-27 06:37:34', NULL),
(156, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Baris dan deret angka/huruf', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diberikan deret huruf sebagai berikut: B, E, I, N, ...\r\nHuruf berikutnya dalam deret tersebut adalah:', 'S', 'T', 'U', 'V', 'W', 'B', 'Deret ini mengikuti pola +3,+4,+5,+6. B+3=E, E+4=I, I+5=N, N+6=T.', '2024-06-27 06:39:03', '2024-06-27 06:39:03', NULL),
(157, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Bentuk aljabar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika \r\n3x+5=2x+9, maka nilai dari x adalah:', '1', '2', '3', '4', '5', 'C', '3x+5=2x+9\r\n3x−2x=9−5\r\nx=4', '2024-06-27 06:43:07', '2024-06-27 06:43:07', NULL),
(158, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Bentuk aljabar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika x²+4x−5=0, maka nilai dari x adalah:', '-5 atau 1', '-1 atau 5', '-4 atau 5', '-5 atau 4', '-4 atau -1', 'A', 'x²+4x−5=0\r\n(x+5)(x−1)=0\r\nx=−5 atau x=1', '2024-06-27 06:46:06', '2024-06-27 06:46:06', NULL),
(159, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Bentuk aljabar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika (2x−3)(x+4)=0, maka nilai dari x adalah:', '3 atau -4', '-3 atau 4', '3 atau 4', '-3 atau -4', '2 atau -3', 'A', '(2x−3)(x+4)=0\r\n2x−3=0 atau x+4=0\r\nx=2/3 atau x=−4', '2024-06-27 06:48:23', '2024-06-27 06:48:23', NULL),
(160, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Bentuk aljabar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika 2a+3b=12 dan a−b=1, maka nilai dari a dan b berturut-turut adalah:', '3 dan 2', '4 dan 2', '5 dan 3', '6 dan 4', '7 dan 5', 'B', 'Dari a−b=1, kita dapatkan a=b+1.\r\nSubstitusi ke 2a+3b=12:\r\n2(b+1)+3b=12\r\n2b+2+3b=12\r\n5b+2=12\r\n5b=10\r\nb=2\r\na=b+1=3', '2024-06-27 06:51:12', '2024-06-27 06:51:12', NULL),
(161, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Bentuk aljabar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jika x²−y²=25 dan x−y=5, maka nilai dari x+y adalah:', '1', '2', '3', '4', '5', 'E', 'Diketahui x−y=5.\r\nDengan substitusi (x−y)(x+y)=25 menjadi:\r\n5(x+y)=25\r\nx+y=5', '2024-06-27 06:53:11', '2024-06-27 06:53:11', NULL),
(162, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Analisis data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'menunjukkan jumlah penjualan (dalam ribuan unit) dari lima produk (A, B, C, D, E) dalam tiga tahun terakhir. Produk A terjual sebanyak 15 ribu unit pada tahun 2021, 20 ribu unit pada tahun 2022, dan 25 ribu unit pada tahun 2023. Produk B terjual sebanyak 10 ribu unit pada tahun 2021, 15 ribu unit pada tahun 2022, dan 20 ribu unit pada tahun 2023. Produk C terjual sebanyak 5 ribu unit pada tahun 2021, 10 ribu unit pada tahun 2022, dan 15 ribu unit pada tahun 2023. Produk D terjual sebanyak 20 ribu unit pada tahun 2021, 25 ribu unit pada tahun 2022, dan 30 ribu unit pada tahun 2023. Produk E terjual sebanyak 25 ribu unit pada tahun 2021, 30 ribu unit pada tahun 2022, dan 35 ribu unit pada tahun 2023. Berapakah persentase peningkatan penjualan produk B dari tahun 2021 ke tahun 2023?', '50%', '75%', '100%', '125%', '150%', 'C', 'Peningkatan dari 10 ribu unit ke 20 ribu unit adalah 100%.', '2024-06-27 06:58:02', '2024-06-27 06:58:02', NULL),
(163, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Analisis data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Rata-rata nilai ujian dari 15 siswa dalam suatu kelas adalah 70. Jika dua siswa dengan nilai terendah masing-masing memperoleh nilai 50, berapakah rata-rata nilai dari 13 siswa lainnya?', '72', '73', '74', '75', '76', 'D', 'Total nilai untuk 15 siswa adalah 70 × 15 = 1050. Setelah mengurangi dua siswa dengan nilai 50, total nilai untuk 13 siswa adalah 1050 - 2 × 50 = 950. Rata-rata nilai untuk 13 siswa adalah 950 / 13 ≈ 73.1.', '2024-06-27 06:58:50', '2024-06-27 06:58:50', NULL),
(164, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Analisis data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sebuah survei menunjukkan hasil penjualan mingguan (dalam ribuan unit) untuk tiga produk (P, Q, R) sebagai berikut: Minggu pertama, produk P terjual sebanyak 8 ribu unit, produk Q sebanyak 10 ribu unit, dan produk R sebanyak 12 ribu unit. Minggu kedua, produk P terjual sebanyak 6 ribu unit, produk Q sebanyak 14 ribu unit, dan produk R sebanyak 18 ribu unit. Minggu ketiga, produk P terjual sebanyak 12 ribu unit, produk Q sebanyak 16 ribu unit, dan produk R sebanyak 20 ribu unit. Minggu keempat, produk P terjual sebanyak 10 ribu unit, produk Q sebanyak 12 ribu unit, dan produk R sebanyak 16 ribu unit. Berapakah total penjualan produk Q selama empat minggu tersebut?', '42 ribu unit', '44 ribu unit', '46 ribu unit', '48 ribu unit', '50 ribu unit', 'D', 'Total penjualan produk Q adalah 10 + 14 + 16 + 12 = 52 ribu unit.', '2024-06-27 06:59:41', '2024-06-27 06:59:41', NULL),
(165, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Analisis data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Seorang peneliti mengumpulkan data jumlah hari hujan dalam sebulan selama enam bulan pertama di sebuah kota sebagai berikut: Januari 10 hari, Februari 12 hari, Maret 8 hari, April 15 hari, Mei 20 hari, dan Juni 25 hari. Berapakah rata-rata jumlah hari hujan per bulan selama periode tersebut?', '12 hari', '15 hari', '16.7 hari', '18.3 hari', '20 hari', 'C', 'Rata-rata jumlah hari hujan adalah (10 + 12 + 8 + 15 + 20 + 25) / 6 = 16.7 hari.', '2024-06-27 07:00:28', '2024-06-27 07:00:28', NULL),
(166, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Analisis data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Data berikut menunjukkan nilai ujian matematika dari 10 siswa: Siswa A memperoleh nilai 70, Siswa B memperoleh nilai 85, Siswa C memperoleh nilai 90, Siswa D memperoleh nilai 60, Siswa E memperoleh nilai 75, Siswa F memperoleh nilai 80, Siswa G memperoleh nilai 95, Siswa H memperoleh nilai 65, Siswa I memperoleh nilai 70, dan Siswa J memperoleh nilai 80. Berapakah standar deviasi dari nilai ujian matematika tersebut?', '9.2', '10.3', '11.4', '12.5', '13.6', 'B', 'Hitung standar deviasi dari data nilai ujian.', '2024-06-27 07:01:29', '2024-06-27 07:01:29', NULL),
(167, 'Tes Potensi Skolastik', 'Kemampuan Penalaran Umum', 'Penalaran Kuantitatif', NULL, NULL, 'Analisis data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diagram lingkaran berikut menunjukkan persentase distribusi pengeluaran bulanan sebuah keluarga dalam berbagai kategori. Pengeluaran untuk Pangan adalah 30%, Pendidikan 25%, Transportasi 20%, Hiburan 15%, dan Lain-lain 10%. Jika total pengeluaran bulanan keluarga tersebut adalah Rp10.000.000, berapakah jumlah pengeluaran untuk kategori Pendidikan dan Transportasi?', 'Rp2.000.000', 'Rp2.500.000', 'Rp3.000.000', 'Rp4.500.000', 'Rp5.000.000', 'D', 'Pengeluaran untuk Pendidikan dan Transportasi adalah (25% + 20%) × Rp10.000.000 = Rp4.500.000.', '2024-06-27 07:02:11', '2024-06-27 07:02:11', NULL),
(168, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, '\"Pada abad ke-21, teknologi telah mengubah cara kita hidup dan bekerja secara drastis. Dengan munculnya internet, komunikasi menjadi lebih cepat dan efisien. Selain itu, teknologi juga memungkinkan kita untuk bekerja dari mana saja dan kapan saja, yang tidak pernah terpikirkan sebelumnya. Namun, kemajuan ini juga membawa tantangan baru, seperti keamanan data dan privasi.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Perkembangan teknologi di abad ke-21.', 'Keuntungan dari internet.', 'Tantangan dalam keamanan data dan privasi.', 'Cara bekerja yang berubah.', 'Pengaruh teknologi terhadap komunikasi.', 'A', 'Teks tersebut membahas bagaimana teknologi telah mengubah cara kita hidup dan bekerja.', '2024-06-27 07:08:57', '2024-06-27 07:08:57', NULL),
(169, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Olahraga adalah kegiatan fisik yang sangat penting untuk menjaga kesehatan tubuh. Melalui olahraga, tubuh dapat membakar kalori yang berlebihan dan meningkatkan kebugaran fisik. Selain itu, olahraga juga bermanfaat untuk kesehatan mental, seperti mengurangi stres dan meningkatkan suasana hati.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Manfaat olahraga bagi kesehatan tubuh', 'Cara olahraga membakar kalori.', 'Pentingnya kebugaran fisik.', 'Olahraga untuk kesehatan mental.', 'Pengurangan stres melalui olahraga.', 'A', 'Teks tersebut menyoroti pentingnya olahraga untuk kesehatan fisik dan mental.', '2024-06-27 07:11:54', '2024-06-27 07:11:54', NULL),
(170, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Perubahan iklim adalah fenomena global yang berdampak luas pada berbagai aspek kehidupan. Peningkatan suhu rata-rata bumi menyebabkan mencairnya es di kutub, yang pada gilirannya menyebabkan naiknya permukaan air laut. Selain itu, perubahan iklim juga menyebabkan perubahan pola cuaca yang ekstrem, seperti badai yang lebih kuat dan kekeringan yang berkepanjangan.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Dampak mencairnya es di kutub.', 'Perubahan pola cuaca yang ekstrem.', 'Fenomena perubahan iklim dan dampaknya.', 'Naiknya permukaan air laut.', 'Peningkatan suhu rata-rata bumi.', 'C', 'Teks tersebut membahas dampak dari perubahan iklim global.', '2024-06-27 07:12:59', '2024-06-27 07:12:59', NULL),
(171, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Pendidikan merupakan kunci untuk membuka pintu kesuksesan di masa depan. Melalui pendidikan, seseorang dapat memperoleh pengetahuan dan keterampilan yang dibutuhkan untuk bersaing di dunia kerja. Selain itu, pendidikan juga berperan dalam membentuk karakter dan moral individu.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Pentingnya pengetahuan dan keterampilan di dunia kerja.', 'Peran pendidikan dalam membentuk karakter.', 'Pendidikan sebagai kunci kesuksesan.', 'Keterampilan yang dibutuhkan di dunia kerja.', 'Membentuk moral individu melalui pendidikan.', 'C', 'Teks tersebut menekankan peran penting pendidikan dalam mencapai kesuksesan.', '2024-06-27 07:13:48', '2024-06-27 07:13:48', NULL),
(172, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Teknologi energi terbarukan, seperti tenaga surya dan angin, menjadi semakin penting dalam upaya mengurangi ketergantungan pada bahan bakar fosil. Energi terbarukan tidak hanya ramah lingkungan tetapi juga dapat diperbarui, sehingga dapat menjadi solusi jangka panjang untuk memenuhi kebutuhan energi global.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Pentingnya tenaga surya dan angin.', 'Upaya mengurangi ketergantungan pada bahan bakar fosil.', 'Keuntungan energi terbarukan.', 'Solusi jangka panjang untuk kebutuhan energi.', 'Teknologi energi terbarukan dan manfaatnya.', 'E', 'Teks tersebut menyoroti pentingnya energi terbarukan dan manfaatnya.', '2024-06-27 07:14:43', '2024-06-27 07:14:43', NULL),
(173, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Kesehatan mental adalah aspek penting dari kesehatan keseluruhan seseorang. Masalah kesehatan mental, seperti depresi dan kecemasan, dapat mempengaruhi kemampuan seseorang untuk berfungsi secara normal dalam kehidupan sehari-hari. Oleh karena itu, penting untuk memberikan perhatian yang sama pada kesehatan mental seperti pada kesehatan fisik.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Pengaruh depresi dan kecemasan pada kehidupan sehari-hari.', 'Pentingnya kesehatan mental dalam kehidupan.', 'Perhatian terhadap kesehatan fisik dan mental.', 'Masalah kesehatan mental yang umum.', 'Kesehatan keseluruhan seseorang.', 'B', 'Teks tersebut menyoroti pentingnya memberikan perhatian pada kesehatan mental.', '2024-06-27 07:15:43', '2024-06-27 07:15:43', NULL),
(174, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Seiring dengan perkembangan teknologi, metode pendidikan juga mengalami perubahan. Pembelajaran daring telah menjadi alternatif yang populer, memungkinkan siswa untuk belajar dari mana saja. Meskipun demikian, pembelajaran tatap muka tetap memiliki kelebihan, terutama dalam hal interaksi sosial dan bimbingan langsung dari guru.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Kelebihan pembelajaran tatap muka.', 'Perubahan metode pendidikan.', 'Popularitas pembelajaran daring.', 'Interaksi sosial dalam pembelajaran.', 'Bimbingan langsung dari guru.', 'B', 'Teks tersebut membahas bagaimana teknologi mengubah metode pendidikan.', '2024-06-27 07:16:40', '2024-06-27 07:16:40', NULL),
(175, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Pengelolaan sampah yang efektif sangat penting untuk menjaga kebersihan lingkungan. Dengan memilah sampah organik dan non-organik, kita dapat mengurangi jumlah sampah yang dibuang ke tempat pembuangan akhir. Selain itu, daur ulang sampah juga merupakan langkah penting untuk mengurangi dampak lingkungan.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Manfaat daur ulang sampah.', 'Pengurangan sampah di tempat pembuangan akhir.', 'Pengelolaan sampah yang efektif.', 'Pentingnya memilah sampah organik dan non-organik.', 'Menjaga kebersihan lingkungan.', 'C', 'Teks tersebut menekankan pentingnya pengelolaan sampah yang baik untuk menjaga lingkungan.', '2024-06-27 07:17:34', '2024-06-27 07:17:34', NULL),
(176, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Penggunaan media sosial telah mengubah cara kita berinteraksi dan berbagi informasi. Media sosial memungkinkan kita untuk terhubung dengan orang-orang dari seluruh dunia dan membagikan momen-momen penting dalam hidup kita. Namun, penggunaan media sosial juga membawa tantangan, seperti penyebaran informasi yang salah dan masalah privasi.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Penyebaran informasi yang salah di media sosial.', 'Cara berinteraksi melalui media sosial.', 'Tantangan penggunaan media sosial.', 'Pengaruh media sosial terhadap interaksi sosial.', 'Manfaat dan tantangan media sosial.', 'E', 'Teks tersebut membahas manfaat dan tantangan penggunaan media sosial.', '2024-06-27 07:18:30', '2024-06-27 07:18:30', NULL),
(177, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Mengerti Ide atau Gagasan Utama dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Perubahan gaya hidup sehat menjadi tren yang semakin populer di masyarakat. Banyak orang mulai memperhatikan pola makan mereka, berolahraga secara teratur, dan mengurangi kebiasaan buruk seperti merokok dan minum alkohol. Gaya hidup sehat tidak hanya meningkatkan kualitas hidup tetapi juga mencegah berbagai penyakit.\"\r\n\r\nApakah ide utama dari teks di atas?', 'Peningkatan kualitas hidup melalui gaya hidup sehat.', 'Tren gaya hidup sehat di masyarakat.', 'Pentingnya pola makan yang sehat.', 'Mengurangi kebiasaan buruk seperti merokok.', 'Mencegah penyakit melalui gaya hidup sehat.', 'B', 'Teks tersebut menyoroti tren gaya hidup sehat dan manfaatnya.', '2024-06-27 07:19:19', '2024-06-27 07:19:19', NULL),
(178, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Proyek pembangunan jembatan baru di kota ini dimulai pada bulan Januari 2021 dan diharapkan selesai dalam waktu dua tahun. Jembatan ini memiliki panjang 1,5 kilometer dan lebar 20 meter. Proyek ini melibatkan sekitar 500 pekerja dan menggunakan bahan-bahan seperti beton bertulang dan baja. Anggaran yang disediakan untuk proyek ini adalah sebesar 200 miliar rupiah.\"\r\n\r\nBerdasarkan teks di atas, berapa lebar jembatan yang sedang dibangun?', '1,5 kilometer', '20 meter', '500 pekerja', '200 miliar rupiah', '2 tahun', 'B', 'Teks tersebut menyebutkan bahwa jembatan memiliki lebar 20 meter.', '2024-06-27 07:24:28', '2024-06-27 07:24:28', NULL),
(179, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Konser amal yang diadakan di stadion utama kota pada tanggal 10 Juni 2023 berhasil mengumpulkan dana sebesar 5 miliar rupiah. Dana tersebut akan disalurkan untuk membangun sekolah-sekolah di daerah terpencil. Konser ini dimeriahkan oleh sejumlah artis terkenal dan dihadiri oleh lebih dari 50 ribu penonton.\"\r\n\r\nBerdasarkan teks di atas, berapa jumlah dana yang berhasil dikumpulkan dalam konser amal?', '10 Juni 2023', '5 miliar rupiah', 'Sekolah di daerah terpencil', '50 ribu penonton', 'Sejumlah artis terkenal', 'B', 'Teks tersebut menyatakan bahwa konser amal berhasil mengumpulkan dana sebesar 5 miliar rupiah.', '2024-06-27 07:25:26', '2024-06-27 07:25:26', NULL),
(180, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Perusahaan teknologi X merilis produk terbarunya, yaitu smartphone Z, pada bulan Mei 2023. Smartphone ini dilengkapi dengan kamera 108 megapiksel, baterai berkapasitas 5000 mAh, dan prosesor terbaru. Harga yang ditawarkan untuk smartphone ini adalah 10 juta rupiah.\"\r\n\r\nBerdasarkan teks di atas, kapan perusahaan teknologi X merilis smartphone Z?', 'Kamera 108 megapiksel', 'Baterai 5000 mAh', 'Prosesor terbaru', '10 juta rupiah', 'Mei 2023', 'E', 'Teks tersebut menyatakan bahwa perusahaan teknologi X merilis smartphone Z pada bulan Mei 2023.', '2024-06-27 07:26:09', '2024-06-27 07:26:09', NULL),
(181, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Universitas Y mengadakan seminar internasional tentang perubahan iklim pada tanggal 15 Agustus 2023. Seminar ini dihadiri oleh para ilmuwan dari berbagai negara dan membahas topik-topik seperti efek rumah kaca, pengurangan emisi karbon, dan strategi adaptasi terhadap perubahan iklim.\"\r\n\r\nBerdasarkan teks di atas, kapan seminar internasional tentang perubahan iklim diadakan?', '15 Agustus 2023', 'Para ilmuwan dari berbagai negara', 'Efek rumah kaca', 'Pengurangan emisi karbon', 'Strategi adaptasi', 'A', 'Teks tersebut menyebutkan bahwa seminar internasional diadakan pada tanggal 15 Agustus 2023.', '2024-06-27 07:26:57', '2024-06-27 07:26:57', NULL),
(182, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Toko buku A memberikan diskon sebesar 20% untuk semua buku pada bulan September 2023. Diskon ini berlaku untuk semua jenis buku, termasuk buku fiksi, non-fiksi, dan buku anak-anak. Toko ini juga mengadakan acara bedah buku setiap akhir pekan selama bulan tersebut.\"\r\n\r\nBerdasarkan teks di atas, berapa persen diskon yang diberikan toko buku A untuk semua buku?', 'September 2023', '20%', 'Buku fiksi, non-fiksi, dan anak-anak', 'Acara bedah buku', 'Setiap akhir pekan', 'B', 'Teks tersebut menyatakan bahwa toko buku A memberikan diskon sebesar 20% untuk semua buku.', '2024-06-27 07:27:51', '2024-06-27 07:27:51', NULL),
(183, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Pada tanggal 1 Juli 2023, pemerintah meluncurkan program vaksinasi gratis untuk semua warga negara. Program ini bertujuan untuk meningkatkan kekebalan tubuh masyarakat terhadap penyakit menular. Vaksinasi dilakukan di berbagai fasilitas kesehatan, termasuk rumah sakit, puskesmas, dan klinik.\"\r\n\r\nBerdasarkan teks di atas, kapan pemerintah meluncurkan program vaksinasi gratis?', 'Meningkatkan kekebalan tubuh', 'Penyakit menular', 'Rumah sakit, puskesmas, dan klinik', '1 Juli 2023', 'Program vaksinasi gratis', 'D', 'Teks tersebut menyatakan bahwa program vaksinasi gratis diluncurkan pada tanggal 1 Juli 2023.', '2024-06-27 07:28:42', '2024-06-27 07:28:42', NULL),
(184, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi yang Bersifat Detail atau Rincian dalam Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Pameran seni rupa yang diadakan di galeri seni Z menampilkan karya-karya dari 50 seniman lokal. Pameran ini berlangsung selama satu bulan, mulai dari tanggal 1 hingga 31 Oktober 2023. Karya-karya yang dipamerkan meliputi lukisan, patung, dan instalasi seni.\"\r\n\r\nBerdasarkan teks di atas, berapa banyak seniman lokal yang karyanya dipamerkan di galeri seni Z?', 'Lukisan, patung, dan instalasi seni', '1 hingga 31 Oktober 2023', '50 seniman lokal', 'Satu bulan', 'Karya seni rupa', 'C', 'Teks tersebut menyebutkan bahwa karya-karya dari 50 seniman lokal dipamerkan di galeri seni Z.', '2024-06-27 07:29:28', '2024-06-27 07:29:28', NULL),
(185, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi Tersirat dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Selama bertahun-tahun, kota ini dikenal karena tingkat kriminalitasnya yang tinggi. Namun, setelah peluncuran program keamanan baru oleh pemerintah kota, tingkat kriminalitas menurun drastis dalam beberapa bulan terakhir.\"\r\n\r\nApakah yang tersirat dari teks di atas?', 'Tingkat kriminalitas sebelumnya tidak terkendali.', 'Program keamanan baru sangat efektif.', 'Pemerintah kota tidak peduli dengan keamanan sebelumnya.', 'Warga kota tidak lagi merasa aman.', 'Kriminalitas tidak menjadi masalah lagi.', 'B', 'Teks tersebut menyiratkan bahwa program keamanan baru berhasil menurunkan tingkat kriminalitas.', '2024-06-27 07:32:56', '2024-06-27 07:32:56', NULL),
(186, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi Tersirat dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Semakin banyak orang yang beralih ke energi terbarukan untuk kebutuhan rumah tangga mereka. Ini bukan hanya tentang menghemat biaya energi, tetapi juga tentang menjaga lingkungan.\"\r\n\r\nApa yang tersirat dari teks di atas?', 'Energi terbarukan lebih murah daripada energi konvensional.', 'Orang-orang semakin sadar akan lingkungan.', 'Energi terbarukan sulit diakses.', 'Energi konvensional lebih populer.', 'Biaya energi tidak penting bagi sebagian orang.', 'B', 'Teks tersebut menyiratkan bahwa orang-orang beralih ke energi terbarukan bukan hanya untuk menghemat biaya, tetapi juga untuk menjaga lingkungan.', '2024-06-27 07:33:56', '2024-06-27 07:33:56', NULL),
(187, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi Tersirat dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Meskipun memiliki jadwal yang sangat padat, dia selalu menyempatkan diri untuk berolahraga setiap pagi sebelum bekerja.\"\r\n\r\nApa yang tersirat dari teks di atas?', 'Dia sangat peduli dengan kesehatannya.', 'Dia tidak menyukai pekerjaannya.', 'Jadwalnya kurang produktif.', 'Dia tidak suka bangun pagi.', 'Olahraga tidak penting baginya.', 'A', 'Teks tersebut menyiratkan bahwa dia selalu menyempatkan diri untuk berolahraga meskipun jadwalnya padat.', '2024-06-27 07:34:53', '2024-06-27 07:34:53', NULL),
(188, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Informasi Tersirat dari Sebuah Teks', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah teks berikut ini dengan saksama.\r\n\r\n\"Setelah bertahun-tahun bekerja di perusahaan yang sama, dia memutuskan untuk mengambil risiko dan memulai bisnisnya sendiri.\"\r\n\r\nApa yang tersirat dari teks di atas?', 'Dia merasa tidak puas dengan pekerjaannya sebelumnya.', 'Bisnisnya sekarang lebih sukses daripada pekerjaannya sebelumnya.', 'Dia tidak suka mengambil risiko.', 'Perusahaan tempat dia bekerja sebelumnya bangkrut.', 'Dia tidak punya pilihan lain selain memulai bisnis sendiri.', 'A', 'Teks tersebut menyiratkan bahwa dia mengambil risiko memulai bisnis sendiri setelah bertahun-tahun bekerja di perusahaan yang sama, menunjukkan kemungkinan ketidakpuasan.', '2024-06-27 07:35:39', '2024-06-27 07:35:39', NULL),
(189, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Arti Sebuah Kata', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut ini dengan saksama.\r\n\r\n\"Para peneliti menemukan bahwa beberapa spesies tumbuhan memiliki kemampuan allelopati yang memungkinkan mereka untuk mempengaruhi pertumbuhan tanaman lain di sekitarnya.\"\r\n\r\nApa arti kata allelopati dalam kalimat di atas?', 'Kemampuan untuk tumbuh di berbagai lingkungan', 'Kemampuan untuk mempengaruhi pertumbuhan tanaman lain', 'Kemampuan untuk menghasilkan buah yang banyak', 'Kemampuan untuk bertahan dalam kondisi ekstrem', 'Kemampuan untuk menarik serangga penyerbuk', 'B', 'Kata \"allelopati\" merujuk pada kemampuan beberapa tumbuhan untuk mempengaruhi pertumbuhan tanaman lain di sekitarnya melalui zat kimia yang mereka keluarkan.', '2024-06-27 07:37:54', '2024-06-27 07:37:54', NULL),
(190, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Arti Sebuah Kata', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut ini dengan saksama.\r\n\r\n\"Pada masa itu, masyarakat hidup dalam kondisi autarki, di mana mereka tidak bergantung pada sumber daya dari luar negeri.\"\r\n\r\nApa arti kata autarki dalam kalimat di atas?', 'Ketergantungan pada perdagangan luar negeri', 'Kemandirian ekonomi', 'Ketergantungan pada bantuan internasional', 'Ketergantungan pada impor barang', 'Ketergantungan pada investasi asing', 'B', 'Kata \"autarki\" berarti kondisi di mana suatu negara atau masyarakat tidak bergantung pada sumber daya dari luar negeri dan bersifat mandiri dalam hal ekonomi.', '2024-06-27 07:38:42', '2024-06-27 07:38:42', NULL),
(191, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Arti Sebuah Kata', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut ini dengan saksama.\r\n\r\n\"Perusahaan tersebut berhasil merestrukturisasi organisasi mereka sehingga lebih efisien dan responsif terhadap perubahan pasar.\"\r\n\r\nApa arti kata merestrukturisasi dalam kalimat di atas?', 'Memperluas jaringan pasar', 'Meningkatkan kualitas produk', 'Mengubah struktur organisasi', 'Mengurangi jumlah karyawan', 'Meningkatkan penjualan', 'C', 'Kata \"merestrukturisasi\" berarti mengubah struktur organisasi agar lebih efisien dan responsif terhadap perubahan.', '2024-06-27 07:39:36', '2024-06-27 07:39:36', NULL),
(192, 'Tes Potensi Skolastik', 'Pengetahuan dan Pemahaman Umum', NULL, NULL, NULL, NULL, 'Memahami Arti Sebuah Kata', NULL, NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut ini dengan saksama.\r\n\r\n\"Kondisi ekonomi yang fluktuatif membuat banyak investor ragu untuk menanamkan modal mereka.\"\r\n\r\nApa arti kata fluktuatif dalam kalimat di atas?', 'Stabil dan dapat diprediksi', 'Tidak menentu dan berubah-ubah', 'Terus meningkat', 'Terus menurun', 'Sangat menguntungkan', 'B', 'Kata \"fluktuatif\" berarti kondisi yang tidak menentu dan berubah-ubah, menggambarkan ketidakstabilan ekonomi yang membuat investor ragu.', '2024-06-27 07:40:21', '2024-06-27 07:40:21', NULL),
(193, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ide Pokok dan Gagasan Utama', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Pada abad ke-19, revolusi industri mengubah wajah Eropa dengan membawa perubahan drastis dalam produksi, transportasi, dan kehidupan kota. Meskipun membawa kemajuan ekonomi yang signifikan, revolusi industri juga menghadirkan tantangan baru dalam hal kondisi kerja yang buruk dan ketimpangan sosial yang semakin membesar.\"\r\n\r\nApa ide pokok atau gagasan utama dari paragraf tersebut?', 'Revolusi industri mengubah wajah Eropa.', 'Revolusi industri membawa kemajuan ekonomi.', 'Revolusi industri meningkatkan kondisi kerja.', 'Revolusi industri menyebabkan ketimpangan sosial.', 'Revolusi industri hanya membawa dampak negatif.', 'A', 'Paragraf tersebut menggambarkan perubahan yang terjadi akibat revolusi industri di Eropa.', '2024-06-27 07:42:28', '2024-06-27 07:42:28', NULL);
INSERT INTO `soal_tryout` (`id`, `question_type`, `tps_type`, `penalaran_type`, `penalaran_induktif_detail`, `penalaran_deduktif_detail`, `penalaran_kuantitatif_detail`, `pemahaman_pemahaman_type`, `pemahaman_type`, `kuantitatif_type`, `tl_type`, `tl_indonesia_type`, `tl_matematika_type`, `tl_inggris_type`, `question`, `option_a`, `option_b`, `option_c`, `option_d`, `option_e`, `correct_answer`, `answer_explanation`, `created_at`, `updated_at`, `materi_id`) VALUES
(194, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ide Pokok dan Gagasan Utama', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Perubahan iklim telah menjadi perhatian global dalam beberapa dekade terakhir. Fenomena ini tidak hanya menyebabkan kenaikan suhu global tetapi juga mengakibatkan perubahan drastis pada pola cuaca di seluruh dunia. Negara-negara dan organisasi internasional terus mencari solusi untuk mengatasi dampak perubahan iklim ini.\"\r\n\r\nApa ide pokok atau gagasan utama dari paragraf tersebut?', 'Perubahan iklim menyebabkan kenaikan suhu global.', 'Perubahan iklim mempengaruhi pola cuaca.', 'Perubahan iklim menjadi perhatian global.', 'Solusi untuk mengatasi perubahan iklim belum ditemukan.', 'Perubahan iklim hanya mempengaruhi negara-negara tertentu.', 'C', 'Paragraf tersebut menekankan bahwa perubahan iklim telah menjadi fokus perhatian global.', '2024-06-27 07:43:23', '2024-06-27 07:43:23', NULL),
(195, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ide Pokok dan Gagasan Utama', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Sejarah kuno Mesir terkenal dengan kemajuan besar dalam bidang arsitektur, seni, dan ilmu pengetahuan. Peradaban Mesir kuno menciptakan piramida megah dan struktur monumen yang masih menjadi keajaiban dunia hingga saat ini. Sistem penulisan hieroglif mereka juga merupakan salah satu prestasi yang menakjubkan dari peradaban ini.\"\r\n\r\nApa ide pokok atau gagasan utama dari paragraf tersebut?', 'Sejarah kuno Mesir terkenal dengan piramida megah.', 'Peradaban Mesir menciptakan sistem penulisan hieroglif.', 'Arsitektur dan seni adalah kemajuan besar peradaban Mesir.', 'Mesir kuno memiliki struktur monumen yang indah.', 'Mesir kuno tidak memiliki prestasi dalam ilmu pengetahuan.', 'C', 'Paragraf tersebut menyoroti kemajuan besar dalam bidang arsitektur dan seni di Mesir kuno.', '2024-06-27 07:44:10', '2024-06-27 07:44:10', NULL),
(196, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ide Pokok dan Gagasan Utama', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Dalam era globalisasi ini, budaya menjadi alat penting dalam memahami identitas masyarakat. Budaya tidak hanya mencakup seni, musik, dan tradisi lokal, tetapi juga nilai-nilai yang dipegang oleh suatu komunitas. Pemahaman terhadap budaya membantu mempromosikan toleransi dan kerjasama antarbudaya di seluruh dunia.\"\r\n\r\nApa ide pokok atau gagasan utama dari paragraf tersebut?', 'Budaya mencakup seni, musik, dan tradisi lokal.', 'Era globalisasi memperkuat identitas budaya.', 'Pemahaman terhadap budaya mempromosikan toleransi.', 'Budaya tidak penting dalam era globalisasi.', 'Identitas masyarakat tidak terkait dengan budaya.', 'C', 'Paragraf tersebut menguraikan pentingnya pemahaman terhadap budaya dalam mempromosikan toleransi dan kerjasama antarbudaya.', '2024-06-27 07:45:08', '2024-06-27 07:45:08', NULL),
(197, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Kepaduan Wacana dan Kalimat Efektif', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Meskipun studi menunjukkan bahwa olahraga dapat meningkatkan kesehatan fisik, tidak semua orang memiliki waktu yang cukup untuk berolahraga secara teratur. Oleh karena itu, penting bagi individu untuk menemukan aktivitas fisik lain yang dapat mereka lakukan dalam rutinitas harian mereka.\"\r\n\r\nKalimat manakah yang paling baik menggambarkan kepaduan wacana dan ide yang terdapat dalam paragraf tersebut?', '\"Studi membuktikan manfaat kesehatan dari olahraga, tetapi banyak orang tidak punya waktu untuk melakukannya.\"', '\"Olahraga adalah penting untuk kesehatan, tetapi tidak semua orang memiliki waktu yang cukup untuk melakukannya secara teratur.\"', '\"Studi menunjukkan manfaat olahraga bagi kesehatan, tetapi waktu seringkali menjadi hambatan bagi banyak orang.\"', '\"Meskipun olahraga bermanfaat bagi kesehatan, tidak semua orang dapat meluangkan waktu untuk berolahraga.\"', '\"Olahraga memberikan manfaat kesehatan, tetapi harus dilakukan secara teratur.\"', 'D', 'Kalimat tersebut menggambarkan inti dari paragraf yang membahas manfaat olahraga dan kendala yang dihadapi oleh banyak orang.', '2024-06-27 07:47:57', '2024-06-27 07:47:57', NULL),
(199, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Kepaduan Wacana dan Kalimat Efektif', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Penelitian baru-baru ini menyoroti pentingnya keberagaman dalam tempat kerja. Menurut peneliti, tim yang terdiri dari berbagai latar belakang budaya dan pendidikan cenderung lebih inovatif dan dapat menemukan solusi yang lebih kreatif untuk masalah yang kompleks.\"\r\n\r\nApa kalimat terbaik yang dapat menambahkan informasi yang relevan dan menjaga kepaduan wacana dalam paragraf di atas?', '\"Hal ini membuktikan bahwa keberagaman tidak hanya penting secara moral, tetapi juga untuk produktivitas.\"', '\"Fakta ini menunjukkan bahwa perusahaan harus lebih memperhatikan keberagaman dalam rekrutmen karyawan.\"', '\"Keterlibatan berbagai perspektif dalam tim dapat meningkatkan kemampuan mereka untuk beradaptasi dengan pasar global.\"', '\"Keberagaman dalam tim dapat menciptakan lingkungan kerja yang lebih inklusif dan mendukung.\"', '\"Pentingnya keberagaman di tempat kerja tidak boleh diabaikan.\"', 'C', 'Kalimat ini melanjutkan pembahasan keberagaman dalam tim dengan menekankan manfaatnya dalam adaptasi terhadap pasar global.', '2024-06-27 07:50:19', '2024-06-27 07:50:19', NULL),
(200, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Kepaduan Wacana dan Kalimat Efektif', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Pendidikan kewirausahaan dianggap semakin penting di era digital ini. Keterampilan seperti inovasi, manajemen risiko, dan kepemimpinan menjadi kunci untuk sukses dalam membangun dan mengelola bisnis startup yang sukses.\"\r\n\r\nManakah dari pernyataan berikut yang paling sesuai untuk menambahkan informasi yang relevan dan menjaga kepaduan wacana dalam paragraf di atas?', '\"Namun, tidak semua orang memiliki kesempatan untuk mengembangkan keterampilan ini secara mandiri.\"', '\"Ini menunjukkan betapa pentingnya pengajaran kewirausahaan dalam kurikulum pendidikan saat ini.\"', '\"Penting bagi pendidikan untuk menyesuaikan kurikulum agar lebih memasukkan pelajaran kewirausahaan.\"', '\"Keberhasilan startup dapat dipengaruhi oleh kemampuan untuk memahami pasar dan mengelola sumber daya.\"', '\"Pendekatan baru dalam pendidikan diperlukan untuk menghadapi tantangan di era digital ini.\"', 'D', 'Kalimat ini relevan dengan topik kewirausahaan dan menambahkan informasi tentang faktor-faktor yang mempengaruhi keberhasilan startup.', '2024-06-27 07:51:31', '2024-06-27 07:51:31', NULL),
(201, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Makna Kata dan Bentuk Kata', NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut dengan saksama.\r\n\r\n\"Keterampilan interpersonal sangat penting dalam keberhasilan profesional di masa depan.\"\r\n\r\nKata \'interpersonal\' dalam kalimat tersebut memiliki arti yang paling mendekati:', 'Pribadi', 'Antarindividu', 'Intrapsikis', 'Antarkelompok', 'Kolektif', 'B', 'Kata \'interpersonal\' berarti hubungan antarindividu atau hubungan antarpribadi.', '2024-06-27 07:53:18', '2024-06-27 07:53:18', NULL),
(202, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Makna Kata dan Bentuk Kata', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Pemerintah telah meluncurkan program untuk mempromosikan keberlanjutan di lingkungan sekolah. Mereka mendorong siswa untuk menghemat energi dan mengurangi limbah plastik.\"\r\n\r\nKata \'keberlanjutan\' dalam konteks ini paling berkaitan dengan:', 'Kegiatan', 'Peningkatan', 'Kestabilan', 'Keseimbangan', 'Kelangsungan', 'E', '\'Keberlanjutan\' berarti kemampuan untuk bertahan atau keberlangsungan, khususnya dalam konteks lingkungan.', '2024-06-27 07:55:30', '2024-06-27 07:55:30', NULL),
(203, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Makna Kata dan Bentuk Kata', NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut dengan saksama.\r\n\r\n\"Sikapnya yang apatis terhadap masalah sosial sangat mengkhawatirkan.\"\r\n\r\nKata \'apatis\' dalam kalimat tersebut memiliki arti yang paling mendekati:', 'Tidak peduli', 'Tidak setuju', 'Tidak fokus', 'Tidak senang', 'Tidak terbiasa', 'A', '\'Apatis\' berarti tidak peduli atau kurang tertarik terhadap masalah atau peristiwa.', '2024-06-27 07:56:22', '2024-06-27 07:56:22', NULL),
(204, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Simpulan dan Inferensi', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Penelitian terbaru menunjukkan bahwa penggunaan internet secara berlebihan pada remaja dapat berdampak negatif terhadap kesehatan mental mereka. Meskipun internet memberikan akses mudah ke informasi, penggunaan yang tidak terkontrol dapat meningkatkan risiko kecanduan dan gangguan tidur.\"\r\n\r\nApa kesimpulan yang dapat ditarik dari paragraf di atas?', 'Remaja sebaiknya menghindari penggunaan internet sama sekali.', 'Penggunaan internet dapat bermanfaat jika digunakan secara terkontrol.', 'Semua remaja akan mengalami gangguan tidur karena penggunaan internet.', 'Kecanduan internet hanya terjadi pada remaja yang tidak memiliki aktivitas lain.', 'Penelitian tentang dampak internet pada remaja masih belum lengkap.', 'B', 'Kesimpulan yang dapat ditarik adalah bahwa penggunaan internet memiliki potensi manfaat jika dilakukan dengan pengawasan dan kontrol yang baik.', '2024-06-27 07:59:05', '2024-06-27 07:59:05', NULL),
(205, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Simpulan dan Inferensi', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Data statistik menunjukkan bahwa tingkat pengangguran di kota besar mengalami penurunan selama dua tahun terakhir. Ini menunjukkan bahwa kebijakan pemerintah telah berhasil mengurangi angka pengangguran.\"\r\n\r\nApa kesimpulan yang dapat ditarik dari informasi di atas?', 'Pengangguran hanya terjadi di kota besar.', 'Kebijakan pemerintah tidak memiliki dampak signifikan terhadap pengangguran.', 'Tingkat pengangguran hanya berkurang karena migrasi penduduk.', 'Pemerintah seharusnya lebih fokus pada sektor industri untuk mengurangi pengangguran.', 'Kebijakan pemerintah telah berhasil mengurangi tingkat pengangguran di kota besar.', 'E', 'Kesimpulan yang tepat adalah bahwa kebijakan pemerintah telah berhasil mengurangi tingkat pengangguran di kota besar berdasarkan data statistik.', '2024-06-27 08:00:08', '2024-06-27 08:00:08', NULL),
(206, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Simpulan dan Inferensi', NULL, NULL, NULL, NULL, NULL, 'Bacalah paragraf berikut dengan saksama.\r\n\r\n\"Penelitian terbaru menunjukkan bahwa pemanfaatan energi terbarukan telah meningkat pesat di beberapa negara maju. Hal ini menunjukkan bahwa investasi dalam teknologi energi terbarukan dapat menghasilkan keuntungan jangka panjang.\"\r\n\r\nApa kesimpulan yang paling tepat dari informasi di atas?', 'Semua negara maju telah berhasil menggunakan energi terbarukan.', 'Investasi dalam energi terbarukan selalu menghasilkan keuntungan jangka panjang.', 'Pemanfaatan energi terbarukan masih kurang efektif di negara berkembang.', 'Penelitian energi terbarukan tidak memberikan manfaat ekonomi yang signifikan.', 'Energi terbarukan semakin diminati di berbagai sektor industri.', 'E', 'Kesimpulan yang paling sesuai adalah bahwa minat terhadap energi terbarukan semakin meningkat di berbagai sektor industri.', '2024-06-27 08:01:04', '2024-06-27 08:01:04', NULL),
(207, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ejaan dan Konjungsi', NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut dengan saksama.\r\n\r\n\"Siswa diharapkan untuk mengumpulkan laporan akhir pada tanggal 15 Juli.\"\r\n\r\nKata \'harapkan\' dalam kalimat tersebut merupakan contoh dari:', 'Kata benda', 'Kata kerja transitif', 'Kata kerja intransitif', 'Kata sambung', 'Kata depan', 'C', 'Kata \'harapkan\' adalah kata kerja intransitif yang tidak membutuhkan objek langsung.', '2024-06-27 08:02:57', '2024-06-27 08:02:57', NULL),
(208, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ejaan dan Konjungsi', NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut dengan saksama.\r\n\r\n\"Siswa diharapkan untuk berpartisipasi aktif dalam kegiatan ekstrakurikuler.\"\r\n\r\nKata \'aktif\' dalam kalimat tersebut merupakan contoh dari:', 'Kata sandang', 'Kata ganti', 'Kata keterangan', 'Kata sambung', 'Kata depan', 'C', 'Kata \'aktif\' berfungsi sebagai kata keterangan yang menjelaskan cara atau keadaan berpartisipasi dalam kegiatan ekstrakurikuler.', '2024-06-27 08:03:40', '2024-06-27 08:03:40', NULL),
(209, 'Tes Potensi Skolastik', 'Kemampuan Memahami Bacaan dan Menulis', NULL, NULL, NULL, NULL, NULL, 'Ejaan dan Konjungsi', NULL, NULL, NULL, NULL, NULL, 'Bacalah kalimat berikut dengan saksama.\r\n\r\n\"Siswa yang rajin dan tekun dapat mencapai prestasi akademik yang tinggi.\"\r\n\r\nKata \'dan\' dalam kalimat tersebut berfungsi sebagai:', 'Kata sandang', 'Kata ganti', 'Kata sifat', 'Kata sambung', 'Kata depan', 'D', 'Kata \'dan\' berfungsi sebagai kata sambung yang menghubungkan dua kata atau frasa yang setara dalam kalimat.', '2024-06-27 08:04:28', '2024-06-27 08:04:28', NULL),
(210, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Operasi Aritmatika Dasar', NULL, NULL, NULL, NULL, 'Berapakah nilai dari 18−3×(4−1)?', '9', '10', '11', '12', '13', 'A', '18−3×(4−1)=18−3×3=18−9=9.', '2024-06-27 08:07:22', '2024-06-27 08:07:22', NULL),
(211, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Operasi Aritmatika Dasar', NULL, NULL, NULL, NULL, 'Hitunglah nilai dari (12+5)×3−7.', '42', '43', '44', '47', '50', 'C', '(12+5)×3−7=17×3−7=51−7=44.', '2024-06-27 08:08:28', '2024-06-27 08:08:28', NULL),
(212, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Operasi Aritmatika Dasar', NULL, NULL, NULL, NULL, 'Jika 3×(4+2)−5, maka hasilnya adalah:', '11', '13', '15', '17', '19', 'B', '3×(4+2)−5=3×6−5=18−5=13.', '2024-06-27 08:09:35', '2024-06-27 08:09:35', NULL),
(213, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Persentase', NULL, NULL, NULL, NULL, 'Sebuah toko memberikan diskon sebesar 15% untuk semua barang. Jika harga awal sebuah televisi adalah 5 juta, berapa harga televisi setelah diskon?', '4,25 juta', '4,30 juta', '4,35 juta', '4,40 juta', '4,45 juta', 'B', 'Harga televisi setelah diskon adalah 5juta−0.15×5juta=5juta−750,000=4,250,000 atau 4,25 juta.', '2024-06-27 08:13:03', '2024-06-27 08:13:03', NULL),
(214, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Persentase', NULL, NULL, NULL, NULL, 'Dalam sebuah kotak terdapat 120 permen. Jika 25% permen tersebut adalah permen cokelat, berapa jumlah permen cokelat di dalam kotak tersebut?', '20', '25', '30', '35', '40', 'C', 'Jumlah permen cokelat dalam kotak adalah 0.25×120=30 permen.', '2024-06-27 08:13:57', '2024-06-27 08:13:57', NULL),
(215, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Persentase', NULL, NULL, NULL, NULL, 'Seorang atlet berhasil meningkatkan waktu lari maratonnya sebesar 20% dari yang sebelumnya. Jika waktu lari sebelumnya adalah 3 jam, berapa waktu lari atlet tersebut setelah peningkatan?', '3 jam 15 menit', '3 jam 18 menit', '3 jam 21 menit', '3 jam 24 menit', '3 jam 27 menit', 'D', 'Waktu lari setelah peningkatan adalah 3×1.2=3.6 jam, yang setara dengan 3 jam 24 menit.', '2024-06-27 08:14:52', '2024-06-27 08:14:52', NULL),
(216, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Rasio dan Proporsi', NULL, NULL, NULL, NULL, 'Sebuah kelas terdiri dari 30 siswa perempuan dan 50 siswa laki-laki. Berapakah rasio siswa perempuan terhadap total siswa di kelas tersebut?', '2:3', '3:5', '3:7', '5:7', '2:5', 'D', 'Total siswa adalah 30 (perempuan) + 50 (laki-laki) = 80 siswa. Rasio siswa perempuan terhadap total siswa adalah 30/80 = 3/8. Dalam bentuk rasio, ini sama dengan 3:8, yang paling mendekati adalah pilihan D, 5:7.', '2024-06-27 08:18:50', '2024-06-27 08:18:50', NULL),
(217, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Rasio dan Proporsi', NULL, NULL, NULL, NULL, 'Sebuah truk mengangkut 540 kotak buah. Jika perbandingan jumlah kotak apel, jeruk, dan anggur adalah 2:3:4, berapa jumlah kotak jeruk yang diangkut truk tersebut?', '120 kotak', '180 kotak', '200 kotak', '240 kotak', '270 kotak', 'B', 'Jumlah kotak jeruk dalam perbandingan adalah 3/9 ×540=180.', '2024-06-27 08:20:09', '2024-06-27 08:20:09', NULL),
(218, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Rasio dan Proporsi', NULL, NULL, NULL, NULL, 'Dalam sebuah kantor, perbandingan jumlah karyawan tetap dan karyawan kontrak adalah 3:2. Jika terdapat 60 karyawan kontrak, berapa jumlah karyawan tetap di kantor tersebut?', '30', '36', '40', '42', '45', 'C', 'Perbandingan karyawan tetap terhadap karyawan kontrak adalah 3:2. Jika karyawan kontrak adalah 60, maka karyawan tetap adalah 3/2 ×60=90.', '2024-06-27 08:21:16', '2024-06-27 08:21:16', NULL),
(219, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Persamaan dan Ungkapan Aljabar', NULL, NULL, NULL, NULL, 'Jika x+5=12, maka nilai x adalah:', '5', '6', '7', '8', '9', 'B', 'x+5=12, maka x=12−5=7.', '2024-06-27 08:23:50', '2024-06-27 08:23:50', NULL),
(220, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Persamaan dan Ungkapan Aljabar', NULL, NULL, NULL, NULL, 'Sebuah segitiga memiliki dua sisi yang masing-masing x+3 dan 2x−1, serta sisi miring sepanjang 5x. Jika segitiga tersebut merupakan segitiga siku-siku, maka nilai x adalah:', '2', '3', '4', '5', '6', 'B', 'x+3, 2x−1, dan 5x membentuk segitiga siku-siku, sehingga sesuai dengan aturan Pythagoras, (x+3)² +(2x−1)² = (5x)², dan x=3.', '2024-06-27 08:26:15', '2024-06-27 08:26:15', NULL),
(221, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Persamaan dan Ungkapan Aljabar', NULL, NULL, NULL, NULL, 'Diketahui persamaan 4y−7=5, maka nilai dari y adalah:', '3', '4', '5', '6', '7', 'C', '4y−7=5, maka 4y=5+7=12, dan y = 12/4 = 3.', '2024-06-27 08:28:11', '2024-06-27 08:28:11', NULL),
(222, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Geometri Dasar', NULL, NULL, NULL, NULL, 'Sebuah lingkaran memiliki diameter sepanjang 14 cm. Berapakah keliling lingkaran tersebut?', '28 cm', '30 cm', '31.4 cm', '35 cm', '36 cm', 'A', 'Keliling lingkaran 𝐾 = 𝜋 × 𝑑 = 𝜋 × 14 cm ≈ 28 cm.', '2024-06-27 08:31:26', '2024-06-27 08:31:26', NULL),
(223, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Geometri Dasar', NULL, NULL, NULL, NULL, 'Sebuah jajaran genjang memiliki alas sepanjang 12 cm dan tinggi 8 cm. Berapakah luas jajaran genjang tersebut?', '80 cm²', '88 cm²', '96 cm²', '104 cm²', '112 cm²', 'C', 'Luas jajaran genjang L=alas×tinggi=12cm×8cm=96 cm².', '2024-06-27 08:32:47', '2024-06-27 08:32:47', NULL),
(224, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Geometri Dasar', NULL, NULL, NULL, NULL, 'Sebuah trapesium memiliki dua sisi sejajar panjangnya masing-masing 5 cm dan 9 cm. Jika tinggi trapesium adalah 4 cm, berapakah luas trapesium tersebut?', '32 cm²', '36 cm²', '40 cm²', '44 cm²', '48 cm²', 'B', 'Luas trapesium ( L = \\frac{1}{2} \\times (a + b) \\times t = \\frac{1}{2} \\times (5 cm + 9 cm) \\times 4 cm = \\frac{1}{2} \\times 14 cm \\times 4 cm = 28 cm².', '2024-06-27 08:33:58', '2024-06-27 08:33:58', NULL),
(225, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Statistik dan Probabilitas', NULL, NULL, NULL, NULL, 'Diketahui data nilai ujian Matematika siswa: 80, 85, 70, 95, dan 90. Berapakah median dari data ini?', '80', '85', '87', '90', '95', 'B', 'Data diurutkan menjadi 70, 80, 85, 90, 95. Median adalah nilai tengah, yaitu 85.', '2024-06-27 08:35:59', '2024-06-27 08:35:59', NULL),
(226, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Statistik dan Probabilitas', NULL, NULL, NULL, NULL, 'Sebuah kelas terdiri dari 25 siswa. Jika 15 siswa suka olahraga, 10 siswa suka musik, dan 5 siswa suka keduanya, berapa peluangnya memilih seorang siswa secara acak yang suka tepat salah satu dari dua aktivitas tersebut?', '1/2', '2/5', '3/5', '4/5', '5/6', 'D', 'Jumlah siswa yang suka olahraga atau musik adalah 15 + 10 - 5 = 20. Peluang memilih siswa yang suka tepat salah satu dari dua aktivitas tersebut adalah 20/25 = 4/5.', '2024-06-27 08:37:49', '2024-06-27 08:37:49', NULL),
(227, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Statistik dan Probabilitas', NULL, NULL, NULL, NULL, 'Sebuah dadu fair dilemparkan. Berapakah peluang munculnya angka ganjil atau angka genap?', '1/2', '2/3', '3/4', '5/6', '5/12', 'A', 'Peluang munculnya angka ganjil adalah 3/6  = 1/2 dan peluang munculnya angka genap juga 3/6 = 1/2. Total peluangnya adalah 1/2 + 1/2 = 1.', '2024-06-27 08:40:09', '2024-06-27 08:40:09', NULL),
(228, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Grafik dan Diagram', NULL, NULL, NULL, NULL, 'Berikut adalah diagram lingkaran yang menunjukkan hasil survei preferensi hobi siswa di sebuah sekolah. Jika jumlah siswa yang menyukai musik adalah 120, berapakah jumlah siswa yang berpartisipasi dalam survei ini jika total siswa sekolah adalah 600?', '200', '300', '400', '500', '600', 'C', 'Jumlah siswa yang berpartisipasi dalam survei adalah 120/0.2 = 600, maka total siswa adalah 600.', '2024-06-27 08:44:15', '2024-06-27 08:44:15', NULL),
(229, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Grafik dan Diagram', NULL, NULL, NULL, NULL, 'Sebuah grafik batang menunjukkan jumlah buku yang dibaca oleh sekelompok siswa dalam satu semester. Jika tinggi batang yang menunjukkan buku A adalah 60 cm, buku B adalah 45 cm, dan buku C adalah 30 cm, berapa total jumlah buku yang dibaca oleh siswa-siswa ini?', '100', '120', '135', '150', '165', 'D', 'Total jumlah buku yang dibaca adalah 60+45+30=135.', '2024-06-27 08:45:25', '2024-06-27 08:45:25', NULL),
(230, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Grafik dan Diagram', NULL, NULL, NULL, NULL, 'Sebuah diagram batang vertikal menunjukkan pengeluaran bulanan seorang individu untuk kebutuhan sehari-hari selama satu tahun. Jika pengeluaran bulan Januari adalah 1200 dan bulan Februari adalah 1400, berapa total pengeluaran individu tersebut selama setahun?', '15600', '16800', '18000', '19200', '20400', 'D', 'Total pengeluaran individu selama setahun adalah 12×(1200+1400)=19200.', '2024-06-27 08:46:23', '2024-06-27 08:46:23', NULL),
(231, 'Tes Potensi Skolastik', 'Pengetahuan Kuantitatif', NULL, NULL, NULL, NULL, NULL, NULL, 'Grafik dan Diagram', NULL, NULL, NULL, NULL, 'Sebuah grafik garis menunjukkan pertumbuhan populasi dua kota, X dan Y, selama 5 tahun terakhir. Jika populasi kota X pada tahun pertama adalah 10000 dan pada tahun kelima adalah 12000, berapa persentase pertumbuhan populasi kota X selama periode ini?', '10%', '12%', '15%', '18%', '20%', 'B', 'Persentase pertumbuhan populasi kota X adalah 12000−10000/10000 ×100%=20%.', '2024-06-27 08:47:58', '2024-06-27 08:47:58', NULL),
(232, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, 'Bacalah teks berikut dengan seksama.\r\n\r\n\"Di tengah hiruk pikuk kota metropolitan, terdapat sebuah taman kecil yang tersembunyi di antara bangunan pencakar langit. Taman ini merupakan oase bagi warga kota yang ingin menikmati ketenangan dan hijauan di tengah kesibukan mereka. Pepohonan rindang menaungi bangku-bangku kayu yang tersusun rapi di sepanjang jalan setapak. Air mengalir pelan di kolam kecil di tengah taman, menarik burung-burung kicauan untuk singgah sejenak. Taman ini bukan hanya tempat untuk beristirahat sebentar, tetapi juga menjadi saksi bisu bagi berbagai kisah cinta dan pertemanan yang terjalin di antara pengunjungnya.\"\r\n\r\nBerdasarkan teks di atas, apa yang dapat disimpulkan tentang taman tersebut?', 'Taman ini berada di tengah kota metropolitan.', 'Taman ini memiliki pepohonan yang tidak rindang.', 'Taman ini tidak memiliki air mengalir di kolam kecilnya.', 'Taman ini tidak digunakan untuk pertemuan romantis.', 'Taman ini tidak menarik burung-burung untuk singgah.', 'A', 'Teks menyebutkan bahwa taman tersebut terletak di tengah hiruk pikuk kota metropolitan.', '2024-06-27 09:47:59', '2024-06-27 09:47:59', NULL),
(233, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, 'Bacalah teks berikut dengan seksama.\r\n\r\n\"Di sebuah desa kecil di tepi sungai, hidup seorang nelayan tua yang terkenal dengan tangkapannya yang melimpah. Setiap pagi, dia akan meluncurkan perahunya ke tengah sungai yang tenang, mencari ikan untuk dijual di pasar desa. Meskipun usianya sudah lanjut, kepiawaian dan ketangkasannya dalam mengelola perahunya serta memancing ikan tetap memukau warga desa. Nelayan tua ini juga dikenal ramah dan suka bercerita kepada anak-anak desa tentang petualangan di laut yang pernah dialaminya di masa muda.\"\r\n\r\nBerdasarkan teks di atas, mengapa nelayan tua tersebut dikenal oleh warga desa?', 'Karena dia tidak pernah menangkap ikan.', 'Karena dia tidak bisa mengelola perahunya dengan baik.', 'Karena dia suka bercerita kepada anak-anak desa.', 'Karena dia tidak ramah kepada anak-anak desa.', 'Karena dia tidak memiliki kepiawaian dalam memancing.', 'C', 'Nelayan tua tersebut dikenal karena kepiawaiannya dalam memancing dan juga karena kegemarannya bercerita kepada anak-anak desa.', '2024-06-27 09:48:54', '2024-06-27 09:48:54', NULL),
(234, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, 'Bacalah teks berikut dengan seksama.\r\n\r\n\"Pada zaman dahulu kala, di sebuah kerajaan kecil di pedalaman hutan, hiduplah seorang putri yang terkenal dengan kecantikannya yang memukau. Setiap pagi, dia akan berjalan-jalan di taman istana sambil mengagumi bunga-bunga yang mekar di bawah sinar matahari pagi. Namun, kecantikannya bukanlah satu-satunya hal yang membuatnya istimewa. Putri ini juga memiliki hati yang penuh kebaikan dan selalu membantu rakyat jelata yang membutuhkan.\"\r\n\r\nBerdasarkan teks di atas, apa yang membuat putri tersebut istimewa?', 'Kecantikannya yang memukau.', 'Keangkuhannya yang tidak disukai rakyat.', 'Keburukannya dalam memperlakukan rakyat jelata.', 'Kekayaannya yang berlimpah.', 'Kebodohannya dalam mengagumi bunga-bunga.', 'A', 'Putri tersebut istimewa karena kecantikannya yang memukau dan juga hatinya yang penuh kebaikan.', '2024-06-27 09:49:37', '2024-06-27 09:49:37', NULL),
(235, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, 'Bacalah teks berikut dengan seksama.\r\n\r\n\"Pada suatu hari yang cerah, sekelompok anak-anak bermain di lapangan terbuka dekat sekolah mereka. Mereka saling berlarian dan tertawa riang, menikmati kebebasan mereka di bawah sinar matahari. Tidak jauh dari sana, seorang kakek duduk di bangku taman sambil mengamati mereka dengan senyuman. Kakek ini adalah seorang mantan guru di sekolah itu, yang kini pensiun setelah mengabdikan diri puluhan tahun dalam dunia pendidikan.\"\r\n\r\nBerdasarkan teks di atas, apa yang dapat disimpulkan tentang hubungan antara kakek dan anak-anak tersebut?', 'Kakek tidak memiliki hubungan yang baik dengan anak-anak.', 'Anak-anak tidak menghargai keberadaan kakek.', 'Kakek adalah seorang guru yang masih mengajar di sekolah itu.', 'Anak-anak tidak menikmati bermain di lapangan terbuka.', 'Kakek adalah mantan guru yang pensiun.', 'E', 'Teks menyebutkan bahwa kakek adalah mantan guru yang kini pensiun setelah mengabdikan diri dalam dunia pendidikan.', '2024-06-27 09:50:25', '2024-06-27 09:50:25', NULL),
(236, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Pemahaman Teks', NULL, NULL, 'Bacalah teks berikut dengan seksama.\r\n\r\n\"Di sebuah desa yang terletak di lereng gunung, terdapat sebuah sungai kecil yang mengalir jernih di antara kebun-kebun dan sawah. Sungai ini menjadi sumber kehidupan bagi penduduk desa, menyediakan air untuk irigasi pertanian dan menjadi tempat bermain bagi anak-anak di sore hari. Namun, belakangan ini, sungai tersebut mulai tercemar oleh limbah dari pabrik-pabrik yang berlokasi di hulu sungai, mengancam kelangsungan hidup ekosistem di sekitarnya.\"\r\n\r\nBerdasarkan teks di atas, apa yang sedang terjadi dengan sungai di desa tersebut?', 'Sungai tidak memiliki manfaat bagi penduduk desa.', 'Sungai menjadi tempat bermain bagi anak-anak.', 'Sungai tidak tercemar oleh limbah pabrik.', 'Sungai tidak menyediakan air untuk pertanian.', 'Sungai tercemar oleh limbah pabrik.', 'E', 'Teks menyebutkan bahwa sungai tersebut mulai tercemar oleh limbah dari pabrik-pabrik di hulu sungai.', '2024-06-27 09:51:12', '2024-06-27 09:51:12', NULL),
(237, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Kaidah Bahasa', NULL, NULL, 'Pilihlah kalimat yang menggunakan konjungsi dengan benar.', 'Saya suka bermain tenis, akan tetapi hari ini hujan deras.', 'Dia pergi ke toko buku, meskipun tidak memiliki uang banyak.', 'Ani ingin makan es krim, tetapi Rini lebih suka minum jus.', 'Kamu bisa memilih warna merah, atau warna hijau untuk dekorasi ruangan.', 'Ia tidak hanya pandai berhitung, tetapi juga mahir dalam bahasa Inggris.', 'E', 'Kalimat ini menggunakan konjungsi \"tetapi\" dengan benar untuk menyatakan hubungan yang kontras antara dua hal.', '2024-06-27 09:53:08', '2024-06-27 09:53:08', NULL),
(238, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Kaidah Bahasa', NULL, NULL, 'Pilihlah kata yang sesuai untuk melengkapi kalimat berikut.\r\n\r\n\"Kamu harus memilih __________ yang terbaik untuk keberhasilan proyek ini.\"', 'Solusi', 'Solusinya', 'Solusimu', 'Solusikan', 'Solusi-mu', 'A', 'Kalimat membutuhkan kata benda \"solusi\" untuk melengkapi makna kalimat.', '2024-06-27 09:53:48', '2024-06-27 09:53:48', NULL),
(239, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Sastra', NULL, NULL, 'Bacalah cuplikan puisi berikut dengan seksama.\r\n\r\nHujan turun lagi,\r\nMemadati jalanan,\r\nMembasahi bumi kering,\r\nMenyegarkan hati yang resah.\r\n\r\nApa tema utama yang diungkapkan dalam puisi ini?', 'Keindahan hujan', 'Kegelisahan manusia', 'Kehidupan sehari-hari', 'Alam yang subur', 'Kesegaran alam setelah hujan', 'E', 'Puisi ini menggambarkan suasana alam yang menyegarkan setelah hujan turun.', '2024-06-27 09:56:27', '2024-06-27 09:56:27', NULL),
(240, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Sastra', NULL, NULL, 'Bacalah cuplikan cerpen berikut dengan seksama.\r\n\r\nIa duduk sendiri di tepi pantai, memandangi ombak yang menghantam karang dengan gemuruh. Di kejauhan, matahari mulai tenggelam di balik cakrawala, mewarnai langit dengan sentuhan oranye dan merah menyala. Seorang pemuda datang menghampirinya, membawa secarik kain putih dan duduk di sebelahnya dengan senyum lembut.\r\n\r\nApa konflik utama yang mungkin terjadi dalam cerita ini?', 'Pemuda dan gadis bertengkar', 'Keindahan alam di tepi pantai', 'Hubungan antara pemuda dan gadis', 'Pemuda kehilangan jalan pulang', 'Keindahan matahari terbenam', 'C', 'Cerpen ini menunjukkan adanya interaksi antara pemuda dan gadis di tepi pantai.', '2024-06-27 09:58:11', '2024-06-27 09:58:11', NULL),
(241, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Sastra', NULL, NULL, 'Bacalah cuplikan drama berikut dengan seksama.\r\n\r\nPeristiwa tragis itu meruntuhkan hati semua orang di desa kecil ini. Suara tangis dan ratapan memenuhi udara malam yang dingin. Tubuh sang pahlawan tergeletak tak bernyawa di atas panggung, dengan luka-luka yang mengerikan. Penduduk desa menyesali nasib tragis yang menimpa tokoh terbaik mereka.\r\n\r\nApa tema yang dominan dalam cuplikan drama ini?', 'Perang saudara', 'Kebencian antar tetangga', 'Pengorbanan pahlawan', 'Kesedihan di desa kecil', 'Keajaiban penyembuhan', 'C', 'Cuplikan drama ini menggambarkan kesedihan dan pengorbanan yang dirasakan oleh penduduk desa atas pahlawan mereka yang gugur.', '2024-06-27 09:59:24', '2024-06-27 09:59:24', NULL),
(242, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Penafsiran Teks', NULL, NULL, 'Bacalah cuplikan berikut dengan seksama.\r\n\r\n\"Di tengah hutan belantara, seekor singa jantan memimpin kelompoknya dengan gagah berani. Setiap langkahnya penuh percaya diri, mengesankan dan memukau para anggotanya. Singa ini tidak hanya bertanggung jawab untuk mencari makanan, tetapi juga melindungi kelompoknya dari ancaman predator lain di hutan.\"\r\n\r\nApa kesan utama yang dapat Anda ambil dari cuplikan tersebut?', 'Singa jantan adalah pemimpin yang lemah.', 'Singa jantan mengesankan anggotanya dengan keberanian dan ketegasan.', 'Singa jantan tidak peduli dengan keselamatan kelompoknya.', 'Singa jantan hanya fokus pada kebutuhan pribadinya.', 'Singa jantan tidak memiliki peran penting dalam kelompoknya.', 'B', 'Cuplikan tersebut menggambarkan singa jantan sebagai pemimpin yang gagah berani dan penuh percaya diri.', '2024-06-27 10:01:59', '2024-06-27 10:01:59', NULL),
(243, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Keterampilan Menulis', NULL, NULL, 'Tulislah sebuah esai argumentatif tentang pentingnya mendukung seni dan budaya lokal di Indonesia. Berikan argumen yang kuat dan dukung dengan contoh konkret.', 'Seni dan budaya lokal adalah warisan berharga yang harus dilestarikan.', 'Seni dan budaya lokal tidak memiliki pengaruh signifikan di masyarakat.', 'Seni dan budaya lokal hanya relevan bagi kalangan tertentu.', 'Pemerintah seharusnya fokus pada seni dan budaya internasional.', 'Seni dan budaya lokal tidak perlu mendapat dukungan finansial.', 'A', 'Esai harus menyampaikan pentingnya mendukung seni dan budaya lokal sebagai bagian dari warisan budaya yang kaya dan penting untuk identitas nasional serta keberlanjutan budaya.', '2024-06-27 10:05:13', '2024-06-27 10:05:13', NULL),
(244, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Keterampilan Menulis', NULL, NULL, 'Tulislah sebuah surat kepada editor surat kabar setempat tentang pentingnya memperbanyak liputan tentang isu-isu lingkungan hidup. Sertakan argumentasi yang kuat dan usulan solusi konkret.', 'Isu lingkungan tidak penting dalam media massa.', 'Media massa harus memprioritaskan isu-isu politik daripada lingkungan.', 'Perlunya pendidikan lingkungan di sekolah-sekolah.', 'Masyarakat tidak peduli dengan masalah lingkungan.', 'Isu lingkungan hanya relevan bagi kalangan tertentu.', 'C', 'Surat harus mendukung peningkatan liputan tentang isu lingkungan dalam media massa dan menyarankan pendidikan lingkungan sebagai solusi untuk meningkatkan kesadaran publik.', '2024-06-27 10:06:05', '2024-06-27 10:06:05', NULL),
(245, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Keterampilan Menulis', NULL, NULL, 'Buatlah sebuah cerita pendek dengan tema \"keajaiban persahabatan\". Pastikan cerita memiliki alur yang jelas, karakter yang kuat, dan pesan moral yang mendalam.', 'Persahabatan hanya berpusat pada kepentingan pribadi.', 'Persahabatan harus selalu berakhir bahagia.', 'Kejujuran dan kepercayaan adalah dasar dari persahabatan yang kokoh.', 'Persahabatan tidak memiliki pengaruh positif dalam kehidupan seseorang.', 'Persahabatan hanya bisa terjalin antara orang dengan latar belakang yang sama.', 'C', 'Cerita harus menunjukkan nilai-nilai persahabatan yang kuat, di mana kejujuran dan kepercayaan menjadi landasan yang penting.', '2024-06-27 10:06:51', '2024-06-27 10:06:51', NULL),
(246, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Keterampilan Menulis', NULL, NULL, 'Tulislah sebuah artikel opini mengenai peran teknologi dalam pendidikan di era digital. Jelaskan dampak positif dan negatifnya serta saran untuk pemanfaatan yang lebih efektif.', 'Teknologi tidak memiliki peran penting dalam pendidikan.', 'Pemanfaatan teknologi dalam pendidikan harus dibatasi.', 'Perlu adanya integrasi teknologi dalam kurikulum pendidikan.', 'Teknologi membuat siswa lebih malas dalam belajar.', 'Pemanfaatan teknologi hanya relevan bagi sekolah-sekolah kota besar.', 'C', 'Artikel opini harus menyoroti manfaat teknologi dalam pendidikan, dengan mengemukakan bahwa integrasi teknologi dalam kurikulum dapat meningkatkan kualitas pembelajaran.', '2024-06-27 10:07:37', '2024-06-27 10:07:37', NULL),
(247, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Indonesia', 'Keterampilan Menulis', NULL, NULL, 'Buatlah sebuah karangan argumentatif tentang pentingnya menjaga kebersihan lingkungan di sekitar sekolah. Sertakan bukti dan argumen yang mendukung pendapat Anda.', 'Kebersihan lingkungan tidak mempengaruhi kesehatan siswa.', 'Siswa tidak memiliki tanggung jawab untuk menjaga kebersihan sekolah.', 'Pentingnya edukasi tentang pengelolaan sampah di sekolah.', 'Lingkungan sekolah tidak mempengaruhi citra sekolah di mata masyarakat.', 'Lingkungan sekolah seharusnya dibiarkan alami tanpa campur tangan manusia.', 'C', 'Karangan argumentatif harus menekankan pentingnya menjaga kebersihan lingkungan sekolah melalui edukasi tentang pengelolaan sampah, sebagai upaya untuk menciptakan lingkungan belajar yang bersih dan sehat.', '2024-06-27 10:08:23', '2024-06-27 10:08:23', NULL),
(248, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Tata Bahasa dan Kosa Kata', 'Choose the sentence that contains an error in grammar or vocabulary.', 'The team have won the championship for three consecutive years.', 'Each of the students were given a certificate of achievement.', 'Her ability to speaks multiple languages is impressive.', 'He enjoys to play the piano in his spare time.', 'The company\'s profits has increased significantly this year.', 'C', 'Kesalahan terletak pada kata kerja \"speaks\" yang seharusnya \"speak\" karena subjek \"ability\" merupakan kata benda tunggal.', '2024-06-27 10:11:45', '2024-06-27 10:11:45', NULL),
(249, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Tata Bahasa dan Kosa Kata', 'Identify the correct form of the verb to complete the sentence.\r\n\r\nShe _____ to the gym every day after work.', 'go', 'goes', 'going', 'went', 'gone', 'B', 'Kata kerja \"goes\" digunakan untuk subjek tunggal \"She\".', '2024-06-27 10:12:27', '2024-06-27 10:12:27', NULL),
(250, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Sastra', 'What literary device is used in the following line: \"The silence was as deep as the darkest night\"?', 'Simile', 'Metaphor', 'Personification', 'Hyperbole', 'Alliteration', 'A', 'Simile adalah perbandingan langsung antara dua hal yang menggunakan kata \"seperti\" atau \"bagai\".', '2024-06-27 10:14:06', '2024-06-27 10:14:06', NULL),
(251, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Keterampilan Menulis', 'Write a persuasive essay arguing for or against the use of social media in education. Provide strong arguments and support them with specific examples.', 'Social media distracts students from learning.', 'Social media enhances communication between students and teachers.', 'Social media has no impact on educational outcomes.', 'Education should completely ban the use of social media.', 'Social media should be used only for entertainment purposes.', 'B', 'Argumen ini kuat karena social media memungkinkan komunikasi yang lebih mudah antara siswa dan guru, memfasilitasi kolaborasi dan pertukaran informasi yang lebih efisien dalam konteks pendidikan.', '2024-06-27 10:18:19', '2024-06-27 10:18:19', NULL),
(252, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Keterampilan Menulis', 'Compose a letter to the editor of a local newspaper expressing your opinion on the importance of preserving historical landmarks in your community. Include reasons why these landmarks should be protected.', 'Historical landmarks have no significance to the community.', 'Preserving historical landmarks promotes cultural identity.', 'Historical landmarks should be demolished for modern development.', 'The community should focus on new construction rather than preservation.', 'Preserving historical landmarks is a waste of resources.', 'B', 'Surat ini mengungkapkan pendapat tentang pentingnya melestarikan peninggalan sejarah untuk mempertahankan identitas budaya dan nilai-nilai yang terkait dengan masyarakat setempat.', '2024-06-27 10:19:04', '2024-06-27 10:19:04', NULL),
(253, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Keterampilan Menulis', 'Write a descriptive essay about a memorable journey you have taken. Capture the sights, sounds, and emotions experienced during this journey.', 'Memorable journeys are forgettable experiences.', 'The journey had no impact on personal growth.', 'Describing a journey is an ineffective way to convey experiences.', 'A journey through nature can be life-changing.', 'Personal journeys should be kept private and not shared.', 'D', 'Esai deskriptif ini mencakup pengalaman pribadi tentang perjalanan yang berkesan melalui alam, menangkap nuansa pengalaman tersebut dengan detail dan emosi yang kuat.', '2024-06-27 10:19:50', '2024-06-27 10:19:50', NULL),
(254, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Keterampilan Menulis', 'Create a short story that begins with the line: \"The old bookstore stood at the end of the narrow alleyway, its windows dusty and its shelves lined with ancient volumes.\"', 'Old bookstores have no appeal to modern readers.', 'The bookstore had no customers or visitors.', 'The old bookstore became a hub for literary enthusiasts.', 'Bookstores are irrelevant in the digital age.', 'Bookstores should focus on selling new books only.', 'C', 'Cerita pendek ini mengembangkan ide dari kalimat awal yang menunjukkan transformasi sebuah toko buku tua menjadi tempat berkumpul bagi para penggemar sastra.', '2024-06-27 10:20:41', '2024-06-27 10:20:41', NULL),
(255, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Literasi dalam Bahasa Inggris', NULL, NULL, 'Keterampilan Menulis', 'Write an argumentative essay discussing the impact of artificial intelligence on the future of work. Address both the opportunities and challenges posed by AI in various industries.', 'Artificial intelligence will have no effect on future employment.', 'AI should replace all human workers for efficiency.', 'The integration of AI will create new job opportunities.', 'AI technology is too complex for practical use.', 'AI should be banned from workplaces to protect jobs.', 'C', 'Esai argumentatif ini mengulas tentang dampak AI terhadap masa depan kerja, mencantumkan bahwa meskipun AI menghadirkan tantangan, integrasinya juga membuka peluang pekerjaan baru dalam berbagai industri.', '2024-06-27 10:21:26', '2024-06-27 10:21:26', NULL),
(256, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Operasi Aritmatika Dasar', NULL, 'Hitunglah nilai dari 7×(18−3)+4.', '101', '103', '105', '107', '109', 'C', '7×(18−3)+4=7×15+4=105+4=109.', '2024-06-27 10:25:28', '2024-06-27 10:25:28', NULL),
(257, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Operasi Aritmatika Dasar', NULL, 'Sederhanakan ekspresi berikut: 48÷(3×5)+7.', '11', '12', '13', '14', '15', 'B', '48÷(3×5)+7=48÷15+7=3+7=10.', '2024-06-27 10:26:24', '2024-06-27 10:26:24', NULL),
(258, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Operasi Aritmatika Dasar', NULL, 'Tentukan hasil dari (25−12)×4+18÷3.', '34', '36', '38', '40', '42', 'D', '(25−12)×4+18÷3=13×4+6=52+6=58.', '2024-06-27 10:27:18', '2024-06-27 10:27:18', NULL),
(259, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Persentase', NULL, 'Dalam sebuah toko buku, harga sebuah novel naik 10% setiap tahun. Jika harga novel saat ini adalah Rp 200.000, berapa harga novel tersebut dalam 3 tahun ke depan?', 'Rp 242.000', 'Rp 240.000', 'Rp 220.000', 'Rp 220.500', 'Rp 242.500', 'E', 'Harga novel setelah 3 tahun adalah 200.000×(1.10)³ = 200.000×1.331=266.200.', '2024-06-27 10:30:32', '2024-06-27 10:30:32', NULL),
(260, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Persentase', NULL, 'Seorang siswa menjawab 75% dari soal ujian dengan benar. Jika ada 40 soal dalam ujian tersebut dan masing-masing soal bernilai 5 poin, berapa total skor siswa dalam ujian tersebut?', '150', '155', '160', '165', '170', 'C', 'Jumlah soal yang dijawab benar adalah 0.75×40=30, dan total skor adalah 30×5=150.', '2024-06-27 10:31:20', '2024-06-27 10:31:20', NULL),
(261, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Persentase', NULL, 'Sebuah hotel menaikkan harga kamar tidurnya sebesar 15% untuk musim liburan. Jika jumlah kamar yang terjual hanya meningkat 10%, berapa persen pendapatan hotel dari penjualan kamar tidur yang meningkat?', '12%', '13.5%', '14.5%', '15%', '16%', 'B', 'Meskipun harga kamar naik 15%, pendapatan hanya meningkat 10% dari jumlah penjualan kamar.', '2024-06-27 10:32:01', '2024-06-27 10:32:01', NULL),
(262, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Rasio dan Proporsi', NULL, 'Sebuah kotak mengandung 120 kelereng, termasuk kelereng merah, hijau, dan biru dalam rasio 2:3:5. Berapa banyak kelereng biru dalam kotak tersebut?', '40', '45', '50', '55', '60', 'E', 'Jumlah kelereng biru adalah 5/10 × 120=60.', '2024-06-27 10:35:10', '2024-06-27 10:35:10', NULL),
(263, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Rasio dan Proporsi', NULL, 'Seorang fotografer ingin mencetak foto berukuran 24 cm x 18 cm dari sebuah gambar dengan perbandingan 4:3. Jika lebar gambar asli adalah 60 cm, berapa panjang gambar asli tersebut dalam cm?', '45', '48', '54', '56', '64', 'C', 'Lebar gambar adalah 60 cm, sehingga panjangnya adalah 3/4 × 60=45 cm.', '2024-06-27 10:36:04', '2024-06-27 10:36:04', NULL),
(264, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Persamaan dan Ungkapan Aljabar', NULL, 'Sebuah kotak berisi beberapa bola merah dan biru. Jumlah bola merah adalah 𝑥, sedangkan jumlah bola biru adalah 𝑦. Jika total bola dalam kotak tersebut adalah 20, dan perbandingan bola merah terhadap bola biru adalah 3:2, tentukan nilai 𝑥+𝑦.', '10', '12', '14', '16', '18', 'B', 'Diketahui x+y=20 dan x/y = 3/2. Dengan mengganti x=12 dan y=8, maka x+y=12+8=20.', '2024-06-27 10:39:38', '2024-06-27 10:39:38', NULL);
INSERT INTO `soal_tryout` (`id`, `question_type`, `tps_type`, `penalaran_type`, `penalaran_induktif_detail`, `penalaran_deduktif_detail`, `penalaran_kuantitatif_detail`, `pemahaman_pemahaman_type`, `pemahaman_type`, `kuantitatif_type`, `tl_type`, `tl_indonesia_type`, `tl_matematika_type`, `tl_inggris_type`, `question`, `option_a`, `option_b`, `option_c`, `option_d`, `option_e`, `correct_answer`, `answer_explanation`, `created_at`, `updated_at`, `materi_id`) VALUES
(265, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Persamaan dan Ungkapan Aljabar', NULL, 'Seorang mahasiswa menginvestasikan sejumlah uang dalam dua jenis reksa dana, A dan B. Jumlah uang yang diinvestasikan dalam reksa dana A adalah 𝑥, dan dalam reksa dana B adalah 𝑦. Jumlah total investasinya adalah 10.000. Jika keuntungan yang diperoleh dari reksa dana A adalah 12% per tahun, dan dari reksa dana B adalah 8% per tahun, dan total keuntungan yang diperoleh adalah 960, tentukan nilai dari 𝑥.', '4.000', '4.500', '5.000', '5.500', '6.000', 'C', 'Diketahui total investasi x+y=10,000 dan keuntungan dari reksa dana A 12% per tahun, serta dari reksa dana B 8% per tahun, dengan total keuntungan 960.', '2024-06-27 10:42:46', '2024-06-27 10:42:46', NULL),
(266, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Geometri Dasar', NULL, 'Sebuah segitiga memiliki panjang sisi-sisi sebagai berikut: AB = 6 cm, BC = 8 cm, dan CA = 10 cm. Sudut ∠ABC adalah 90°. Hitunglah luas dari segitiga ABC!', '24 cm²', '30 cm²', '32 cm²', '36 cm²', '40 cm²', 'C', 'Segitiga ABC adalah segitiga siku-siku dengan panjang sisi AB = 6 cm, BC = 8 cm, dan CA = 10 cm. Luas segitiga siku-siku dapat dihitung dengan rumus Luas = 1/2×alas×tinggi. Dengan alas = 8 cm dan tinggi = 6 cm, luasnya adalah 1/2×8×6=24 cm².', '2024-06-27 10:46:25', '2024-06-27 10:46:25', NULL),
(267, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Geometri Dasar', NULL, 'Sebuah jajaran genjang memiliki panjang satu diagonal 12 cm dan panjang kedua diagonal 16 cm. Jika sudut antara kedua diagonal tersebut adalah 120°, hitunglah luas jajaran genjang tersebut!', '64 cm²', '96 cm²', '128 cm²', '144 cm²', '192 cm²', 'D', 'Jajaran genjang dengan panjang diagonal d₁ = 12 cm dan d₂ = 16 cm serta sudut antara keduanya 120°, luasnya dapat dihitung dengan rumus Luas = 1/2×d1×d2×sin(θ), di mana 𝜃 adalah sudut di antara kedua diagonal. Substitusi nilai memberikan Luas = 1/2×12×16×sin(120°) = 1/2×12×16×√3/2=144 cm².', '2024-06-27 10:51:56', '2024-06-27 10:51:56', NULL),
(268, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Statistik dan Probabilitas', NULL, 'Sebuah perusahaan memiliki data waktu tunggu pelanggan untuk mendapatkan layanan di loket tertentu. Waktu tunggu tersebut terdistribusi secara eksponensial dengan rata-rata 5 menit. Tentukan peluang bahwa waktu tunggu satu pelanggan lebih dari 10 menit!', '0.1353', '0.2231', '0.3293', '0.4405', '0.5543', 'B', 'Penjelasan: Waktu tunggu pelanggan terdistribusi secara eksponensial dengan rata-rata λ= 1/5 (dalam satuan menit). Peluang bahwa waktu tunggu lebih dari 10 menit dapat dihitung dengan P(X>10) = e ^−λ⋅10 = e^−10/5 = e−² ≈ 0.1353. Jadi, peluang bahwa waktu tunggu lebih dari 10 menit adalah 1−0.1353=0.8647.', '2024-06-27 10:57:34', '2024-06-27 10:57:34', NULL),
(269, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Statistik dan Probabilitas', NULL, 'Sebuah survei menemukan bahwa 60% dari responden menggunakan layanan streaming musik setiap hari, 30% mengatakan mereka menggunakan layanan seminggu sekali, dan sisanya jarang menggunakan layanan. Jika dipilih secara acak, tentukan peluang bahwa responden menggunakan layanan ini setidaknya seminggu sekali.', '0.70', '0.75', '0.80', '0.85', '0.90', 'D', 'Peluang bahwa responden menggunakan layanan setidaknya seminggu sekali adalah 1 dikurangi peluang bahwa mereka menggunakan layanan kurang dari seminggu sekali. Jadi, P(setidaknya seminggu sekali)=1−0.15=0.85.', '2024-06-27 10:58:58', '2024-06-27 10:58:58', NULL),
(276, 'Tes Literasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Penalaran Matematika', NULL, 'Pemecahan Masalah Matematis', NULL, 'Sebuah perusahaan mengirimkan dua jenis produk, A dan B, dalam jumlah yang berbeda setiap bulan. Pada bulan pertama, perusahaan mengirimkan 120 unit produk A dan 80 unit produk B. Setiap bulan berikutnya, jumlah produk A yang dikirim berkurang sebesar 10% dari jumlah bulan sebelumnya, sedangkan jumlah produk B yang dikirim bertambah sebesar 20% dari jumlah bulan sebelumnya. Pada bulan keempat, berapa total unit produk A dan B yang dikirim perusahaan?', '225.82 unit', '225.92 unit', '225.80 unit', '225.75 unit', '225.72 unit', 'E', 'Pada bulan pertama:\r\n~ Produk A: 120 unit\r\n~ Produk B: 80 unit\r\nBulan kedua:\r\n~ Produk A: 120×0.9=108 unit\r\n~ Produk B: 80×1.2=96 unit\r\nBulan ketiga:\r\n~ Produk A: 108×0.9=97.2 unit\r\n~ Produk B: 96×1.2=115.2 unit\r\nBulan keempat:\r\n~ Produk A: 97.2×0.9=87.48 unit\r\n~ Produk B: 115.2×1.2=138.24 unit\r\nTotal unit pada bulan keempat: \r\n87.48+138.24=225.72', '2024-06-29 06:33:45', '2024-06-29 06:33:45', NULL);

